INSERT INTO `movies` (`id`, `title`, `description`, `release_date`, `poster_url`, `trailer_url`, `duration`, `imdb_rating`, `director`, `views`, `genre_id`, `created_at`, `updated_at`) VALUES
(1, 'A Working Mans', 'Levon Cade left behind a decorated military career in the black ops to live a simple life working construction. But when his boss\'s daughter, who is like family to him, is taken by human traffickers, his search to bring her home uncovers a world of corruption far greater than he ever could have imagined.', '2025-03-26', 'https://image.tmdb.org/t/p/w500/6FRFIogh3zFnVWn7Z6zcYnIbRcX.jpg', 'https://www.youtube.com/embed/mdfrG2cLK58', 116, 6.6, 'David Ayer', 0, 28, '2025-05-21 11:53:53', '2025-06-30 03:14:53'),
(2, 'The Great Escapess', 'The Great Escape is a 1963 American epic war adventure film[2] starring Steve McQueen, James Garner and Richard Attenborough and featuring James Donald, Charles Bronson, Donald Pleasence, James Coburn, Hannes Messemer, David McCallum, Gordon Jackson, John Leyton and Angus Lennie. It was filmed in Panavision, and its musical score was composed by Elmer Bernstein. Adapted from Paul Brickhill\'s 1950 non-fiction book of the same name, the film depicts a heavily fictionalized version of the mass escape by British Commonwealth prisoners of war from German POW camp Stalag Luft III in World War II. The film made numerous compromises for its commercial appeal, including its portrayal of American involvement in the escape.', '1963-07-04', 'https://image.tmdb.org/t/p/w500/h7shL668vhC2wsZQSBWzxkMuZ8K.jpg', 'https://www.youtube.com/embed/MwMxP_SLL9s?si=h8Ly92qCxdC7MEEd', 2, 8.2, 'John Sturges', 0, 28, '2025-05-21 11:53:54', '2025-06-25 08:37:08'),
(3, 'Warfares', 'A platoon of Navy SEALs embarks on a dangerous mission in Ramadi, Iraq, with the chaos and brotherhood of war retold through their memories of the event.', '2025-04-09', 'https://image.tmdb.org/t/p/w500/srj9rYrjefyWqkLc6l2xjTGeBGO.jpg', 'https://www.youtube.com/embed/JER0Fkyy3tw', 95, 7.2, 'Ray Mendoza', 0, 28, '2025-05-21 11:53:55', '2025-06-25 08:24:31'),
(4, 'Tin Soldier', 'An ex-special forces operative seeks revenge against a cult leader who has corrupted his former comrades, the Shinjas. This leader, known as The Bokushi, promises veterans a purpose and protection, but is revealed to be a destructive influence. The ex-soldier, Nash Cavanaugh, joins forces with military operative Emmanuel Ashburn to infiltrate the Bokushi\'s fortress and expose his reign of terror', '2025-05-22', 'https://image.tmdb.org/t/p/w500/lFFDrFLXywFhy6khHes1LCFVMsL.jpg', 'https://www.youtube.com/embed/LZUFTczZfG8', 87, 5.0, 'Brad Furman', 0, 28, '2025-05-21 11:53:56', '2025-05-21 11:53:56'),
(5, 'Mission: Impossible - The Final Reckoning', 'Ethan Hunt and the IMF team continue their search for the terrifying AI known as the Entity — which has infiltrated intelligence networks all over the globe — with the world\'s governments and a mysterious ghost from Ethan\'s past on their trail. Joined by new allies and armed with the means to shut the Entity down for good, Hunt is in a race against time to prevent the world as we know it from changing forever.', '2025-05-17', 'https://image.tmdb.org/t/p/w500/z53D72EAOxGRqdr7KXXWp9dJiDe.jpg', 'https://www.youtube.com/embed/G1VBfMCZVkw', 170, 7.2, 'Christopher McQuarrie', 0, 28, '2025-05-21 11:53:56', '2025-05-21 11:53:56'),
(6, 'Thunderbolts*', 'After finding themselves ensnared in a death trap, seven disillusioned castoffs must embark on a dangerous mission that will force them to confront the darkest corners of their pasts.', '2025-04-30', 'https://image.tmdb.org/t/p/w500/m9EtP1Yrzv6v7dMaC9mRaGhd1um.jpg', 'https://www.youtube.com/embed/-sAOWhvheK8', 127, 7.5, 'Jake Schreier', 0, 28, '2025-05-21 11:53:57', '2025-05-21 11:53:57'),
(7, 'Last Bullet', 'Car genius Lino returns to conclude his vendetta against Areski and the corrupt commander who ruined their lives in this turbo-charged trilogy finale.', '2025-05-06', 'https://image.tmdb.org/t/p/w500/lCI5y1KkjgMoTkZiCleqji00XeE.jpg', 'https://www.youtube.com/embed/r2u9GifyDg0', 111, 6.8, 'Guillaume Pierret', 0, 28, '2025-05-21 11:53:58', '2025-05-21 11:53:58'),
(8, 'Brave Citizen', 'An expelled boxing champion, who now is a high-school teacher, witnesses intolerable violence and throws her first punch to build justice against it, while putting on a mask.', '2023-10-25', 'https://image.tmdb.org/t/p/w500/6Ea5i6APeTfm4hHh6dg5Z733JVS.jpg', 'https://www.youtube.com/embed/nLx7YXszBYI', 112, 7.1, 'Park Jin-pyo', 0, 28, '2025-05-21 11:53:59', '2025-05-21 11:53:59'),
(9, 'Exterritorial', 'When her son vanishes inside a US consulate, ex-special forces soldier Sara does everything in her power to find him — and uncovers a dark conspiracy.', '2025-04-29', 'https://image.tmdb.org/t/p/w500/jM2uqCZNKbiyStyzXOERpMqAbdx.jpg', 'https://www.youtube.com/embed/tlLsFEDHtWs', 109, 6.7, 'Christian Zübert', 0, 28, '2025-05-21 11:54:00', '2025-05-21 11:54:00'),
(10, 'In the Lost Lands', 'A queen sends the powerful and feared sorceress Gray Alys to the ghostly wilderness of the Lost Lands in search of a magical power, where she and her guide, the drifter Boyce, must outwit and outfight both man and demon.', '2025-02-27', 'https://image.tmdb.org/t/p/w500/dDlfjR7gllmr8HTeN6rfrYhTdwX.jpg', 'https://www.youtube.com/embed/CMyrp5Vk3mU', 102, 6.4, 'Paul W. S. Anderson', 0, 28, '2025-05-21 11:54:01', '2025-05-21 11:54:01'),
(11, 'Captain America: Brave New World', 'After meeting with newly elected U.S. President Thaddeus Ross, Sam finds himself in the middle of an international incident. He must discover the reason behind a nefarious global plot before the true mastermind has the entire world seeing red.', '2025-02-12', 'https://image.tmdb.org/t/p/w500/pzIddUEMWhWzfvLI3TwxUG2wGoi.jpg', 'https://www.youtube.com/embed/5PSzFLV-EyQ', 119, 6.1, 'Julius Onah', 0, 28, '2025-05-21 11:54:02', '2025-05-21 11:54:02'),
(12, 'Jewel Thief: The Heist Begins', 'In this high-octane battle of wits and wills, ingenious con artist Rehan devises a diamond heist while trying to outsmart Rajan, his sadistic adversary.', '2025-04-25', 'https://image.tmdb.org/t/p/w500/eujLbO0kf1eqWC8XpHUJdtAVW2J.jpg', 'https://www.youtube.com/embed/gzN46jvgTck', 118, 6.6, 'Robby Grewal', 0, 28, '2025-05-21 11:54:02', '2025-05-21 11:54:02'),
(13, 'Havoc', 'When a drug heist swerves lethally out of control, a jaded cop fights his way through a corrupt city\'s criminal underworld to save a politician\'s son.', '2025-04-25', 'https://image.tmdb.org/t/p/w500/r46leE6PSzLR3pnVzaxx5Q30yUF.jpg', 'https://www.youtube.com/embed/6txjTWLoSc8', 107, 6.5, 'Gareth Evans', 0, 28, '2025-05-21 11:54:03', '2025-05-21 11:54:03'),
(14, 'Karate Kid: Legends', 'After a family tragedy, kung fu prodigy Li Fong is uprooted from his home in Beijing and forced to move to New York City with his mother. When a new friend needs his help, Li enters a karate competition – but his skills alone aren\'t enough. Li\'s kung fu teacher Mr. Han enlists original Karate Kid Daniel LaRusso for help, and Li learns a new way to fight, merging their two styles into one for the ultimate martial arts showdown.', '2025-05-08', 'https://image.tmdb.org/t/p/w500/ckI6bmQDvvGy20FPTIW1kfGKGRK.jpg', 'https://www.youtube.com/embed/LhRXf-yEQqA', 94, 7.7, 'Jonathan Entwistle', 0, 28, '2025-05-21 11:54:04', '2025-05-21 11:54:04'),
(15, 'Sonic the Hedgehog 3', 'Sonic, Knuckles, and Tails reunite against a powerful new adversary, Shadow, a mysterious villain with powers unlike anything they have faced before. With their abilities outmatched in every way, Team Sonic must seek out an unlikely alliance in hopes of stopping Shadow and protecting the planet.', '2024-12-19', 'https://image.tmdb.org/t/p/w500/d8Ryb8AunYAuycVKDp5HpdWPKgC.jpg', 'https://www.youtube.com/embed/LH1J1EbqCaI', 110, 7.7, 'Jeff Fowler', 0, 28, '2025-05-21 11:54:05', '2025-05-21 11:54:05'),
(16, 'A Minecraft Movie', 'Four misfits find themselves struggling with ordinary problems when they are suddenly pulled through a mysterious portal into the Overworld: a bizarre, cubic wonderland that thrives on imagination. To get back home, they\'ll have to master this world while embarking on a magical quest with an unexpected, expert crafter, Steve.', '2025-03-31', 'https://image.tmdb.org/t/p/w500/yFHHfHcUgGAxziP1C3lLt0q2T4s.jpg', 'https://www.youtube.com/embed/8B1EtVPBSMw', 101, 6.5, 'Jared Hess', 0, 12, '2025-05-21 11:54:06', '2025-05-21 11:54:06'),
(17, 'Bambi: A Life in the Woods', 'The life of Bambi, a male roe deer, from his birth through childhood, the loss of his mother, the finding of a mate, the lessons he learns from his father, and the experience he gains about the dangers posed by human hunters in the forest.', '2024-10-16', 'https://image.tmdb.org/t/p/w500/vWNVHtwOhcoOEUSrY1iHRGbgH8O.jpg', 'https://www.youtube.com/embed/aALZJu_Bg9I', 77, 6.0, 'Michel Fessler', 0, 12, '2025-05-21 11:54:07', '2025-05-21 11:54:07'),
(18, 'Moana 2', 'After receiving an unexpected call from her wayfinding ancestors, Moana journeys alongside Maui and a new crew to the far seas of Oceania and into dangerous, long-lost waters for an adventure unlike anything she\'s ever faced.', '2024-11-21', 'https://image.tmdb.org/t/p/w500/aLVkiINlIeCkcZIzb7XHzPYgO6L.jpg', 'https://www.youtube.com/embed/JdSl4RMNtGE', 100, 7.1, 'David G. Derrick Jr.', 0, 12, '2025-05-21 11:54:08', '2025-05-21 11:54:08'),
(19, 'Mufasa: The Lion King', 'Mufasa, a cub lost and alone, meets a sympathetic lion named Taka, the heir to a royal bloodline. The chance meeting sets in motion an expansive journey of a group of misfits searching for their destiny.', '2024-12-18', 'https://image.tmdb.org/t/p/w500/lurEK87kukWNaHd0zYnsi3yzJrs.jpg', 'https://www.youtube.com/embed/lMXh6vjiZrI', 118, 7.4, 'Barry Jenkins', 0, 12, '2025-05-21 11:54:09', '2025-05-21 11:54:09'),
(20, 'The Legend of Ochi', 'In a remote village on the island of Carpathia, a shy farm girl named Yuri is raised to fear an elusive animal species known as ochi. But when Yuri discovers a wounded baby ochi has been left behind, she escapes on a quest to bring him home.', '2025-04-18', 'https://image.tmdb.org/t/p/w500/wVujUVvY4qvKARAslItQ4ARKqtz.jpg', 'https://www.youtube.com/embed/_jTFLg3arYU', 95, 5.9, 'Isaiah Saxon', 0, 12, '2025-05-21 11:54:10', '2025-05-21 11:54:10'),
(21, 'Mission: Impossible - Dead Reckoning Part One', 'Ethan Hunt and his IMF team embark on their most dangerous mission yet: To track down a terrifying new weapon that threatens all of humanity before it falls into the wrong hands. With control of the future and the world\'s fate at stake and dark forces from Ethan\'s past closing in, a deadly race around the globe begins. Confronted by a mysterious, all-powerful enemy, Ethan must consider that nothing can matter more than his mission—not even the lives of those he cares about most.', '2023-07-08', 'https://image.tmdb.org/t/p/w500/NNxYkU70HPurnNCSiCjYAmacwm.jpg', 'https://www.youtube.com/embed/HurjfO_TDlQ', 164, 7.5, 'Christopher McQuarrie', 0, 12, '2025-05-21 11:54:11', '2025-05-21 11:54:11'),
(22, 'xXx', 'Xander Cage is your standard adrenaline junkie with no fear and a lousy attitude. When the US Government \"recruits\" him to go on a mission, he\'s not exactly thrilled. His mission: to gather information on an organization that may just be planning the destruction of the world, led by the nihilistic Yorgi.', '2002-08-09', 'https://image.tmdb.org/t/p/w500/xeEw3eLeSFmJgXZzmF2Efww0q3s.jpg', 'https://www.youtube.com/embed/NgPdDDzVhkA', 124, 5.9, 'Rob Cohen', 0, 12, '2025-05-21 11:54:11', '2025-05-21 11:54:11'),
(23, 'Venom: The Last Dance', 'Eddie and Venom are on the run. Hunted by both of their worlds and with the net closing in, the duo are forced into a devastating decision that will bring the curtains down on Venom and Eddie\'s last dance.', '2024-10-22', 'https://image.tmdb.org/t/p/w500/vGXptEdgZIhPg3cGlc7e8sNPC2e.jpg', 'https://www.youtube.com/embed/FKBN1qAzW3s', 109, 6.7, 'Kelly Marcel', 0, 12, '2025-05-21 11:54:12', '2025-05-21 11:54:12'),
(24, 'Kraven the Hunter', 'Kraven Kravinoff\'s complex relationship with his ruthless gangster father, Nikolai, starts him down a path of vengeance with brutal consequences, motivating him to become not only the greatest hunter in the world, but also one of its most feared.', '2024-12-11', 'https://image.tmdb.org/t/p/w500/1GvBhRxY6MELDfxFrete6BNhBB5.jpg', 'https://www.youtube.com/embed/hR1-ihzff3I', 127, 6.6, 'J.C. Chandor', 0, 12, '2025-05-21 11:54:13', '2025-05-21 11:54:13'),
(25, 'Gladiator II', 'Years after witnessing the death of the revered hero Maximus at the hands of his uncle, Lucius is forced to enter the Colosseum after his home is conquered by the tyrannical Emperors who now lead Rome with an iron fist. With rage in his heart and the future of the Empire at stake, Lucius must look to his past to find strength and honor to return the glory of Rome to its people.', '2024-11-13', 'https://image.tmdb.org/t/p/w500/2cxhvwyEwRlysAmRH4iodkvo0z5.jpg', 'https://www.youtube.com/embed/TQwSz88ITAE', 148, 6.7, 'Ridley Scott', 0, 12, '2025-05-21 11:54:14', '2025-05-21 11:54:14'),
(26, 'Inside Out 2', 'Teenager Riley\'s mind headquarters is undergoing a sudden demolition to make room for something entirely unexpected: new Emotions! Joy, Sadness, Anger, Fear and Disgust, who’ve long been running a successful operation by all accounts, aren’t sure how to feel when Anxiety shows up. And it looks like she’s not alone.', '2024-06-11', 'https://image.tmdb.org/t/p/w500/vpnVM9B6NMmQpWeZvzLvDESb2QY.jpg', 'https://www.youtube.com/embed/u69y5Ie519M', 97, 7.6, 'Kelsey Mann', 0, 12, '2025-05-21 11:54:15', '2025-05-21 11:54:15'),
(27, 'Mission: Impossible', 'When Ethan Hunt, the leader of a crack espionage team whose perilous operation has gone awry with no explanation, discovers that a mole has penetrated the CIA, he\'s surprised to learn that he\'s the prime suspect. To clear his name, Hunt now must ferret out the real double agent and, in the process, even the score.', '1996-05-22', 'https://image.tmdb.org/t/p/w500/l5uxY5m5OInWpcExIpKG6AR3rgL.jpg', 'https://www.youtube.com/embed/L8Pbjh4EZRk', 110, 7.0, 'Brian De Palma', 0, 12, '2025-05-21 11:54:16', '2025-05-21 11:54:16'),
(28, 'Mickey 17', 'Unlikely hero Mickey Barnes finds himself in the extraordinary circumstance of working for an employer who demands the ultimate commitment to the job… to die, for a living.', '2025-02-28', 'https://image.tmdb.org/t/p/w500/edKpE9B5qN3e559OuMCLZdW1iBZ.jpg', 'https://www.youtube.com/embed/tA1s65o_kYM', 137, 6.9, 'Bong Joon Ho', 0, 12, '2025-05-21 11:54:17', '2025-05-21 11:54:17'),
(29, 'Amaran', 'A heroic true story of Major Mukund Varadarajan, an Indian Army officer who displayed extraordinary bravery during a counterterrorism mission in Kashmir’s Shopian district. The film captures his courage in protecting his nation and the devotion of his wife Indhu Rebecaa Varghese.', '2024-10-31', 'https://image.tmdb.org/t/p/w500/eCB06m1KUGilEOlIzb40nkQhVY0.jpg', 'https://www.youtube.com/embed/9SSd9L0SxN0', 169, 7.4, 'Rajkumar Periasamy', 0, 12, '2025-05-21 11:54:17', '2025-05-21 11:54:17'),
(31, 'The Wild Robot', 'After a shipwreck, an intelligent robot called Roz is stranded on an uninhabited island. To survive the harsh environment, Roz bonds with the island\'s animals and cares for an orphaned baby goose.', '2024-09-12', 'https://image.tmdb.org/t/p/w500/wTnV3PCVW5O92JMrFvvrRcV39RU.jpg', 'https://www.youtube.com/embed/VUCNBAmse04', 102, 8.3, 'Chris Sanders', 0, 16, '2025-05-21 11:54:20', '2025-05-21 11:54:20'),
(32, 'Lilo & Stitch', 'As Stitch, a runaway genetic experiment from a faraway planet, wreaks havoc on the Hawaiian Islands, he becomes the mischievous adopted alien \"puppy\" of an independent little girl named Lilo and learns about loyalty, friendship, and ʻohana, the Hawaiian tradition of family.', '2002-06-21', 'https://image.tmdb.org/t/p/w500/m13Vbzv7R2GMAl3GXFrkmMEgCFQ.jpg', 'https://www.youtube.com/embed/wAtaSKQ4-T0', 85, 7.5, 'Dean DeBlois', 0, 16, '2025-05-21 11:54:20', '2025-05-21 11:54:20'),
(33, 'Despicable Me 4', 'Gru and Lucy and their girls—Margo, Edith and Agnes—welcome a new member to the Gru family, Gru Jr., who is intent on tormenting his dad. Gru also faces a new nemesis in Maxime Le Mal and his femme fatale girlfriend Valentina, forcing the family to go on the run.', '2024-06-20', 'https://image.tmdb.org/t/p/w500/wWba3TaojhK7NdycRhoQpsG0FaH.jpg', 'https://www.youtube.com/embed/LtNYaH61dXY', 94, 7.0, 'Chris Renaud', 0, 16, '2025-05-21 11:54:21', '2025-05-21 11:54:21'),
(34, 'Flow', 'A solitary cat, displaced by a great flood, finds refuge on a boat with various species and must navigate the challenges of adapting to a transformed world together.', '2024-08-29', 'https://image.tmdb.org/t/p/w500/imKSymKBK7o73sajciEmndJoVkR.jpg', 'https://www.youtube.com/embed/shsVQvHUTxw', 85, 8.2, 'Gints Zilbalodis', 0, 16, '2025-05-21 11:54:22', '2025-05-21 11:54:22'),
(35, 'Memoir of a Snail', 'Forcibly separated from her twin brother when they are orphaned, a melancholic misfit learns how to find confidence within herself amid the clutter of misfortunes and everyday life.', '2024-10-17', 'https://image.tmdb.org/t/p/w500/woaN8CbloH0akyX0E72ayxlJAB4.jpg', 'https://www.youtube.com/embed/q47QUYb0hjc', 94, 8.1, 'Adam Elliot', 0, 16, '2025-05-21 11:54:23', '2025-05-21 11:54:23'),
(36, 'Kung Fu Panda 4', 'Po is gearing up to become the spiritual leader of his Valley of Peace, but also needs someone to take his place as Dragon Warrior. As such, he will train a new kung fu practitioner for the spot and will encounter a villain called the Chameleon who conjures villains from the past.', '2024-03-02', 'https://image.tmdb.org/t/p/w500/nqXsAaQsKw2gKpkfhIgjXNDRqg7.jpg', 'https://www.youtube.com/embed/d2OONzqh2jk', 94, 7.1, 'Mike Mitchell', 0, 16, '2025-05-21 11:54:24', '2025-05-21 11:54:24'),
(37, 'Plankton: The Movie', 'Plankton\'s tangled love story with his sentient computer wife goes sideways when she takes a stand — and decides to destroy the world without him.', '2025-03-08', 'https://image.tmdb.org/t/p/w500/hGaUNLF5VZbg9ovPTyjm9Rv5xWz.jpg', 'https://www.youtube.com/embed/IHRScjhllsQ', 83, 6.8, 'Dave Needham', 0, 16, '2025-05-21 11:54:25', '2025-05-21 11:54:25'),
(38, 'Shrek', 'It ain\'t easy bein\' green -- especially if you\'re a likable (albeit smelly) ogre named Shrek. On a mission to retrieve a gorgeous princess from the clutches of a fire-breathing dragon, Shrek teams up with an unlikely compatriot -- a wisecracking donkey.', '2001-05-18', 'https://image.tmdb.org/t/p/w500/iB64vpL3dIObOtMZgX3RqdVdQDc.jpg', 'https://www.youtube.com/embed/CwXOrWvPBPk', 90, 7.8, 'Andrew Adamson', 0, 16, '2025-05-21 11:54:26', '2025-05-21 11:54:26'),
(39, 'The Sloth Lane', 'After a terrifying storm destroys their home, a speedy sloth named Laura and her kooky family move to the big city in their rusted old food truck, Gordito, hoping to make their business a success. The family\'s delicious food catches the eye of a quick-witted cheetah who will stop at nothing to revive her failing fast-food business.', '2024-07-25', 'https://image.tmdb.org/t/p/w500/toBN1A9AnhoUzXyu9gaVyQVJehp.jpg', 'https://www.youtube.com/embed/22sVIyFUY1A', 90, 6.5, 'Tania Vincent', 0, 16, '2025-05-21 11:54:26', '2025-05-21 11:54:26'),
(40, 'Batman Ninja vs. Yakuza League', 'The Batman family has returned to the present to discover that Japan has disappeared, and a giant island - Hinomoto - is now in the sky over Gotham City.  At the top sit the Yakuza, a group of superpowered individuals who reign without honor or humanity and look suspiciously like the Justice League. Now, it’s up to Batman and his allies to save Gotham!', '2025-03-17', 'https://image.tmdb.org/t/p/w500/sVVT6GYFErVv0Lcc9NvqCu0iOxO.jpg', 'https://www.youtube.com/embed/QleeDtH_WWE', 90, 6.7, 'Jumpei Mizusaki', 0, 16, '2025-05-21 11:54:27', '2025-05-21 11:54:27'),
(41, 'The Super Mario Bros. Movie', 'While working underground to fix a water main, Brooklyn plumbers—and brothers—Mario and Luigi are transported down a mysterious pipe and wander into a magical new world. But when the brothers are separated, Mario embarks on an epic quest to find Luigi.', '2023-04-05', 'https://image.tmdb.org/t/p/w500/qNBAXBIQlnOThrVvA6mA2B5ggV6.jpg', 'https://www.youtube.com/embed/RjNcTBXTk4I', 93, 7.6, 'Michael Jelenic', 0, 16, '2025-05-21 11:54:28', '2025-05-21 11:54:28'),
(42, 'Dog Man', 'When a faithful police dog and his human police officer owner are injured together on the job, a harebrained but life-saving surgery fuses the two of them together and Dog Man is born. Dog Man is sworn to protect and serve—and fetch, sit and roll over. As Dog Man embraces his new identity and strives to impress his Chief, he must stop the pretty evil plots of feline supervillain Petey the Cat.', '2025-01-24', 'https://image.tmdb.org/t/p/w500/89wNiexZdvLQ41OQWIsQy4O6jAQ.jpg', 'https://www.youtube.com/embed/QaJbAennB_Q', 89, 7.8, 'Peter Hastings', 0, 16, '2025-05-21 11:54:29', '2025-05-21 11:54:29'),
(43, 'Miraculous World: London, At the Edge of Time', 'To save the future from a terrible fate, Marinette becomes Chronobug and teams up with Bunnyx to defeat a mysterious opponent who travels through time. Who is this new supervillain, and why are they obsessed with exposing Marinette\'s secret superhero identity? Marinette\'s only hope is to defeat her new opponent to prevent the end of Ladybug and time itself!', '2024-11-14', 'https://image.tmdb.org/t/p/w500/6AtoMpHvs9pxd30KsyK8QmJ9W9M.jpg', 'https://www.youtube.com/embed/iFN9DouWuYY', 50, 7.3, 'Thomas Astruc', 0, 16, '2025-05-21 11:54:30', '2025-05-21 11:54:30'),
(44, 'Coraline', 'Wandering her rambling old house in her boring new town, 11-year-old Coraline discovers a hidden door to a strangely idealized version of her life. In order to stay in the fantasy, she must make a frighteningly real sacrifice.', '2009-02-05', 'https://image.tmdb.org/t/p/w500/4jeFXQYytChdZYE9JYO7Un87IlW.jpg', 'https://www.youtube.com/embed/T6iQnnHNF50', 100, 7.9, 'Henry Selick', 0, 16, '2025-05-21 11:54:31', '2025-05-21 11:54:31'),
(45, 'Spider-Man: Across the Spider-Verse', 'After reuniting with Gwen Stacy, Brooklyn’s full-time, friendly neighborhood Spider-Man is catapulted across the Multiverse, where he encounters the Spider Society, a team of Spider-People charged with protecting the Multiverse’s very existence. But when the heroes clash on how to handle a new threat, Miles finds himself pitted against the other Spiders and must set out on his own to save those he loves most.', '2023-05-31', 'https://image.tmdb.org/t/p/w500/8Vt6mWEReuy4Of61Lnj5Xj704m8.jpg', 'https://www.youtube.com/embed/yFrxzaBLDQM', 140, 8.3, 'Kemp Powers', 0, 16, '2025-05-21 11:54:32', '2025-05-21 11:54:32'),
(46, '¡Qué Huevos, Sofía!', 'Sofia gives everything for the company where she works, but the position she was promised is given to the owner\'s niece. She and other colleagues, tired of working for an unbearable boss, quit to start their own bakery. What they did not consider is that their ex-boss will not rest until he sees them fail.', '2025-02-27', 'https://image.tmdb.org/t/p/w500/hhfWpdNmPwU1VV7zhNA1nOMbHkH.jpg', 'https://www.youtube.com/embed/ntzBD3ihVXg', 106, 6.8, 'Carlos Santos', 0, 35, '2025-05-21 11:54:33', '2025-05-21 11:54:33'),
(47, 'Lilo & Stitch', 'The wildly funny and touching story of a lonely Hawaiian girl and the fugitive alien who helps to mend her broken family.', '2025-05-21', 'https://image.tmdb.org/t/p/w500/tUae3mefrDVTgm5mRzqWnZK6fOP.jpg', 'https://www.youtube.com/embed/VWqJifMMgZE', 108, 7.9, 'Dean Fleischer Camp', 0, 35, '2025-05-21 11:54:34', '2025-05-21 11:54:34'),
(48, 'Laila', 'Sonu Model, a renowned beautician from the old city, is forced to disguise himself as Laila, leading to a series of comedic, romantic, and action-packed events. Chaos ensues in this hilarious laugh riot', '2025-02-14', 'https://image.tmdb.org/t/p/w500/l4gsNxFPGpzbq0D6QK1a8vO1lBz.jpg', 'https://www.youtube.com/embed/FyhFBHpTh6Y', 134, 5.0, 'Ram Narayan', 0, 35, '2025-05-21 11:54:35', '2025-05-21 11:54:35'),
(49, 'Death of a Unicorn', 'A father and daughter accidentally hit and kill a unicorn while en route to a weekend retreat, where his billionaire boss seeks to exploit the creature’s miraculous curative properties.', '2025-03-27', 'https://image.tmdb.org/t/p/w500/lXR32JepFwD1UHkplWqtBP1K79z.jpg', 'https://www.youtube.com/embed/aQOle3MHnGs', 107, 6.5, 'Alex Scharfman', 0, 35, '2025-05-21 11:54:35', '2025-05-21 11:54:35'),
(50, 'The Monkey', 'When twin brothers find a mysterious wind-up monkey, a series of outrageous deaths tear their family apart. Twenty-five years later, the monkey begins a new killing spree forcing the estranged brothers to confront the cursed toy.', '2025-02-14', 'https://image.tmdb.org/t/p/w500/yYa8Onk9ow7ukcnfp2QWVvjWYel.jpg', 'https://www.youtube.com/embed/husMGbXEIho', 97, 5.9, 'Osgood Perkins', 0, 35, '2025-05-21 11:54:36', '2025-05-21 11:54:36'),
(51, 'Novocaine', 'When the girl of his dreams is kidnapped, everyman Nate turns his inability to feel pain into an unexpected strength in his fight to get her back.', '2025-03-12', 'https://image.tmdb.org/t/p/w500/xmMHGz9dVRaMY6rRAlEX4W0Wdhm.jpg', 'https://www.youtube.com/embed/99BLnkAlC1M', 110, 6.9, 'Dan Berk', 0, 35, '2025-05-21 11:54:37', '2025-05-21 11:54:37'),
(52, 'Summer of 69', 'In an effort to land the guy she\'s been pining after since grade school, Abby hires a local stripper named Santa Monica to teach her everything she needs to know about confidence and sex.', '2025-03-13', 'https://image.tmdb.org/t/p/w500/xBmsHHLwvwI29oyFE48fKAnSQyk.jpg', 'https://www.youtube.com/embed/v05tfNInHsU', 102, 5.8, 'Jillian Bell', 0, 35, '2025-05-21 11:54:38', '2025-05-21 11:54:38'),
(53, 'Another Simple Favor', 'Stephanie and Emily reunite on the beautiful island of Capri, Italy for Emily\'s extravagant wedding to a rich Italian businessman. Along with the glamorous guests, expect murder and betrayal to RSVP for a wedding with more twists and turns than the road from the Marina Grande to the Capri town square.', '2025-03-07', 'https://image.tmdb.org/t/p/w500/zboCGZ4aIqPMd7VFI4HWnmc7KYJ.jpg', 'https://www.youtube.com/embed/QWajCwdC_TM', 123, 6.0, 'Paul Feig', 0, 35, '2025-05-21 11:54:39', '2025-05-21 11:54:39'),
(54, 'Nonnas', 'After losing his beloved mother, a man risks everything to honor her by opening an Italian restaurant with actual nonnas — grandmothers — as the chefs.', '2025-05-01', 'https://image.tmdb.org/t/p/w500/5Bf1xlxLuCHdi74MpdFi2Yz3FGJ.jpg', 'https://www.youtube.com/embed/rDJxJd3FzDY', 114, 6.8, 'Stephen Chbosky', 0, 35, '2025-05-21 11:54:40', '2025-05-21 11:54:40'),
(55, 'Deadpool & Wolverine', 'A listless Wade Wilson toils away in civilian life with his days as the morally flexible mercenary, Deadpool, behind him. But when his homeworld faces an existential threat, Wade must reluctantly suit-up again with an even more reluctant Wolverine.', '2024-07-24', 'https://image.tmdb.org/t/p/w500/8cdWjvZQUExUUTzyp4t6EDMubfO.jpg', 'https://www.youtube.com/embed/Idh8n5XuYIA', 128, 7.6, 'Shawn Levy', 0, 35, '2025-05-21 11:54:41', '2025-05-21 11:54:41'),
(56, 'Anora', 'A young sex worker from Brooklyn gets her chance at a Cinderella story when she meets and impulsively marries the son of an oligarch. Once the news reaches Russia, her fairytale is threatened as his parents set out to get the marriage annulled.', '2024-10-14', 'https://image.tmdb.org/t/p/w500/7MrgIUeq0DD2iF7GR6wqJfYZNeC.jpg', 'https://www.youtube.com/embed/8m6UrWMl18M', 139, 7.0, 'Sean Baker', 0, 35, '2025-05-21 11:54:42', '2025-05-21 11:54:42'),
(57, 'Barbie', 'Barbie and Ken are having the time of their lives in the colorful and seemingly perfect world of Barbie Land. However, when they get a chance to go to the real world, they soon discover the joys and perils of living among humans.', '2023-07-19', 'https://image.tmdb.org/t/p/w500/iuFNMS8U5cb6xfzi51Dbkovj7vM.jpg', 'https://www.youtube.com/embed/Y1IgAEejvqM', 114, 7.0, 'Greta Gerwig', 0, 35, '2025-05-21 11:54:43', '2025-05-21 11:54:43'),
(58, 'Panda Plan', 'International action star Jackie Chan is invited to the adoption ceremony of a rare baby panda, but after an international crime syndicate attempts to kidnap the bear, Jackie has to save the bear using his stunt work skills.', '2024-10-01', 'https://image.tmdb.org/t/p/w500/8iMPQl13q89jQhaA5nXb6UiT0t0.jpg', 'https://www.youtube.com/embed/kb1C19HGBu8', 99, 6.8, 'Zhang Luan', 0, 35, '2025-05-21 11:54:44', '2025-05-21 11:54:44'),
(59, 'Red One', 'After Santa Claus (codename: Red One) is kidnapped, the North Pole\'s Head of Security must team up with the world\'s most infamous tracker in a globe-trotting, action-packed mission to save Christmas.', '2024-10-31', 'https://image.tmdb.org/t/p/w500/cdqLnri3NEGcmfnqwk2TSIYtddg.jpg', 'https://www.youtube.com/embed/7l3hfD74X-4', 124, 7.0, 'Jake Kasdan', 0, 35, '2025-05-21 11:54:45', '2025-05-21 11:54:45'),
(60, 'Bad Boys: Ride or Die', 'After their late former Captain is framed, Lowrey and Burnett try to clear his name, only to end up on the run themselves.', '2024-06-05', 'https://image.tmdb.org/t/p/w500/oGythE98MYleE6mZlGs5oBGkux1.jpg', 'https://www.youtube.com/embed/uWLNl_KQCAU', 115, 7.4, 'Adil El Arbi', 0, 35, '2025-05-21 11:54:45', '2025-05-21 11:54:45'),
(61, 'Desert Dawn', 'A newly appointed small-town sheriff and his begrudging deputy get tangled up in a web of lies and corruption involving shady businessmen and the cartel while investigating the murder of a mysterious woman.', '2025-05-15', 'https://image.tmdb.org/t/p/w500/S21BfLrJSD9njucBfY3CKqp8rD.jpg', 'https://www.youtube.com/embed/yQCpGW7bZyo', 89, 8.0, 'Marty Murray', 0, 80, '2025-05-21 11:54:47', '2025-05-21 11:54:47'),
(62, 'Bullet Train Explosion', 'When panic erupts on a Tokyo-bound bullet train that will explode if it slows below 100 kph, authorities race against time to save everyone on board.', '2025-04-23', 'https://image.tmdb.org/t/p/w500/jmzxlDBwgvRbpPJzNQwizyn9UEn.jpg', 'https://www.youtube.com/embed/bYopWaT8Sr0', 137, 6.9, 'Shinji Higuchi', 0, 80, '2025-05-21 11:54:47', '2025-05-21 11:54:47'),
(63, 'The Enforcer', 'A noir thriller set in Miami, the film follows an enforcer who discovers his femme fatale boss has branched out into cyber sex trafficking, putting a young runaway he’s befriended at risk. He sacrifices everything to save the young girl from the deadly organization he’s spent his life building.', '2022-09-22', 'https://image.tmdb.org/t/p/w500/72V1r1G8S87ELagVxjqAUdChMCt.jpg', 'https://www.youtube.com/embed/XmpK_5EOuGc', 91, 7.0, 'Richard Hughes', 0, 80, '2025-05-21 11:54:48', '2025-05-21 11:54:48'),
(64, 'The Accountant²', 'When an old acquaintance is murdered, Wolff is compelled to solve the case. Realizing more extreme measures are necessary, Wolff recruits his estranged and highly lethal brother, Brax, to help. In partnership with Marybeth Medina, they uncover a deadly conspiracy, becoming targets of a ruthless network of killers who will stop at nothing to keep their secrets buried.', '2025-04-23', 'https://image.tmdb.org/t/p/w500/ieYaJz2nzs4wcqpWaofagzGoGPi.jpg', 'https://www.youtube.com/embed/RwXDphhQ9Tg', 133, 7.1, 'Gavin O\'Connor', 0, 80, '2025-05-21 11:54:49', '2025-05-21 11:54:49'),
(65, 'The Godfather', 'Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.', '1972-03-14', 'https://image.tmdb.org/t/p/w500/3bhkrj58Vtu7enYsRolD1fZdja1.jpg', 'https://www.youtube.com/embed/Ew9ngL1GZvs', 175, 8.7, 'Francis Ford Coppola', 0, 80, '2025-05-21 11:54:50', '2025-05-21 11:54:50'),
(66, 'The Accountant', 'As a math savant uncooks the books for a new client, the Treasury Department closes in on his activities and the body count starts to rise.', '2016-10-13', 'https://image.tmdb.org/t/p/w500/fceheXB5fC4WrLVuWJ6OZv9FXYr.jpg', 'https://www.youtube.com/embed/0KHOVlEpMyY', 128, 7.1, 'Gavin O\'Connor', 0, 80, '2025-05-21 11:54:51', '2025-05-21 11:54:51'),
(67, 'Demon City', 'Framed for his family\'s murder and left for dead, an ex-hitman will stop at nothing to exact revenge on the masked \"demons\" who have taken over his city.', '2025-02-26', 'https://image.tmdb.org/t/p/w500/g5PqsFFrayyRL1Ldgib2lMYuJXg.jpg', 'https://www.youtube.com/embed/q-djvN7i5us', 106, 7.0, 'Seiji Tanaka', 0, 80, '2025-05-21 11:54:52', '2025-05-21 11:54:52'),
(68, 'Fast X', 'Over many missions and against impossible odds, Dom Toretto and his family have outsmarted, out-nerved and outdriven every foe in their path. Now, they confront the most lethal opponent they\'ve ever faced: A terrifying threat emerging from the shadows of the past who\'s fueled by blood revenge, and who is determined to shatter this family and destroy everything—and everyone—that Dom loves, forever.', '2023-05-17', 'https://image.tmdb.org/t/p/w500/fiVW06jE7z9YnO4trhaMEdclSiC.jpg', 'https://www.youtube.com/embed/eoOaKN4qCKw', 142, 7.0, 'Louis Leterrier', 0, 80, '2025-05-21 11:54:53', '2025-05-21 11:54:53'),
(69, 'The Shawshank Redemption', 'Imprisoned in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.', '1994-09-23', 'https://image.tmdb.org/t/p/w500/9cqNxx0GxF0bflZmeSMuL5tnGzr.jpg', 'https://www.youtube.com/embed/PLl99DlL6b4', 142, 8.7, 'Frank Darabont', 0, 80, '2025-05-21 11:54:54', '2025-05-21 11:54:54'),
(70, 'Deva', 'Dev Ambre, a ruthless cop, loses his memory in an accident just after he has finished solving a murder case and now has to reinvestigate it while keeping his memory loss a secret from everyone except DCP Farhan Khan.', '2025-01-31', 'https://image.tmdb.org/t/p/w500/2JthNUcRU89h9M6k3yQxLkACEJQ.jpg', 'https://www.youtube.com/embed/DBCy-fo9eSQ', 155, 5.9, 'Rosshan Andrrews', 0, 80, '2025-05-21 11:54:55', '2025-05-21 11:54:55'),
(71, 'The Dark Knight', 'Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.', '2008-07-16', 'https://image.tmdb.org/t/p/w500/qJ2tW6WMUDux911r6m7haRef0WH.jpg', 'https://www.youtube.com/embed/_PZpmTj1Q8Q', 152, 8.5, 'Christopher Nolan', 0, 80, '2025-05-21 11:54:55', '2025-05-21 11:54:55'),
(72, 'I, the Executioner', 'The veteran detective Seo Do-cheol and his team at Major Crimes, relentless in their pursuit of criminals, join forces with rookie cop Park Sun-woo to track down a serial killer who has plunged the nation into turmoil.', '2024-09-13', 'https://image.tmdb.org/t/p/w500/gAtP0usArK5gVOBObnsENKLwML8.jpg', 'https://www.youtube.com/embed/_JzGZAMjMb0', 118, 6.9, 'Ryoo Seung-wan', 0, 80, '2025-05-21 11:54:56', '2025-05-21 11:54:56'),
(73, 'John Wick: Chapter 4', 'With the price on his head ever increasing, John Wick uncovers a path to defeating The High Table. But before he can earn his freedom, Wick must face off against a new enemy with powerful alliances across the globe and forces that turn old friends into foes.', '2023-03-22', 'https://image.tmdb.org/t/p/w500/vZloFAK7NmvMGKE7VkF5UHaz0I.jpg', 'https://www.youtube.com/embed/yjRHZEUamCc', 170, 7.7, 'Chad Stahelski', 0, 80, '2025-05-21 11:54:57', '2025-05-21 11:54:57'),
(74, 'Alarum', 'Two married spies caught in the crosshairs of an international intelligence network will stop at nothing to obtain a critical asset. Joe and Lara are agents living off the grid whose quiet retreat at a winter resort is blown to shreds when members of the old guard suspect the two may have joined an elite team of rogue spies, known as Alarum.', '2025-01-16', 'https://image.tmdb.org/t/p/w500/v313aUGmMNj6yNveaiQXysBmjVS.jpg', 'https://www.youtube.com/embed/Kp6WlyxBHBM', 95, 5.7, 'Michael Polish', 0, 80, '2025-05-21 11:54:58', '2025-05-21 11:54:58'),
(75, 'Prisoners', 'Keller Dover is facing every parent’s worst nightmare. His six-year-old daughter, Anna, is missing, together with her young friend, Joy, and as minutes turn to hours, panic sets in. The only lead is a dilapidated RV that had earlier been parked on their street.', '2013-09-19', 'https://image.tmdb.org/t/p/w500/uhviyknTT5cEQXbn6vWIqfM4vGm.jpg', 'https://www.youtube.com/embed/doPNgss-ntc', 153, 8.1, 'Denis Villeneuve', 0, 80, '2025-05-21 11:54:59', '2025-05-21 11:54:59'),
(76, 'My Massive Cock', 'An extra-large penis is an object of desire for many. But for some men, extra-large seriously complicates their lives and relationships, and penis reduction surgery seems the only answer.', '2022-10-24', 'https://image.tmdb.org/t/p/w500/9JQHViS8uugeWKfFsnEj3xTB2dZ.jpg', NULL, 47, 5.1, 'Mike Nicholls', 0, 99, '2025-05-21 11:55:00', '2025-05-21 11:55:00'),
(77, 'Van Gogh by Vincent', 'In a career that lasted only ten years, Vincent Van Gogh painted one subject more than any other: himself. This is the story of Vincent told using eight of his most iconic self-portraits.', '2025-03-26', 'https://image.tmdb.org/t/p/w500/z73X4WKZghBh5fri31o8P6vBEB2.jpg', NULL, 46, 6.0, 'Richard Shaw', 0, 99, '2025-05-21 11:55:01', '2025-05-21 11:55:01'),
(78, 'Vini Jr.', 'Vini Jr. has it all: talent, resilience and boldness. Follow his dancing, unpredictable feet on his inspiring journey to becoming a global soccer star.', '2025-05-15', 'https://image.tmdb.org/t/p/w500/4ImGMcwpy4k2zmcXBSFYNK6kRr9.jpg', 'https://www.youtube.com/embed/Qy2I4liKGiA', 106, 5.5, 'Andrucha Waddington', 0, 99, '2025-05-21 11:55:02', '2025-05-21 11:55:02'),
(79, 'A Deadly American Marriage', 'Murder or self-defense? Told from both sides, this documentary explores the killing of Jason Corbett during a dispute with his wife and her father.', '2025-05-09', 'https://image.tmdb.org/t/p/w500/2DiydymXoLD9KUGZKorBNapshl1.jpg', 'https://www.youtube.com/embed/0PPSFCWO_cA', 103, 6.7, 'Jessica Burgess', 0, 99, '2025-05-21 11:55:03', '2025-05-21 11:55:03'),
(80, 'Africa Addio', 'A chronicle of the violence that occurred in much of the African continent throughout the 1960s. As many African countries were transitioning from colonial rule to other forms of government, violent political upheavals were frequent. Revolutions in Zanzibar and Kenya in which thousands were killed are shown, the violence not only political; there is also extensive footage of hunters and poachers slaughtering different types of wild animals.', '1966-02-11', 'https://image.tmdb.org/t/p/w500/fPLzCid2gk7eOCrYlXIBU24bTpO.jpg', 'https://www.youtube.com/embed/R2owwGvTsUw', 138, 6.3, 'Gualtiero Jacopetti', 0, 99, '2025-05-21 11:55:04', '2025-05-21 11:55:04'),
(81, 'Thunderbolts* | A Special Look', 'Get a special look at \"Thunderbolts*.\"', '2025-05-08', 'https://image.tmdb.org/t/p/w500/xTeM50tWdS0PL8xQkgaIBs2weEG.jpg', NULL, 4, NULL, NULL, 0, 99, '2025-05-21 11:55:05', '2025-05-21 11:55:05'),
(82, 'Untold: The Liver King', 'He built a supplement empire by devouring raw meat on social media. And he had the muscles to prove it. But, really, how did the Liver King get so huge?', '2025-05-12', 'https://image.tmdb.org/t/p/w500/4DwBE6zwmzOTf617rz5x7QTNO2W.jpg', 'https://www.youtube.com/embed/Idi-wps8V5o', 68, 6.3, 'Joe Pearlman', 0, 99, '2025-05-21 11:55:06', '2025-05-21 11:55:06'),
(83, 'Karol G: Tomorrow Was Beautiful', 'Karol G pulls back the curtain on her rise to stardom while navigating a sold-out stadium tour, creating new music and releasing a new album.', '2025-04-30', 'https://image.tmdb.org/t/p/w500/5aXoQYwaQ7JJVUWclHAEXJgiS2M.jpg', 'https://www.youtube.com/embed/qE6Lez9aGHA', 108, 7.9, 'Cristina Costantini', 0, 99, '2025-05-21 11:55:07', '2025-05-21 11:55:07'),
(84, 'Nude', 'NUDE explores perceptions of nudity in art by chronicling the creative process of photographer David Bellemere as he\'s commissioned by NU Muses founder Steve Shaw to shoot a fine art calendar of nude photographs.', '2017-10-29', 'https://image.tmdb.org/t/p/w500/A7hIbfWAwT4wc0jgc2xNQR6PPEm.jpg', 'https://www.youtube.com/embed/QsGPP37D32E', 89, 9.4, 'Tony Sacco', 0, 99, '2025-05-21 11:55:07', '2025-05-21 11:55:07'),
(85, 'Making of The Last of Us', 'Featuring extensive interviews with the cast and crew, this all-access documentary gives a rare glimpse into the daunting behind-the-scenes efforts that went into the production of the HBO Original smash hit series The Last of Us.', '2023-03-12', 'https://image.tmdb.org/t/p/w500/nter1KTaQjmkGCjvSu5u01FoecP.jpg', NULL, 32, 6.8, 'Paul C. Rosen', 0, 99, '2025-05-21 11:55:08', '2025-05-21 11:55:08'),
(86, 'Titanic: The Digital Resurrection', 'Using cutting-edge scanning technology and state-of-the-art CGI, a team of experts creates the first high-resolution 3D digital twin of the Titanic wreck. Through a groundbreaking immersive investigation, they uncover the ship’s final moments, shedding light on the acts of heroism and cowardice aboard—and revealing the true story behind the sinking of the “unsinkable” ship.', '2025-04-12', 'https://image.tmdb.org/t/p/w500/mJNpxvtUNRVOfhFwukNewSf3gkf.jpg', 'https://www.youtube.com/embed/Ywm0RERswmY', 69, 7.8, 'Fergus Colville', 0, 99, '2025-05-21 11:55:09', '2025-05-21 11:55:09'),
(87, 'The Twister: Caught in the Storm', 'In May 2011, a massive tornado ripped through Joplin, Missouri. With pulse-pounding firsthand footage, this documentary goes inside a deadly twister.', '2025-03-18', 'https://image.tmdb.org/t/p/w500/ggXb37lX9gW4SR7kpMaraXDFeFR.jpg', 'https://www.youtube.com/embed/2o0eLtapwr0', 89, 6.3, 'Alexandra Lacey', 0, 99, '2025-05-21 11:55:10', '2025-05-21 11:55:10'),
(88, 'Rewriting Trump', 'Follows Trump\'s White House return bid, featuring Michael Wolff, Trump Jr., campaign advisers and Stormy Daniels. Covers alleged assassination attempt, Biden debate fallout and Harris\' potential candidacy.', '2025-03-03', 'https://image.tmdb.org/t/p/w500/hrchtGujPcYN9ABVLzk7tsV08Rp.jpg', NULL, 97, 7.0, 'Arthur Carey', 0, 99, '2025-05-21 11:55:11', '2025-05-21 11:55:11'),
(89, 'Squid Game: Making Season 2', 'From set designs to character arcs, get exclusive cast and director interviews on how Season 2 of the globally most-watched series was brought to life.', '2025-01-02', 'https://image.tmdb.org/t/p/w500/yQGaui0bQ5Ai3KIFBB45nTeIqad.jpg', NULL, 28, 8.5, NULL, 0, 99, '2025-05-21 11:55:12', '2025-05-21 11:55:12'),
(90, 'Deaf President Now!', 'Discover the story of the greatest civil rights movement most people have never heard about. During eight tumultuous days in 1988 at the world\'s only Deaf university, four students must find a way to lead a revolution—and change the course of history.', '2025-01-28', 'https://image.tmdb.org/t/p/w500/hbTq1jfuGtLo1pdAY0gcbJcCWlF.jpg', 'https://www.youtube.com/embed/m-gIp9CDFtM', 101, 8.7, 'Nyle DiMarco', 0, 99, '2025-05-21 11:55:13', '2025-05-21 11:55:13'),
(91, 'Conjuring the Cult', 'After discovering his blood-soaked daughter dead in the bathtub, David Bryson attends a self-help group to help save him from his ghostly nightmares. But when a group of mysterious cult-like women offer to help him resurrect his daughter. David\'s choices will not just decide his fate... but the fate of his dead daughter\'s SOUL.', '2024-10-01', 'https://image.tmdb.org/t/p/w500/t4MiAeYpjL7saYvqvcn9xtOfA4K.jpg', 'https://www.youtube.com/embed/VhEhbjb5-Mg', 93, 5.5, 'Calvin Morie McCarthy', 0, 18, '2025-05-21 11:55:14', '2025-05-21 11:55:14'),
(92, 'Bad Influence', 'An ex-con gets a fresh start when hired to protect a wealthy heiress from a stalker — but their chemistry is hard to resist as they grow closer.', '2025-01-24', 'https://image.tmdb.org/t/p/w500/ghhooCOqQDqC6vhS1SVN2tCE0k8.jpg', 'https://www.youtube.com/embed/412WAdJM7sY', 106, 5.7, 'Chloé Wallace', 0, 18, '2025-05-21 11:55:15', '2025-05-21 11:55:15'),
(93, 'G20', 'After the G20 Summit is overtaken by terrorists, President Danielle Sutton must bring all her statecraft and military experience to defend her family and her fellow leaders.', '2025-04-10', 'https://image.tmdb.org/t/p/w500/wv6oWAleCJZUk5htrGg413t3GCy.jpg', 'https://www.youtube.com/embed/ZL7R8qyQXrc', 108, 6.5, 'Patricia Riggen', 0, 18, '2025-05-21 11:55:16', '2025-05-21 11:55:16'),
(94, 'Ask Me What You Want', 'After his father\'s death, Eric Zimmerman travels to Spain to oversee his company\'s branches. In Madrid, he falls for Judith and engage in an intense, erotic relationship full of exploration. However, Eric fears his secret may end their affair.', '2024-11-29', 'https://image.tmdb.org/t/p/w500/k82T5L1utX1G2LhNWeza9nGUKPk.jpg', NULL, 114, 6.0, 'Lucía Alemany', 0, 18, '2025-05-21 11:55:16', '2025-05-21 11:55:16'),
(95, 'My Fault', 'Noah must leave her city, boyfriend, and friends to move into William Leister\'s mansion, the flashy and wealthy husband of her mother Rafaela. As a proud and independent 17 year old, Noah resists living in a mansion surrounded by luxury. However, it is there where she meets Nick, her new stepbrother, and the clash of their strong personalities becomes evident from the very beginning.', '2023-06-08', 'https://image.tmdb.org/t/p/w500/w46Vw536HwNnEzOa7J24YH9DPRS.jpg', 'https://www.youtube.com/embed/xY-qRGC6Yu0', 117, 7.8, 'Domingo González', 0, 18, '2025-05-21 11:55:17', '2025-05-21 11:55:17'),
(96, 'Marked Men: Rule + Shaw', 'Shaw Landon has loved Rule Archer from the moment she laid eyes on him. Rule, a fiery-tempered rebel tattoo artist, doesn’t have time for a good girl pre-med student like Shaw — even if she’s the only one who can see the person he truly is. She lives by other people’s rules; he makes his own. But a short skirt, too many birthday cocktails, and spilled secrets lead to a night neither can forget. Now, Shaw and Rule must figure out how a girl like her and a guy like him are supposed to be together without destroying their love…or each other.', '2025-01-22', 'https://image.tmdb.org/t/p/w500/gZQU8BtCH2IbMZq6QETiU4HXQSR.jpg', 'https://www.youtube.com/embed/1OBKb0kX57w', 93, 6.3, 'Nick Cassavetes', 0, 18, '2025-05-21 11:55:18', '2025-05-21 11:55:18'),
(97, 'Devara: Part 1', 'Devara, a fearless man from a coastal region, embarks on a perilous journey into the treacherous world of the sea to safeguard the lives of his people. Unbeknownst to him, his brother Bhaira is plotting a conspiracy against him. As events unfold, Devara passes on his legacy to his mild-mannered and timid son, Varada.', '2024-09-26', 'https://image.tmdb.org/t/p/w500/1105WNYals12Va2f4F3VeBZdcWX.jpg', 'https://www.youtube.com/embed/S5wQD_0WGTA', 175, 7.0, 'Koratala Siva', 0, 18, '2025-05-21 11:55:19', '2025-05-21 11:55:19'),
(98, 'The Ugly Stepsister', 'In a fairy-tale kingdom where beauty is a brutal business, Elvira battles to compete with her incredibly beautiful stepsister, and she will go to any length to catch the prince’s eye.', '2025-03-07', 'https://image.tmdb.org/t/p/w500/crX9rSg9EohybhkEe8iTQUCe55y.jpg', 'https://www.youtube.com/embed/5vZ1_Yxjwzs', 109, 6.4, 'Emilie Kristine Blichfeldt', 0, 18, '2025-05-21 11:55:20', '2025-05-21 11:55:20'),
(99, 'Stepmom\'s Desire', 'Sang-jin, who was envious of her neighbor after getting a beautiful wife, Ask your wife\'s friend Gian to take over the son\'s extracurricular teacher, Sang-jin, who left work early, accidentally sees Gian\'s shower. A man who wants to have sex with his son\'s tutor, And a son who wants to have a good time with a young stepmom, Ji-an and Jin-hee, who want money, are disappointed with her husband, and Bin-jin gives her body to a young son.', '2020-05-29', 'https://image.tmdb.org/t/p/w500/rYC6UyML4CU4zYiZVbDMrwnGyWW.jpg', NULL, 78, 6.8, 'Lee Dong-Joon', 0, 18, '2025-05-21 11:55:21', '2025-05-21 11:55:21'),
(100, 'Conclave', 'After the unexpected death of the Pope, Cardinal Lawrence is tasked with managing the covert and ancient ritual of electing a new one. Sequestered in the Vatican with the Catholic Church’s most powerful leaders until the process is complete, Lawrence finds himself at the center of a conspiracy that could lead to its downfall.', '2024-10-25', 'https://image.tmdb.org/t/p/w500/l4WXg5oQPK6GVlISKQNIUGb8rKJ.jpg', 'https://www.youtube.com/embed/t915aZmyEBg', 120, 7.2, 'Edward Berger', 0, 18, '2025-05-21 11:55:22', '2025-05-21 11:55:22'),
(101, 'Your Fault', 'The love between Noah and Nick seems unwavering despite their parents\' attempts to separate them. But his job and her entry into college open up their lives to new relationships that will shake the foundations of both their relationship and the Leister family itself.', '2024-12-26', 'https://image.tmdb.org/t/p/w500/1sQA7lfcF9yUyoLYC0e6Zo3jmxE.jpg', 'https://www.youtube.com/embed/QT5j0Uf-rdM', 118, 7.1, 'Domingo González', 0, 18, '2025-05-21 11:55:22', '2025-05-21 11:55:22'),
(102, 'The Goldsmith\'s Secret', 'In 1999, a goldsmith revisits his hometown, triggering memories of his summer love affair with a seamstress 25 years prior. Despite their age gap, he vows to rewrite their story but struggles to find her upon his return.', '2025-02-28', 'https://image.tmdb.org/t/p/w500/sPW9fszYL0EG7YJW4NwvnAZbfuq.jpg', NULL, 99, 7.0, 'Olga Osorio', 0, 18, '2025-05-21 11:55:23', '2025-05-21 11:55:23'),
(103, 'Ligaw', 'A sultry woman who charms the hearts of men in a remote province. Dolores, a devoted wife to her paraplegic husband, falls for a young mountaineer. What begins as a reckless escape turns into an affair drenched in passion and secrecy.', '2025-05-09', 'https://image.tmdb.org/t/p/w500/yc8V3KEnhvPrzXpdYTXdTvjpOb5.jpg', 'https://www.youtube.com/embed/EFzDoPUtweA', 85, NULL, 'Omar Daroca', 0, 18, '2025-05-21 11:55:24', '2025-05-21 11:55:24');
INSERT INTO `movies` (`id`, `title`, `description`, `release_date`, `poster_url`, `trailer_url`, `duration`, `imdb_rating`, `director`, `views`, `genre_id`, `created_at`, `updated_at`) VALUES
(104, 'Oppenheimer', 'The story of J. Robert Oppenheimer\'s role in the development of the atomic bomb during World War II.', '2023-07-19', 'https://image.tmdb.org/t/p/w500/8Gxv8gSFCU0XGDykEGv7zR1n2ua.jpg', 'https://www.youtube.com/embed/qiuSBWVdgLI', 181, 8.1, 'Christopher Nolan', 0, 18, '2025-05-21 11:55:25', '2025-05-21 11:55:25'),
(105, 'Believers', 'On a small island somewhere near Japan, three cult members have devoted themselves to the \"Deserted Island Program\". Calling each other by rank, these people-two men and one women-have been chosen by their superiors to throw off the corrupt influence of modern society and \"purify\" themselves. But as time passes two of the members begin to give into human desire.', '2022-07-08', 'https://image.tmdb.org/t/p/w500/sw1sFRVaUCHD0CVTXtnoEFFYyr6.jpg', 'https://www.youtube.com/embed/HweFG4nY3JM', 118, 6.0, 'Hideo Jojo', 0, 18, '2025-05-21 11:55:26', '2025-05-21 11:55:26'),
(106, 'Snow White', 'Following the benevolent King\'s disappearance, the Evil Queen dominated the once fair land with a cruel streak. Princess Snow White flees the castle when the Queen, in her jealousy over Snow White\'s inner beauty, tries to kill her. Deep into the dark woods, she stumbles upon seven magical dwarves and a young bandit named Jonathan. Together, they strive to survive the Queen\'s relentless pursuit and aspire to take back the kingdom.', '2025-03-12', 'https://image.tmdb.org/t/p/w500/oLxWocqheC8XbXbxqJ3x422j9PW.jpg', 'https://www.youtube.com/embed/KsSoo5K8CpA', 109, 4.3, 'Marc Webb', 0, 10751, '2025-05-21 11:55:27', '2025-05-21 11:55:27'),
(107, 'The Chronicles of Narnia: The Lion, the Witch and the Wardrobe', 'Siblings Lucy, Edmund, Susan and Peter step through a magical wardrobe and find the land of Narnia. There, they discover a charming, once peaceful kingdom that has been plunged into eternal winter by the evil White Witch, Jadis. Aided by the wise and magnificent lion, Aslan, the children lead Narnia into a spectacular, climactic battle to be free of the Witch\'s glacial powers forever.', '2005-12-07', 'https://image.tmdb.org/t/p/w500/iREd0rNCjYdf5Ar0vfaW32yrkm.jpg', 'https://www.youtube.com/embed/3mKPrxjwF7A', 143, 7.1, 'Andrew Adamson', 0, 10751, '2025-05-21 11:55:28', '2025-05-21 11:55:28'),
(108, 'Puss in Boots: The Last Wish', 'Puss in Boots discovers that his passion for adventure has taken its toll: He has burned through eight of his nine lives, leaving him with only one life left. Puss sets out on an epic journey to find the mythical Last Wish and restore his nine lives.', '2022-12-07', 'https://image.tmdb.org/t/p/w500/aV1KGO9X3S4kzqEptVDAvGjccql.jpg', 'https://www.youtube.com/embed/tHb7WlgyaUc', 103, 8.2, 'Joel Crawford', 0, 10751, '2025-05-21 11:55:29', '2025-05-21 11:55:29'),
(109, 'How to Train Your Dragon', 'As the son of a Viking leader on the cusp of manhood, shy Hiccup Horrendous Haddock III faces a rite of passage: he must kill a dragon to prove his warrior mettle. But after downing a feared dragon, he realizes that he no longer wants to destroy it, and instead befriends the beast – which he names Toothless – much to the chagrin of his warrior father.', '2010-03-18', 'https://image.tmdb.org/t/p/w500/ygGmAO60t8GyqUo9xYeYxSZAR3b.jpg', 'https://www.youtube.com/embed/1huZhKwhIQc', 98, 7.8, 'Chris Sanders', 0, 10751, '2025-05-21 11:55:30', '2025-05-21 11:55:30'),
(110, 'How to Train Your Dragon', 'On the rugged isle of Berk, where Vikings and dragons have been bitter enemies for generations, Hiccup stands apart, defying centuries of tradition when he befriends Toothless, a feared Night Fury dragon. Their unlikely bond reveals the true nature of dragons, challenging the very foundations of Viking society.', '2025-06-06', 'https://image.tmdb.org/t/p/w500/q5pXRYTycaeW6dEgsCrd4mYPmxM.jpg', 'https://www.youtube.com/embed/OWEq2Pf8qpk', 125, NULL, 'Dean DeBlois', 0, 10751, '2025-05-21 11:55:31', '2025-05-21 11:55:31'),
(111, 'Lilo & Stitch 2: Stitch Has a Glitch', 'Now, we find the rowdy extraterrestrial getting used to life with his new ʻohana. However, a malfunction in the ultimate creation of Dr. Jumba soon emerges, which reinstates his destructive programming and threatens to both ruin his friendship with Lilo and to short him out for good!', '2005-01-22', 'https://image.tmdb.org/t/p/w500/vcn7a7ENxi5TBTlka4wYLzmKQIp.jpg', NULL, 68, 6.7, 'Tony Leondis', 0, 10751, '2025-05-21 11:55:32', '2025-05-21 11:55:32'),
(112, 'Transformers One', 'The untold origin story of Optimus Prime and Megatron, better known as sworn enemies, but once were friends bonded like brothers who changed the fate of Cybertron forever.', '2024-09-11', 'https://image.tmdb.org/t/p/w500/iRCgqpdVE4wyLQvGYU3ZP7pAtUc.jpg', 'https://www.youtube.com/embed/jaVcDaozGgc', 104, 8.1, 'Josh Cooley', 0, 10751, '2025-05-21 11:55:33', '2025-05-21 11:55:33'),
(113, 'Toy Story', 'Led by Woody, Andy\'s toys live happily in his room until Andy\'s birthday brings Buzz Lightyear onto the scene. Afraid of losing his place in Andy\'s heart, Woody plots against Buzz. But when circumstances separate Buzz and Woody from their owner, the duo eventually learns to put aside their differences.', '1995-11-22', 'https://image.tmdb.org/t/p/w500/uXDfjJbdP4ijW5hWSBrPrlKpxab.jpg', 'https://www.youtube.com/embed/CxwTLktovTU', 81, 8.0, 'John Lasseter', 0, 10751, '2025-05-21 11:55:34', '2025-05-21 11:55:34'),
(114, 'Coco', 'Despite his family’s baffling generations-old ban on music, Miguel dreams of becoming an accomplished musician like his idol, Ernesto de la Cruz. Desperate to prove his talent, Miguel finds himself in the stunning and colorful Land of the Dead following a mysterious chain of events. Along the way, he meets charming trickster Hector, and together, they set off on an extraordinary journey to unlock the real story behind Miguel\'s family history.', '2017-10-27', 'https://image.tmdb.org/t/p/w500/6Ryitt95xrO8KXuqRGm1fUuNwqF.jpg', 'https://www.youtube.com/embed/_TLXORFumu0', 105, 8.2, 'Lee Unkrich', 0, 10751, '2025-05-21 11:55:35', '2025-05-21 11:55:35'),
(115, 'Sonic the Hedgehog 2', 'After settling in Green Hills, Sonic is eager to prove he has what it takes to be a true hero. His test comes when Dr. Robotnik returns, this time with a new partner, Knuckles, in search for an emerald that has the power to destroy civilizations. Sonic teams up with his own sidekick, Tails, and together they embark on a globe-trotting journey to find the emerald before it falls into the wrong hands.', '2022-03-30', 'https://image.tmdb.org/t/p/w500/6DrHO1jr3qVrViUO6s6kFiAGM7.jpg', 'https://www.youtube.com/embed/47r8FXYZWNU', 123, 7.5, 'Jeff Fowler', 0, 10751, '2025-05-21 11:55:36', '2025-05-21 11:55:36'),
(116, 'Spirited Away', 'A young girl, Chihiro, becomes trapped in a strange new world of spirits. When her parents undergo a mysterious transformation, she must call upon the courage she never knew she had to free her family.', '2001-07-20', 'https://image.tmdb.org/t/p/w500/39wmItIWsg5sZMyRUHLkWBcuVCM.jpg', 'https://www.youtube.com/embed/GAp2_0JJskk', 125, 8.5, 'Hayao Miyazaki', 0, 10751, '2025-05-21 11:55:36', '2025-05-21 11:55:36'),
(117, 'Big Hero 6', 'A special bond develops between plus-sized inflatable robot Baymax, and prodigy Hiro Hamada, who team up with a group of friends to form a band of high-tech heroes.', '2014-10-24', 'https://image.tmdb.org/t/p/w500/2mxS4wUimwlLmI1xp6QW6NSU361.jpg', 'https://www.youtube.com/embed/8IdMPpKMdcc', 102, 7.7, 'Don Hall', 0, 10751, '2025-05-21 11:55:37', '2025-05-21 11:55:37'),
(118, 'Zootopia', 'Determined to prove herself, Officer Judy Hopps, the first bunny on Zootopia\'s police force, jumps at the chance to crack her first case - even if it means partnering with scam-artist fox Nick Wilde to solve the mystery.', '2016-02-11', 'https://image.tmdb.org/t/p/w500/hlK0e0wAQ3VLuJcsfIYPvb4JVud.jpg', 'https://www.youtube.com/embed/jWM0ct-OLsM', 109, 7.7, 'Byron Howard', 0, 10751, '2025-05-21 11:55:38', '2025-05-21 11:55:38'),
(119, 'Henry Danger: The Movie', 'Henry Hart meets a superfan—eager to fight crime with Kid Danger—who comes into possession of a device that can open up alternate realities. Facing a wild ride, Henry will need his best friend Jasper and his new superfan sidekick to find his way out or be stuck in another dimension forever.', '2025-01-17', 'https://image.tmdb.org/t/p/w500/dFWj2rOGsqSIX1PHFghbCBgpMnk.jpg', 'https://www.youtube.com/embed/Rcc9veq0JgM', 86, 7.8, 'Joe Menendez', 0, 10751, '2025-05-21 11:55:39', '2025-05-21 11:55:39'),
(120, 'Inside Out', 'When 11-year-old Riley moves to a new city, her Emotions team up to help her through the transition. Joy, Fear, Anger, Disgust and Sadness work together, but when Joy and Sadness get lost, they must journey through unfamiliar places to get back home.', '2015-06-17', 'https://image.tmdb.org/t/p/w500/2H1TmgdfNtsKlU9jKdeNyYL5y8T.jpg', 'https://www.youtube.com/embed/1HFv47QHWJU', 95, 7.9, 'Pete Docter', 0, 10751, '2025-05-21 11:55:40', '2025-05-21 11:55:40'),
(121, 'Peter Pan\'s Neverland Nightmare', 'Wendy Darling strikes out in an attempt to rescue her brother Michael from the clutches of the evil Peter Pan who intends to send him to Neverland. Along the way she meets a twisted Tinkerbell, who is hooked on what she thinks is fairy dust.', '2025-01-13', 'https://image.tmdb.org/t/p/w500/mOR1Ks0EcXocwMV4EPv4letz0F5.jpg', 'https://www.youtube.com/embed/Kdid3LYAL2o', 89, 4.9, 'Scott Chambers', 0, 14, '2025-05-21 11:55:41', '2025-05-21 11:55:41'),
(122, 'Wicked', 'In the land of Oz, ostracized and misunderstood green-skinned Elphaba is forced to share a room with the popular aristocrat Glinda at Shiz University, and the two\'s unlikely friendship is tested as they begin to fulfill their respective destinies as Glinda the Good and the Wicked Witch of the West.', '2024-11-20', 'https://image.tmdb.org/t/p/w500/xDGbZ0JJ3mYaGKy4Nzd9Kph6M9L.jpg', 'https://www.youtube.com/embed/pqi45Qhq3CI', 162, 6.9, 'Jon M. Chu', 0, 14, '2025-05-21 11:55:42', '2025-05-21 11:55:42'),
(123, 'Harry Potter and the Philosopher\'s Stone', 'Harry Potter has lived under the stairs at his aunt and uncle\'s house his whole life. But on his 11th birthday, he learns he\'s a powerful wizard—with a place waiting for him at the Hogwarts School of Witchcraft and Wizardry. As he learns to harness his newfound powers with the help of the school\'s kindly headmaster, Harry uncovers the truth about his parents\' deaths—and about the villain who\'s to blame.', '2001-11-16', 'https://image.tmdb.org/t/p/w500/wuMc08IPKEatf9rnMNXvIDxqP4W.jpg', 'https://www.youtube.com/embed/l91Km49W9qI', 152, 7.9, 'Chris Columbus', 0, 14, '2025-05-21 11:55:43', '2025-05-21 11:55:43'),
(124, 'The Lord of the Rings: The Fellowship of the Ring', 'Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.', '2001-12-18', 'https://image.tmdb.org/t/p/w500/6oom5QYQ2yQTMJIbnvbkBL9cHo6.jpg', 'https://www.youtube.com/embed/CbYmZOV3G-Q', 179, 8.4, 'Peter Jackson', 0, 14, '2025-05-21 11:55:44', '2025-05-21 11:55:44'),
(125, 'Home Sweet Home: Rebirth', 'When a city is overrun with a demonically-possessed crowd, a cop must find the source of evil to save his family.', '2025-03-20', 'https://image.tmdb.org/t/p/w500/9rCBCm9cyI4JfLEhx3EncyncMR3.jpg', 'https://www.youtube.com/embed/-17tBEdfDIs', 93, 6.2, 'Alexander Kiesl', 0, 14, '2025-05-21 11:55:45', '2025-05-21 11:55:45'),
(126, 'Avatar', 'In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien civilization.', '2009-12-15', 'https://image.tmdb.org/t/p/w500/kyeqWdyUXW608qlYkRqosgbbJyK.jpg', 'https://www.youtube.com/embed/jm2sNLIPPvA', 162, 7.6, 'James Cameron', 0, 14, '2025-05-21 11:55:46', '2025-05-21 11:55:46'),
(127, 'Holy Night: Demon Hunters', 'When a devil-worshipping criminal network plunges Seoul into chaos, the police turn to Holy Night—a trio of supernatural demon hunters—to restore order and defeat the rising evil.', '2025-04-30', 'https://image.tmdb.org/t/p/w500/v3Mo77Qjp6pctpD4eJaNT6kFRSB.jpg', 'https://www.youtube.com/embed/0l35oxLd1UI', 92, 4.5, 'Lim Dae-hee', 0, 14, '2025-05-21 11:55:47', '2025-05-21 11:55:47'),
(128, 'Twilight', 'When Bella Swan moves to a small town in the Pacific Northwest, she falls in love with Edward Cullen, a mysterious classmate who reveals himself to be a 108-year-old vampire. Despite Edward\'s repeated cautions, Bella can\'t stay away from him, a fatal move that endangers her own life.', '2008-11-20', 'https://image.tmdb.org/t/p/w500/3Gkb6jm6962ADUPaCBqzz9CTbn9.jpg', 'https://www.youtube.com/embed/uxjNDE2fMjI', 122, 6.3, 'Catherine Hardwicke', 0, 14, '2025-05-21 11:55:48', '2025-05-21 11:55:48'),
(129, 'Ne Zha 2', 'Following the Tribulation, although the souls of Ne Zha and Ao Bing were preserved, their physical bodies will soon be destroyed. Tai Yi Zhen Ren plans to use the Seven Colored Lotus to reshape their physical forms, but encounters numerous difficulties. What will become of Ne Zha and Ao Bing?', '2025-01-29', 'https://image.tmdb.org/t/p/w500/5lUmWTGkEcYnXujixXn31o9q2T0.jpg', 'https://www.youtube.com/embed/nsXQijb0F4I', 144, 7.9, 'Yang Yu', 0, 14, '2025-05-21 11:55:49', '2025-05-21 11:55:49'),
(130, 'A Knight\'s War', 'A fearless knight braves a deadly realm to save the Chosen One’s soul. Facing witches, demons, and brutal foes, he discovers her return could ignite chaos and doom humanity.', '2025-02-07', 'https://image.tmdb.org/t/p/w500/janjdSMrTRGtPrI1p9uOX66jv7x.jpg', 'https://www.youtube.com/embed/DHlXDqo7VsU', 103, 5.4, 'Matthew Ninaber', 0, 14, '2025-05-21 11:55:50', '2025-05-21 11:55:50'),
(131, 'Easter Bloody Easter', 'A woman must protect her small town from the Jackalope (based on the mythical rabbit-antelope creature of North American folklore) and his army of devilish bunnies as they embark on a murder spree over the Easter weekend.', '2024-03-25', 'https://image.tmdb.org/t/p/w500/8tGYZlPttiOjEe61GvszRcrnpEi.jpg', 'https://www.youtube.com/embed/Iui62C5VrvE', 103, 4.0, 'Diane Foster', 0, 14, '2025-05-21 11:55:51', '2025-05-21 11:55:51'),
(132, 'Solo Leveling -ReAwakening-', 'Over a decade after \'gates\' connecting worlds appeared, awakening \'hunters\' with superpowers, weakest hunter Sung Jinwoo encounters a double dungeon and accepts a mysterious quest, becoming the only one able to level up, changing his fate. A catch-up recap of the first season coupled with an exclusive sneak peek of the first two episodes of the highly anticipated second season in one momentous theatrical fan experience.', '2024-11-26', 'https://image.tmdb.org/t/p/w500/dblIFen0bNZAq8icJXHwrjfymDW.jpg', 'https://www.youtube.com/embed/UdIXUDpeTXU', 116, 6.9, 'Shunsuke Nakashige', 0, 14, '2025-05-21 11:55:52', '2025-05-21 11:55:52'),
(133, 'The Lord of the Rings: The War of the Rohirrim', 'A sudden attack by Wulf, a clever and traitorous lord of Rohan seeking vengeance for the death of his father, forces Helm Hammerhand, the King of Rohan, and his people to make a daring last stand in the ancient stronghold of the Hornburg.', '2024-12-05', 'https://image.tmdb.org/t/p/w500/cXzCOx1hUuU9CfmiEv6rXjb6EqU.jpg', 'https://www.youtube.com/embed/9FlsJqDox5M', 134, 6.7, 'Kenji Kamiyama', 0, 14, '2025-05-21 11:55:53', '2025-05-21 11:55:53'),
(134, 'Nosferatu', 'A gothic tale of obsession between a haunted young woman and the terrifying vampire infatuated with her, causing untold horror in its wake.', '2024-12-25', 'https://image.tmdb.org/t/p/w500/5qGIxdEO841C0tdY8vOdLoRVrr0.jpg', 'https://www.youtube.com/embed/nulvWqYUM8k', 133, 6.7, 'Robert Eggers', 0, 14, '2025-05-21 11:55:53', '2025-05-21 11:55:53'),
(135, 'Harry Potter and the Chamber of Secrets', 'Cars fly, trees fight back, and a mysterious house-elf comes to warn Harry Potter at the start of his second year at Hogwarts. Adventure and danger await when bloody writing on a wall announces: The Chamber Of Secrets Has Been Opened. To save Hogwarts will require all of Harry, Ron and Hermione’s magical abilities and courage.', '2002-11-13', 'https://image.tmdb.org/t/p/w500/sdEOH0992YZ0QSxgXNIGLq1ToUi.jpg', 'https://www.youtube.com/embed/nE11U5iBnH0', 161, 7.7, 'Chris Columbus', 0, 14, '2025-05-21 11:55:54', '2025-05-21 11:55:54'),
(136, 'The Edge of the Blade', 'In 1887, at a time when duels are in vogue in Paris, Clément Lacaze and Marie-Rose Astié meet. He\'s a charismatic master of arms; she\'s a feminist, far ahead of her time. Clément gets caught in a spiral of violence and decides to initiate Marie-Rose in the art of dueling. The two must work together to save face. How far will they go to defend their honor?', '2023-12-27', 'https://image.tmdb.org/t/p/w500/5cgk31QGJ5Z2oatbskPNDU8bbwq.jpg', 'https://www.youtube.com/embed/xns-tehAY5o', 101, 6.6, 'Vincent Perez', 0, 36, '2025-05-21 11:55:56', '2025-05-21 11:55:56'),
(137, 'Sky Force', 'In the 1965 Indo-Pak War, India faces a devastating surprise attack. Wing Commander Ahuja leads a retaliatory strike, but Squadron Leader Vijaya goes missing after a heroic solo engagement against a superior enemy jet. Ahuja spends 23 years seeking the truth and uncovering a cover-up.', '2025-01-24', 'https://image.tmdb.org/t/p/w500/pmtev9YTlIRDo25G7lN8dzyoszn.jpg', 'https://www.youtube.com/embed/PKsVB1wPZ78', 125, 6.4, 'Sandeep Kewlani', 0, 36, '2025-05-21 11:55:57', '2025-05-21 11:55:57'),
(138, 'I\'m Still Here', 'In 1971, military dictatorship in Brazil reaches its height. The Paiva family — Rubens, Eunice, and their five children — live in a beachside house in Rio, open to all their friends. One day, Rubens is taken for questioning and does not return.', '2024-09-19', 'https://image.tmdb.org/t/p/w500/gZnsMbhCvhzAQlKaVpeFRHYjGyb.jpg', 'https://www.youtube.com/embed/Eo49pAwMxKQ', 138, 8.0, 'Walter Salles', 0, 36, '2025-05-21 11:55:57', '2025-05-21 11:55:57'),
(139, 'Troy', 'In year 1250 B.C. during the late Bronze age, two emerging nations begin to clash. Paris, the Trojan prince, convinces Helen, Queen of Sparta, to leave her husband Menelaus, and sail with him back to Troy. After Menelaus finds out that his wife was taken by the Trojans, he asks his brother Agamemnon to help him get her back. Agamemnon sees this as an opportunity for power. They set off with 1,000 ships holding 50,000 Greeks to Troy.', '2004-05-13', 'https://image.tmdb.org/t/p/w500/a07wLy4ONfpsjnBqMwhlWTJTcm.jpg', 'https://www.youtube.com/embed/6FG3BfPuwBA', 163, 7.2, 'Wolfgang Petersen', 0, 36, '2025-05-21 11:55:58', '2025-05-21 11:55:58'),
(140, 'Kingdom of Heaven', 'After his wife dies, a blacksmith named Balian is thrust into royalty, political intrigue and bloody holy wars during the Crusades.', '2005-05-03', 'https://image.tmdb.org/t/p/w500/rNaBe4TwbMef71sgscqabpGKsxh.jpg', 'https://www.youtube.com/embed/6Z2wGCZ2fSM', 144, 7.0, 'Ridley Scott', 0, 36, '2025-05-21 11:55:59', '2025-05-21 11:55:59'),
(141, 'Hacksaw Ridge', 'WWII American Army Medic Desmond T. Doss, who served during the Battle of Okinawa, refuses to kill people and becomes the first Conscientious Objector in American history to receive the Congressional Medal of Honor.', '2016-10-07', 'https://image.tmdb.org/t/p/w500/jhWbYeUNOA5zAb6ufK6pXQFXqTX.jpg', 'https://www.youtube.com/embed/s2-1hz1juBI', 139, 8.2, 'Mel Gibson', 0, 36, '2025-05-21 11:56:00', '2025-05-21 11:56:00'),
(142, 'Napoleon', 'An epic that details the checkered rise and fall of French Emperor Napoleon Bonaparte and his relentless journey to power through the prism of his addictive, volatile relationship with his wife, Josephine.', '2023-11-22', 'https://image.tmdb.org/t/p/w500/ytFOXyghxLzAM4KZyazDdEkM66q.jpg', 'https://www.youtube.com/embed/KPr42qEdhnU', 158, 6.3, 'Ridley Scott', 0, 36, '2025-05-21 11:56:01', '2025-05-21 11:56:01'),
(143, 'The Alto Knights', 'Two of New York\'s most notorious organized crime bosses, Frank Costello and Vito Genovese, vie for control of the city\'s streets. Once the best of friends, petty jealousies and a series of betrayals place them on a deadly collision course that will reshape the Mafia (and America) forever.', '2025-03-14', 'https://image.tmdb.org/t/p/w500/95KmR0xNuZZ6DNESDwLKWGIBvMg.jpg', 'https://www.youtube.com/embed/1aayuOp0AnE', 123, 6.2, 'Barry Levinson', 0, 36, '2025-05-21 11:56:02', '2025-05-21 11:56:02'),
(144, 'Schindler\'s List', 'The true story of how businessman Oskar Schindler saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory during World War II.', '1993-12-15', 'https://image.tmdb.org/t/p/w500/sF1U4EUQS8YHUYjNl3pMGNIQyr0.jpg', 'https://www.youtube.com/embed/v0RB-3sWbBA', 195, 8.6, 'Steven Spielberg', 0, 36, '2025-05-21 11:56:03', '2025-05-21 11:56:03'),
(145, 'Hidden Figures', 'The untold story of Katherine G. Johnson, Dorothy Vaughan and Mary Jackson – brilliant African-American women working at NASA and serving as the brains behind one of the greatest operations in history – the launch of astronaut John Glenn into orbit. The visionary trio crossed all gender and race lines to inspire generations to dream big.', '2016-12-10', 'https://image.tmdb.org/t/p/w500/9lfz2W2uGjyow3am00rsPJ8iOyq.jpg', 'https://www.youtube.com/embed/5wfrDhgUMGI', 127, 8.1, 'Theodore Melfi', 0, 36, '2025-05-21 11:56:04', '2025-05-21 11:56:04'),
(146, 'Killers of the Flower Moon', 'When oil is discovered in 1920s Oklahoma under Osage Nation land, the Osage people are murdered one by one—until the FBI steps in to unravel the mystery.', '2023-10-18', 'https://image.tmdb.org/t/p/w500/dB6Krk806zeqd0YNp2ngQ9zXteH.jpg', 'https://www.youtube.com/embed/1oZUCkJEuvo', 206, 7.4, 'Martin Scorsese', 0, 36, '2025-05-21 11:56:05', '2025-05-21 11:56:05'),
(147, 'Green Book', 'Tony Lip, a bouncer in 1962, is hired to drive pianist Don Shirley on a tour through the Deep South in the days when African Americans, forced to find alternate accommodations and services due to segregation laws below the Mason-Dixon Line, relied on a guide called The Negro Motorist Green Book.', '2018-11-16', 'https://image.tmdb.org/t/p/w500/7BsvSuDQuoqhWmU2fL7W2GOcZHU.jpg', 'https://www.youtube.com/embed/QkZxoko_HC0', 130, 8.2, 'Peter Farrelly', 0, 36, '2025-05-21 11:56:06', '2025-05-21 11:56:06'),
(148, 'Saving Private Ryan', 'As U.S. troops storm the beaches of Normandy, three brothers lie dead on the battlefield, with a fourth trapped behind enemy lines. Ranger captain John Miller and seven men are tasked with penetrating German-held territory and bringing the boy home.', '1998-07-24', 'https://image.tmdb.org/t/p/w500/uqx37cS8cpHg8U35f9U5IBlrCV3.jpg', 'https://www.youtube.com/embed/y4SA9yUDgW8', 169, 8.2, 'Steven Spielberg', 0, 36, '2025-05-21 11:56:07', '2025-05-21 11:56:07'),
(149, 'The Iron Claw', 'The true story of the inseparable Von Erich brothers, who made history in the intensely competitive world of professional wrestling in the early 1980s. Through tragedy and triumph, under the shadow of their domineering father and coach, the brothers seek larger-than-life immortality on the biggest stage in sports.', '2023-12-21', 'https://image.tmdb.org/t/p/w500/lsdismtCDga4vsKnmliz0h7CaZT.jpg', 'https://www.youtube.com/embed/8KVsaoveTbw', 132, 7.5, 'Sean Durkin', 0, 36, '2025-05-21 11:56:08', '2025-05-21 11:56:08'),
(150, 'Braveheart', 'Enraged at the slaughter of Murron, his new bride and childhood love, Scottish warrior William Wallace slays a platoon of the local English lord\'s soldiers. This leads the village to revolt and, eventually, the entire country to rise up against English rule.', '1995-05-24', 'https://image.tmdb.org/t/p/w500/or1gBugydmjToAEq7OZY0owwFk.jpg', 'https://www.youtube.com/embed/WtO3CsleMDg', 177, 7.9, 'Mel Gibson', 0, 36, '2025-05-21 11:56:09', '2025-05-21 11:56:09'),
(156, 'Test Movie', 'Test Description', '2025-06-01', 'http://example.com/poster.jpg', 'http://example.com/trailer.mp4', 120, 8.5, 'Test Director', 0, 12, '2025-06-02 15:30:01', '2025-06-02 15:30:01'),
(194, 'Sikandar', 'A tragic accident pushes the powerful Sikandar to protect the less fortunate by standing up to corruption and greed — using any means necessary.', '2025-03-29', 'https://image.tmdb.org/t/p/w500/t48miSSfe7COqgbgMyRIyPVTBoM.jpg', NULL, 133, 5.2, 'A.R. Murugadoss', 0, 28, '2025-06-03 06:01:37', '2025-06-03 06:01:37'),
(195, 'Jewel Thief - The Heist Begins', 'In this high-octane battle of wits and wills, ingenious con artist Rehan devises a diamond heist while trying to outsmart Rajan, his sadistic adversary.', '2025-04-24', 'https://image.tmdb.org/t/p/w500/eujLbO0kf1eqWC8XpHUJdtAVW2J.jpg', 'https://www.youtube.com/embed/gzN46jvgTck', 118, 6.8, 'Robby Grewal', 0, 28, '2025-06-03 06:01:38', '2025-06-03 06:01:38'),
(196, 'Flight Risk', 'A U.S. Marshal escorts a government witness to trial after he\'s accused of getting involved with a mob boss, only to discover that the pilot who is transporting them is also a hitman sent to assassinate the informant. After they subdue him, they\'re forced to fly together after discovering that there are others attempting to eliminate them.', '2025-01-22', 'https://image.tmdb.org/t/p/w500/q0bCG4NX32iIEsRFZqRtuvzNCyZ.jpg', 'https://www.youtube.com/embed/Cml3CFDBj2s', 91, 6.1, 'Mel Gibson', 0, 28, '2025-06-03 06:01:39', '2025-06-03 06:01:39'),
(197, 'Day of Reckoning', 'Put-upon lawman John Dorsey is on the verge of losing his wife and his job as sheriff, so he posses up with bullish U.S. Marshall Butch Hayden to hold outlaw Emily Rusk hostage. A battle of wills ensues as Emily turns the posse on themselves, but as her marauding husband and his gang approach, Emily and John realize they will need each other to survive.', '2025-03-28', 'https://image.tmdb.org/t/p/w500/cVSjSQryFUERYSdOmdgJ2m0eBte.jpg', 'https://www.youtube.com/embed/tZaje_sh97A', 106, 6.4, 'Shaun Silva', 0, 28, '2025-06-03 06:01:41', '2025-06-03 06:01:41'),
(198, 'The Siege', 'International assassin Walker is compromised during a mission and sent to a reassignment center for a new identity. During his stay at the facility, a ruthless assault team storms the compound searching for someone their boss has lost. Walker begrudgingly falls in with skilled hitwoman Elda and her mysterious ward Juliet in order to survive the night.', '2023-03-10', 'https://image.tmdb.org/t/p/w500/hVh4hMzkXNLnScudbid6hDvjMPk.jpg', 'https://www.youtube.com/embed/zt8Q9lqaAFE', 97, 5.4, 'Brad Watson', 0, 28, '2025-06-03 06:01:43', '2025-06-03 06:01:43'),
(199, 'Dunkirk', 'The story of the miraculous evacuation of Allied soldiers from Belgium, Britain, Canada and France, who were cut off and surrounded by the German army from the beaches and harbour of Dunkirk between May 26th and June 4th 1940 during World War II.', '2017-07-19', 'https://image.tmdb.org/t/p/w500/b4Oe15CGLL61Ped0RAS9JpqdmCt.jpg', 'https://www.youtube.com/embed/T7O7BtBnsG4', 107, 7.5, 'Christopher Nolan', 0, 28, '2025-06-03 06:01:44', '2025-06-03 06:01:44'),
(200, 'From the World of John Wick: Ballerina', 'Taking place during the events of John Wick: Chapter 3 – Parabellum, Eve Macarro begins her training in the assassin traditions of the Ruska Roma.', '2025-06-06', 'https://image.tmdb.org/t/p/w500/mKp4euM5Cv3m2U1Vmby3OGwcD5y.jpg', 'https://www.youtube.com/embed/b9Rr9ygb-ac', 125, 8.3, 'Len Wiseman', 0, 28, '2025-06-03 06:01:45', '2025-06-03 06:01:45'),
(201, 'Avengers: Infinity War', 'As the Avengers and their allies have continued to protect the world from threats too large for any one hero to handle, a new danger has emerged from the cosmic shadows: Thanos. A despot of intergalactic infamy, his goal is to collect all six Infinity Stones, artifacts of unimaginable power, and use them to inflict his twisted will on all of reality. Everything the Avengers have fought for has led up to this moment - the fate of Earth and existence itself has never been more uncertain.', '2018-04-25', 'https://image.tmdb.org/t/p/w500/7WsyChQLEftFiDOVTGkv3hFpyyt.jpg', 'https://www.youtube.com/embed/QwievZ1Tx-8', 149, 8.2, 'Joe Russo', 0, 28, '2025-06-03 06:01:47', '2025-06-03 06:01:47'),
(202, 'Black Widow', 'Natasha Romanoff, also known as Black Widow, confronts the darker parts of her ledger when a dangerous conspiracy with ties to her past arises. Pursued by a force that will stop at nothing to bring her down, Natasha must deal with her history as a spy and the broken relationships left in her wake long before she became an Avenger.', '2021-07-07', 'https://image.tmdb.org/t/p/w500/qAZ0pzat24kLdO3o8ejmbLxyOac.jpg', 'https://www.youtube.com/embed/Fp9pNPdNwjI', 134, 7.2, 'Cate Shortland', 0, 28, '2025-06-03 06:01:48', '2025-06-03 06:01:48'),
(203, 'The Avengers', 'When an unexpected enemy emerges and threatens global safety and security, Nick Fury, director of the international peacekeeping agency known as S.H.I.E.L.D., finds himself in need of a team to pull the world back from the brink of disaster. Spanning the globe, a daring recruitment effort begins!', '2012-04-25', 'https://image.tmdb.org/t/p/w500/RYMX2wcKCBAr24UyPD7xwmjaTn.jpg', 'https://www.youtube.com/embed/hIR8Ar-Z4hw', 143, 7.8, 'Joss Whedon', 0, 28, '2025-06-03 06:01:50', '2025-06-03 06:01:50'),
(204, 'Gunslingers', 'When the most wanted man in America surfaces in a small Kentucky town, his violent history -- and a blood-thirsty mob seeking vengeance and a king’s ransom -- soon follow. As brothers face off against one another and bullets tear the town to shreds, this lightning-fast gunslinger makes his enemies pay the ultimate price for their greed.', '2025-04-11', 'https://image.tmdb.org/t/p/w500/O7REXWPANWXvX2jhQydHjAq2DV.jpg', 'https://www.youtube.com/embed/G4hVWe4GOrk', 104, 6.5, 'Brian Skiba', 0, 28, '2025-06-03 06:01:51', '2025-06-03 06:01:51'),
(205, 'Counterattack', 'When a hostage rescue mission creates a new enemy, Capt. Guerrero and his elite soldiers must face an ambush by a criminal group.', '2025-02-27', 'https://image.tmdb.org/t/p/w500/38I76hGcFY6xB47pjm7pZwkfuAF.jpg', 'https://www.youtube.com/embed/pEO34SeTsY0', 85, 8.3, 'Chava Cartas', 0, 28, '2025-06-03 06:01:52', '2025-06-03 06:01:52'),
(206, 'Shadow Force', 'Kyrah and Isaac were once the leaders of a multinational special forces group called Shadow Force. They broke the rules by falling in love, and in order to protect their son, they go underground. With a large bounty on their heads, and the vengeful Shadow Force hot on their trail, one family\'s fight becomes all-out war.', '2025-05-01', 'https://image.tmdb.org/t/p/w500/uX6FaNE86a4Xnf1mFFEryvjqB1D.jpg', 'https://www.youtube.com/embed/M7LhGytiHFM', 103, 5.9, 'Joe Carnahan', 0, 28, '2025-06-03 06:01:54', '2025-06-03 06:01:54'),
(207, 'Fight or Flight', 'A mercenary takes on the job of tracking down a target on a plane but must protect her when they\'re surrounded by people trying to kill both of them.', '2025-04-03', 'https://image.tmdb.org/t/p/w500/dNyzZaMDS5hmOzWHFgNlgRRPDB0.jpg', 'https://www.youtube.com/embed/SdsHRpjfqEI', 101, 5.9, 'James Madigan', 0, 28, '2025-06-03 06:01:55', '2025-06-03 06:01:55'),
(208, 'Mission: Impossible - Fallout', 'When an IMF mission ends badly, the world is faced with dire consequences. As Ethan Hunt takes it upon himself to fulfill his original briefing, the CIA begin to question his loyalty and his motives. The IMF team find themselves in a race against time, hunted by assassins while trying to prevent a global catastrophe.', '2018-07-25', 'https://image.tmdb.org/t/p/w500/AkJQpZp9WoNdj7pLYSj1L0RcMMN.jpg', 'https://www.youtube.com/embed/MEOOas3JZt0', 147, 7.4, 'Christopher McQuarrie', 0, 28, '2025-06-03 06:01:56', '2025-06-03 06:01:56'),
(209, 'Fountain of Youth', 'A treasure-hunting mastermind assembles a team for a life-changing adventure. But to outwit and outrun threats at every turn, he\'ll need someone even smarter than he is: his estranged sister.', '2025-05-19', 'https://image.tmdb.org/t/p/w500/4iWjGghUj2uyHo2Hyw8NFBvsNGm.jpg', 'https://www.youtube.com/embed/-7S28bH8iDs', 126, 6.5, 'Guy Ritchie', 0, 12, '2025-06-03 06:01:58', '2025-06-03 06:01:58'),
(210, 'Panda Bear in Africa', 'A young adventurous panda travels from China to Africa to rescue his best friend, Jielong the Dragon, who has been kidnapped. On his journey, he discovers a strange amazing new world of mountains, deserts and jungles.', '2024-03-15', 'https://image.tmdb.org/t/p/w500/wxpu7svVqA0ALYpofQBPujGelN3.jpg', 'https://www.youtube.com/embed/WVpCznqomlw', 94, 6.3, 'Karsten Kiilerich', 0, 12, '2025-06-03 06:01:59', '2025-06-03 06:01:59'),
(211, 'Norbert', 'Norbert an incompetent spy from a sad, bureaucratic and grey nation will become a key player to thwart the plans of his own government, in an exciting quest that will see him travel alongside strange companions.', '2025-01-17', 'https://image.tmdb.org/t/p/w500/9kUC13Ssxfjlc8leD7QpELCDlDU.jpg', NULL, NULL, 5.9, 'José Corral Llorente', 0, 12, '2025-06-03 06:02:00', '2025-06-03 06:02:00'),
(212, 'Detective Chirp & the Golden Beehive', 'Residents of Honey Valley are getting ready for their favorite holiday - City Day, when all citizens have the opportunity to admire a unique artifact - the Golden Hive. According to legend, it was found by the founders of Honey Valley, and legend has it that thousands of misfortunes will fall upon the town if the Hive disappears. On the eve of the holiday, the Beehive is kidnapped. The squirrel Chink, Sophie\'s owl detective\'s assistant, is blamed for this. Chink and his friends have to unravel the case, find the real crook and return not only the Golden Hive, but also peace to the Valley.', '2022-11-17', 'https://image.tmdb.org/t/p/w500/oxCPceQ4exEuxU3vfRl8doWyqj8.jpg', 'https://www.youtube.com/embed/CNUOL23aUQI', 85, 8.8, 'Григорий Вожакин', 0, 12, '2025-06-03 06:02:02', '2025-06-03 06:02:02'),
(213, 'Stitch! The Movie', 'The continuing adventures of Lilo, a little Hawaiian girl, and Stitch, the galaxy\'s most-wanted extraterrestrial. Stitch, Pleakley, and Dr. Jumba are all part of the household now, but what Lilo and Stitch don\'t know is that Dr. Jumba brought his other alien \"experiments\" to Hawaiʻi as well.', '2003-09-10', 'https://image.tmdb.org/t/p/w500/flwMGZcOO80lqsnZ6lIwsKja5N.jpg', 'https://www.youtube.com/embed/dUr6plz3NHU', 63, 6.4, 'Bobs Gannaway', 0, 12, '2025-06-03 06:02:03', '2025-06-03 06:02:03'),
(214, 'The Phoenician Scheme', 'The story of a family and a family business.', '2025-05-23', 'https://image.tmdb.org/t/p/w500/aHjpixSOn166tZLWRdIvHWDPu6y.jpg', 'https://www.youtube.com/embed/GEuMnPl2WI4', 102, 6.8, 'Wes Anderson', 0, 12, '2025-06-03 06:02:04', '2025-06-03 06:02:04'),
(215, 'Carjackers', 'By day, they\'re invisible—valets, hostesses, and bartenders at a luxury hotel. By night, they\'re the Carjackers, a crew of skilled drivers who track and rob wealthy clients on the road. As they plan their ultimate heist, the hotel director hires a ruthless hitman, to stop them at all costs. With danger closing in, can Nora, Zoe, Steve, and Prestance pull off their biggest score yet?', '2025-03-27', 'https://image.tmdb.org/t/p/w500/wbkPMTz2vVai7Ujyp0ag7AM9SrO.jpg', 'https://www.youtube.com/embed/slSwwaZ0KoM', 97, 6.1, 'Kamel Guemra', 0, 12, '2025-06-03 06:02:06', '2025-06-03 06:02:06'),
(216, 'Jurassic World Rebirth', 'Five years after the events of Jurassic World Dominion, covert operations expert Zora Bennett is contracted to lead a skilled team on a top-secret mission to secure genetic material from the world\'s three most massive dinosaurs. When Zora\'s operation intersects with a civilian family whose boating expedition was capsized, they all find themselves stranded on an island where they come face-to-face with a sinister, shocking discovery that\'s been hidden from the world for decades.', '2025-07-01', 'https://image.tmdb.org/t/p/w500/3PFe8tqaqMeoqBXoz3CK8gKAeKr.jpg', 'https://www.youtube.com/embed/smavD1fopZ8', 133, NULL, 'Gareth Edwards', 0, 12, '2025-06-03 06:02:07', '2025-06-03 06:02:07'),
(217, 'Spider-Man: No Way Home', 'Peter Parker is unmasked and no longer able to separate his normal life from the high-stakes of being a super-hero. When he asks for help from Doctor Strange the stakes become even more dangerous, forcing him to discover what it truly means to be Spider-Man.', '2021-12-15', 'https://image.tmdb.org/t/p/w500/1g0dhYtq4irTY1GPXvft6k4YLjm.jpg', 'https://www.youtube.com/embed/1mTjfMFyPi8', 148, 7.9, 'Jon Watts', 0, 12, '2025-06-03 06:02:09', '2025-06-03 06:02:09'),
(218, 'How to Train Your Dragon 2', 'Five years have passed since Hiccup and Toothless united the dragons and Vikings of Berk. Now, they spend their time charting unmapped territories. During one of their adventures, the pair discover a secret cave that houses hundreds of wild dragons -- and a mysterious dragon rider. Hiccup and Toothless find themselves at the center of a battle to protect Berk from a power-hungry warrior.', '2014-06-05', 'https://image.tmdb.org/t/p/w500/d13Uj86LdbDLrfDoHR5aDOFYyJC.jpg', 'https://www.youtube.com/embed/1Y0erVF9cLI', 102, 7.7, 'Dean DeBlois', 0, 12, '2025-06-03 06:02:10', '2025-06-03 06:02:10'),
(219, 'The Karate Kid', '12-year-old Dre Parker could\'ve been the most popular kid in Detroit, but his mother\'s latest career move has landed him in China. Dre immediately falls for his classmate Mei Ying but the cultural differences make such a friendship impossible. Even worse, Dre\'s feelings make him an enemy of the class bully, Cheng. With no friends in a strange land, Dre has nowhere to turn but maintenance man Mr. Han, who is a kung fu master. As Han teaches Dre that kung fu is not about punches and parries, but maturity and calm, Dre realizes that facing down the bullies will be the fight of his life.', '2010-06-10', 'https://image.tmdb.org/t/p/w500/b1RBy3l297N0c7PHjlz35cClWju.jpg', 'https://www.youtube.com/embed/XY8amUImEu0', 140, 6.6, 'Harald Zwart', 0, 12, '2025-06-03 06:02:11', '2025-06-03 06:02:11'),
(220, 'Avengers: Endgame', 'After the devastating events of Avengers: Infinity War, the universe is in ruins due to the efforts of the Mad Titan, Thanos. With the help of remaining allies, the Avengers must assemble once more in order to undo Thanos\' actions and restore order to the universe once and for all, no matter what consequences may be in store.', '2019-04-24', 'https://image.tmdb.org/t/p/w500/ulzhLuWrPK07P1YkdWQLZnQh1JL.jpg', 'https://www.youtube.com/embed/AMSITikqKiM', 181, 8.2, 'Anthony Russo', 0, 12, '2025-06-03 06:02:12', '2025-06-03 06:02:12'),
(221, 'Mission: Impossible - Ghost Protocol', 'Ethan Hunt and his team are racing against time to track down a dangerous terrorist named Hendricks, who has gained access to Russian nuclear launch codes and is planning a strike on the United States. An attempt to stop him ends in an explosion causing severe destruction to the Kremlin and the IMF to be implicated in the bombing, forcing the President to disavow them. No longer being aided by the government, Ethan and his team chase Hendricks around the globe, although they might still be too late to stop a disaster.', '2011-12-07', 'https://image.tmdb.org/t/p/w500/eRZTGx7GsiKqPch96k27LK005ZL.jpg', 'https://www.youtube.com/embed/7wkih9Yvxq0', 133, 7.1, 'Brad Bird', 0, 12, '2025-06-03 06:02:14', '2025-06-03 06:02:14'),
(222, 'Harry Potter and the Prisoner of Azkaban', 'Year three at Hogwarts means new fun and challenges as Harry learns the delicate art of approaching a Hippogriff, transforming shape-shifting Boggarts into hilarity and even turning back time. But the term also brings danger: soul-sucking Dementors hover over the school, an ally of the accursed He-Who-Cannot-Be-Named lurks within the castle walls, and fearsome wizard Sirius Black escapes Azkaban. And Harry will confront them all.', '2004-05-31', 'https://image.tmdb.org/t/p/w500/aWxwnYoe8p2d2fcxOqtvAtJ72Rw.jpg', 'https://www.youtube.com/embed/VwErvYgoH70', 141, 8.0, 'Alfonso Cuarón', 0, 12, '2025-06-03 06:02:15', '2025-06-03 06:02:15'),
(223, 'Wonder Woman', 'An Amazon princess comes to the world of Man in the grips of the First World War to confront the forces of evil and bring an end to human conflict.', '2017-05-30', 'https://image.tmdb.org/t/p/w500/v4ncgZjG2Zu8ZW5al1vIZTsSjqX.jpg', 'https://www.youtube.com/embed/VSB4wGIdDwo', 141, 7.2, 'Patty Jenkins', 0, 12, '2025-06-03 06:02:16', '2025-06-03 06:02:16'),
(224, 'Lost in Starlight', 'When an astronaut leaves Earth for Mars, the vast infinite space divides star-crossed lovers in this animated romance that crosses the cosmos.', '2025-05-30', 'https://image.tmdb.org/t/p/w500/dXlUIfwejWa9YvugU9V773dUASY.jpg', 'https://www.youtube.com/embed/VvMbyw_vIcA', 96, 7.3, 'Han Ji-won', 0, 16, '2025-06-03 06:02:18', '2025-06-03 06:02:18'),
(225, 'Lilo & Stitch 2: Stitch Has a Glitch', 'Now, we find the rowdy extraterrestrial getting used to life with his new ʻohana. However, a malfunction in the ultimate creation of Dr. Jumba soon emerges, which reinstates his destructive programming and threatens to both ruin his friendship with Lilo and to short him out for good!', '2005-08-22', 'https://image.tmdb.org/t/p/w500/p2R4mhZcikWEBlqv80VfJ7M9xql.jpg', 'https://www.youtube.com/embed/MpCQIVYZEqg', 68, 6.7, 'Tony Leondis', 0, 16, '2025-06-03 06:02:19', '2025-06-03 06:02:19'),
(226, 'Lulu Is a Rhinoceros', 'On a quest to spread kindness, fun-loving Lulu embarks on the adventure of a lifetime, powered by new friends, courage, and catchy songs!', '2025-05-29', 'https://image.tmdb.org/t/p/w500/h6cxDZb5JRzaMZP37AfGPlHfCnm.jpg', 'https://www.youtube.com/embed/SJDW5xv-rJU', 47, 9.0, 'Angela Stempel', 0, 16, '2025-06-03 06:02:20', '2025-06-03 06:02:20'),
(227, 'Leroy & Stitch', 'Lilo, Stitch, Jumba, and Pleakley have finally caught all of Jumba\'s genetic experiments and found the one true place where each of them belongs. Stitch, Jumba and Pleakley are offered positions in the Galactic Alliance, turning them down so they can stay on Earth with Lilo, but Lilo realizes her alien friends have places where they belong – and it\'s finally time to say \"aloha\".', '2006-06-23', 'https://image.tmdb.org/t/p/w500/8ddTcTllI5U1Gq2EvGYE2CBprOS.jpg', 'https://www.youtube.com/embed/SXw5RThp2HQ', 73, 6.6, 'Bobs Gannaway', 0, 16, '2025-06-03 06:02:21', '2025-06-03 06:02:21'),
(228, 'Your Name.', 'High schoolers Mitsuha and Taki are complete strangers living separate lives. But one night, they suddenly switch places. Mitsuha wakes up in Taki’s body, and he in hers. This bizarre occurrence continues to happen randomly, and the two must adjust their lives around each other.', '2016-08-26', 'https://image.tmdb.org/t/p/w500/8GJsy7w7frGquw1cy9jasOGNNI1.jpg', 'https://www.youtube.com/embed/o4-URMnBOPU', 106, 8.5, 'Makoto Shinkai', 0, 16, '2025-06-03 06:02:22', '2025-06-03 06:02:22'),
(229, 'The Garfield Movie', 'Garfield, the world-famous, Monday-hating, lasagna-loving indoor cat, is about to have a wild outdoor adventure! After an unexpected reunion with his long-lost father – scruffy street cat Vic – Garfield and his canine friend Odie are forced from their perfectly pampered life into joining Vic in a hilarious, high-stakes heist.', '2024-04-30', 'https://image.tmdb.org/t/p/w500/xYduFGuch9OwbCOEUiamml18ZoB.jpg', 'https://www.youtube.com/embed/yk2Ej59DnrE', 100, 7.1, 'Mark Dindal', 0, 16, '2025-06-03 06:02:24', '2025-06-03 06:02:24'),
(230, 'How to Train Your Dragon: The Hidden World', 'As Hiccup fulfills his dream of creating a peaceful dragon utopia, Toothless’ discovery of an untamed, elusive mate draws the Night Fury away. When danger mounts at home and Hiccup’s reign as village chief is tested, both dragon and rider must make impossible decisions to save their kind.', '2019-01-03', 'https://image.tmdb.org/t/p/w500/xvx4Yhf0DVH8G4LzNISpMfFBDy2.jpg', 'https://www.youtube.com/embed/5DEdq57E5ls', 104, 7.7, 'Dean DeBlois', 0, 16, '2025-06-03 06:02:25', '2025-06-03 06:02:25'),
(231, 'Tangled', 'Feisty teenager Rapunzel, who has long and magical hair, wants to go and see sky lanterns on her eighteenth birthday, but she\'s bound to a tower by her overprotective mother. She strikes a deal with Flynn Rider, a charming wanted thief, and the duo set off on an action-packed escapade.', '2010-11-24', 'https://image.tmdb.org/t/p/w500/ym7Kst6a4uodryxqbGOxmewF235.jpg', 'https://www.youtube.com/embed/gsYKF8ecC8g', 100, 7.6, 'Nathan Greno', 0, 16, '2025-06-03 06:02:26', '2025-06-03 06:02:26'),
(232, 'Monsters, Inc.', 'Lovable Sulley and his wisecracking sidekick Mike Wazowski are the top scare team at Monsters, Inc., the scream-processing factory in Monstropolis. When a little girl named Boo wanders into their world, it\'s the monsters who are scared silly, and it\'s up to Sulley and Mike to keep her out of sight and get her back home.', '2001-11-01', 'https://image.tmdb.org/t/p/w500/qjlbN6aK1qgeg3SspFVovT2D1Me.jpg', 'https://www.youtube.com/embed/GnuQH_ASzu8', 92, 7.8, 'Pete Docter', 0, 16, '2025-06-03 06:02:27', '2025-06-03 06:02:27'),
(233, 'Toy Story 2', 'Andy heads off to Cowboy Camp, leaving his toys to their own devices. Things shift into high gear when an obsessive toy collector named Al McWhiggen, owner of Al\'s Toy Barn kidnaps Woody. Andy\'s toys mount a daring rescue mission, Buzz Lightyear meets his match and Woody has to decide where he and his heart truly belong.', '1999-10-30', 'https://image.tmdb.org/t/p/w500/yFWQkz2ynjwsazT6xQiIXEUsyuh.jpg', 'https://www.youtube.com/embed/xNWSGRD5CzU', 92, 7.6, 'John Lasseter', 0, 16, '2025-06-03 06:02:29', '2025-06-03 06:02:29'),
(234, 'Encanto', 'The tale of an extraordinary family, the Madrigals, who live hidden in the mountains of Colombia, in a magical house, in a vibrant town, in a wondrous, charmed place called an Encanto. The magic of the Encanto has blessed every child in the family—every child except one, Mirabel. But when she discovers that the magic surrounding the Encanto is in danger, Mirabel decides that she, the only ordinary Madrigal, might just be her exceptional family\'s last hope.', '2021-10-13', 'https://image.tmdb.org/t/p/w500/4j0PNHkMr5ax3IA8tjtxcmPU3QT.jpg', 'https://www.youtube.com/embed/CaimKeDcudo', 102, 7.6, 'Byron Howard', 0, 16, '2025-06-03 06:02:30', '2025-06-03 06:02:30'),
(235, 'The King of Kings', 'Charles Dickens tells his young son Walter the greatest story ever told, and what begins as a bedtime tale becomes a life-changing journey. Through vivid imagination, the boy walks alongside Jesus, witnessing His miracles, facing His trials, and understanding His ultimate sacrifice.', '2025-04-07', 'https://image.tmdb.org/t/p/w500/ccw7CCIAvcZV431CP7NhHAHuiHR.jpg', 'https://www.youtube.com/embed/HkGZ4ykhYPg', 102, 8.0, 'Jang Seong-ho', 0, 16, '2025-06-03 06:02:32', '2025-06-03 06:02:32'),
(236, 'The Lion King', 'Young lion prince Simba, eager to one day become king of the Pride Lands, grows up under the watchful eye of his father Mufasa; all the while his villainous uncle Scar conspires to take the throne for himself. Amid betrayal and tragedy, Simba must confront his past and find his rightful place in the Circle of Life.', '1994-06-15', 'https://image.tmdb.org/t/p/w500/sKCr78MXSLixwmZ8DyJLrpMsd15.jpg', 'https://www.youtube.com/embed/UgjEj5mXLlk', 89, 8.3, 'Roger Allers', 0, 16, '2025-06-03 06:02:33', '2025-06-03 06:02:33'),
(237, 'Ice Age', 'With the impending ice age almost upon them, a mismatched trio of prehistoric critters – Manny the woolly mammoth, Diego the saber-toothed tiger and Sid the giant sloth – find an orphaned infant and decide to return it to its human parents. Along the way, the unlikely allies become friends but, when enemies attack, their quest takes on far nobler aims.', '2002-03-14', 'https://image.tmdb.org/t/p/w500/gLhHHZUzeseRXShoDyC4VqLgsNv.jpg', 'https://www.youtube.com/embed/Wc7EpI4Y4fw', 81, 7.4, 'Chris Wedge', 0, 16, '2025-06-03 06:02:34', '2025-06-03 06:02:34'),
(238, 'Migration', 'After a migrating duck family alights on their pond with thrilling tales of far-flung places, the Mallard family embarks on a family road trip, from New England, to New York City, to tropical Jamaica.', '2023-12-06', 'https://image.tmdb.org/t/p/w500/dpXxBDi0ut5svjh5fbAqLoaJSq8.jpg', 'https://www.youtube.com/embed/hWbfohXIdEU', 83, 7.4, 'Benjamin Renner', 0, 16, '2025-06-03 06:02:35', '2025-06-03 06:02:35'),
(239, 'Lilo & Stitch', 'The wildly funny and touching story of a lonely Hawaiian girl and the fugitive alien who helps to mend her broken family.', '2025-05-17', 'https://image.tmdb.org/t/p/w500/tUae3mefrDVTgm5mRzqWnZK6fOP.jpg', 'https://www.youtube.com/embed/VWqJifMMgZE', 108, 7.1, 'Dean Fleischer Camp', 0, 35, '2025-06-03 06:02:37', '2025-06-03 06:02:37'),
(240, 'Mountainhead', 'A group of billionaire friends get together against the backdrop of a rolling international crisis.', '2025-05-22', 'https://image.tmdb.org/t/p/w500/jZKK5mFKWbquxhAGMkRJtNYwk0I.jpg', 'https://www.youtube.com/embed/27cN2_k0JF0', 109, 5.9, 'Jesse Armstrong', 0, 35, '2025-06-03 06:02:39', '2025-06-03 06:02:39'),
(241, 'Graduation Trip: Mallorca', '2021. After spending a year in confinement, a group of high school students and their two teachers begin an end-of-year trip to Mallorca. This great plan is the last opportunity they have to all be together, make up for lost time, be able to have fun like they have never had before and say goodbye to this crazy stage of their lives. However, a new coronavirus outbreak disrupts all their plans and forces them to stay locked in their hotel rooms. More than 50 students, 2 teachers, a hotel and many, many minibars... What could go wrong?', '2025-05-30', 'https://image.tmdb.org/t/p/w500/ejYX4ygRoupGRjFgmmtnK0sMxhN.jpg', 'https://www.youtube.com/embed/H1lyNOlvFkI', 113, 5.8, 'Paco Caballero', 0, 35, '2025-06-03 06:02:40', '2025-06-03 06:02:40');
INSERT INTO `movies` (`id`, `title`, `description`, `release_date`, `poster_url`, `trailer_url`, `duration`, `imdb_rating`, `director`, `views`, `genre_id`, `created_at`, `updated_at`) VALUES
(242, 'Sex Education Mistresses', 'An erotic comedy depicting the sex adventures of  young wives living in an apartment complex, that are not satisfied with just having sex with their husbands.', '1973-11-20', 'https://image.tmdb.org/t/p/w500/xghWMg0pkBOdLHCTESyeyHU68wl.jpg', NULL, 78, 5.9, 'Akira Kato', 0, 35, '2025-06-03 06:02:42', '2025-06-03 06:02:42'),
(243, 'The Party\'s Over', 'Illegally arriving in Spain, young Senegalese immigrant Bilal evades the police and finds refuge in an Andalusian manor house. Discovered separately by the capricious lady of the house, Carmina, and the maid, Lupe, Bilal\'s sanctuary turns into a perilous prison.', '2025-01-31', 'https://image.tmdb.org/t/p/w500/jqfTVbZ23Uv9hV2bu6dth13bHnS.jpg', NULL, 103, 6.0, 'Elena Manrique', 0, 35, '2025-06-03 06:02:43', '2025-06-03 06:02:43'),
(244, 'Sharp Corner', 'A dedicated family man becomes obsessed with saving the lives of the car accident victims on the sharp corner in front of his house – an obsession that could cost him everything.', '2025-05-09', 'https://image.tmdb.org/t/p/w500/hPK7H70vQVpT3qn9zedKqizXVdx.jpg', 'https://www.youtube.com/embed/w9T-z2_yNcM', 111, 6.1, 'Jason Buxton', 0, 35, '2025-06-03 06:02:45', '2025-06-03 06:02:45'),
(245, 'My Dead Friend Zoe', 'Merit, a U.S. Army veteran suffering from PTSD, is repeatedly tortured by visions of her deceased friend and company buddy Zoe. After her Afghanistan service in 2016, she attends group therapy until Dale, her grandfather and former Lieutenant Colonel, is recently diagnosed with Alzheimer\'s. Merit steps up to his aide, and discovers more about herself and her family, while also gaining the courage to put her metaphorical demons to rest.', '2024-03-09', 'https://image.tmdb.org/t/p/w500/bRoDBpwGU5UW03hQMExN2l92Q93.jpg', 'https://www.youtube.com/embed/RnnLG2Bps74', 103, 6.4, 'Kyle Hausmann-Stokes', 0, 35, '2025-06-03 06:02:46', '2025-06-03 06:02:46'),
(246, 'The Hangover', 'When three friends finally come to after a raucous night of bachelor-party revelry, they find a baby in the closet and a tiger in the bathroom. But they can\'t seem to locate their best friend, Doug – who\'s supposed to be tying the knot. Launching a frantic search for Doug, the trio perseveres through a nasty hangover to try to make it to the church on time.', '2009-06-02', 'https://image.tmdb.org/t/p/w500/A0uS9rHR56FeBtpjVki16M5xxSW.jpg', 'https://www.youtube.com/embed/tlize92ffnY', 100, 7.3, 'Todd Phillips', 0, 35, '2025-06-03 06:02:48', '2025-06-03 06:02:48'),
(247, 'The Wolf of Wall Street', 'A New York stockbroker refuses to cooperate in a large securities fraud case involving corruption on Wall Street, corporate banking world and mob infiltration. Based on Jordan Belfort\'s autobiography.', '2013-12-25', 'https://image.tmdb.org/t/p/w500/kW9LmvYHAaS9iA0tHmZVq8hQYoq.jpg', 'https://www.youtube.com/embed/Slj4-Sv-YNA', 180, 8.0, 'Martin Scorsese', 0, 35, '2025-06-03 06:02:49', '2025-06-03 06:02:49'),
(248, 'Parasite', 'All unemployed, Ki-taek\'s family takes peculiar interest in the wealthy and glamorous Parks for their livelihood until they get entangled in an unexpected incident.', '2019-05-30', 'https://image.tmdb.org/t/p/w500/7IiTTgloJzvGI1TAYymCfbfl3vT.jpg', 'https://www.youtube.com/embed/bM9QabAojCg', 133, 8.5, 'Bong Joon Ho', 0, 35, '2025-06-03 06:02:50', '2025-06-03 06:02:50'),
(249, 'Back in Action', 'Fifteen years after vanishing from the CIA to start a family, elite spies Matt and Emily jump back into the world of espionage when their cover is blown.', '2025-01-15', 'https://image.tmdb.org/t/p/w500/3L3l6LsiLGHkTG4RFB2aBA6BttB.jpg', 'https://www.youtube.com/embed/MV2nYw6gL_w', 114, 6.5, 'Seth Gordon', 0, 35, '2025-06-03 06:02:52', '2025-06-03 06:02:52'),
(250, 'Grown Ups', 'After their high school basketball coach passes away, five good friends and former teammates reunite for a Fourth of July holiday weekend.', '2010-06-24', 'https://image.tmdb.org/t/p/w500/ys0LscDFAuZxfUcpH5moiPeFfXs.jpg', 'https://www.youtube.com/embed/Nk1ERmswxsY', 102, 6.4, 'Dennis Dugan', 0, 35, '2025-06-03 06:02:53', '2025-06-03 06:02:53'),
(251, 'Love Hurts', 'A realtor is pulled back into the life he left behind after his former partner-in-crime resurfaces with an ominous message. With his crime-lord brother also on his trail, he must confront his past and the history he never fully buried.', '2025-02-06', 'https://image.tmdb.org/t/p/w500/skPPVeHoTTVVSJlb0Ib5vrqiuA4.jpg', 'https://www.youtube.com/embed/y7_gi1-bIJs', 83, 5.9, 'Jonathan Eusebio', 0, 35, '2025-06-03 06:02:54', '2025-06-03 06:02:54'),
(252, 'Forrest Gump', 'A man with a low IQ has accomplished great things in his life and been present during significant historic events—in each case, far exceeding what anyone imagined he could do. But despite all he has achieved, his one true love eludes him.', '1994-06-23', 'https://image.tmdb.org/t/p/w500/arw2vcBveWOVZr6pxd9XTd1TdQa.jpg', 'https://www.youtube.com/embed/m-btyJIYLyI', 142, 8.5, 'Robert Zemeckis', 0, 35, '2025-06-03 06:02:56', '2025-06-03 06:02:56'),
(253, 'Cruella', 'In 1970s London amidst the punk rock revolution, a young grifter named Estella is determined to make a name for herself with her designs. She befriends a pair of young thieves who appreciate her appetite for mischief, and together they are able to build a life for themselves on the London streets. One day, Estella’s flair for fashion catches the eye of the Baroness von Hellman, a fashion legend who is devastatingly chic and terrifyingly haute. But their relationship sets in motion a course of events and revelations that will cause Estella to embrace her wicked side and become the raucous, fashionable and revenge-bent Cruella.', '2021-05-26', 'https://image.tmdb.org/t/p/w500/wToO8opxkGwKgSfJ1JK8tGvkG6U.jpg', 'https://www.youtube.com/embed/jpZrVxvG3mk', 134, 8.0, 'Craig Gillespie', 0, 35, '2025-06-03 06:02:57', '2025-06-03 06:02:57'),
(254, 'Beating Hearts', 'Local rebellious teenager Clotaire falls for his schoolmate Jackie, but gang violence leads him to a darker destructive path. After years apart, the star-crossed lovers discover that every path they\'ve taken leads them back together.', '2024-10-16', 'https://image.tmdb.org/t/p/w500/yu9dRyKcUHTfKcqsomUtpord4t3.jpg', 'https://www.youtube.com/embed/CXzlDdTLU-g', 166, 7.2, 'Gilles Lellouche', 0, 80, '2025-06-03 06:02:58', '2025-06-03 06:02:58'),
(255, 'GoodFellas', 'The true story of Henry Hill, a half-Irish, half-Sicilian Brooklyn kid who is adopted by neighbourhood gangsters at an early age and climbs the ranks of a Mafia family under the guidance of Jimmy Conway.', '1990-09-12', 'https://image.tmdb.org/t/p/w500/aKuFiU82s5ISJpGZp7YkIr3kCUd.jpg', 'https://www.youtube.com/embed/PTBRNXGQR9Q', 145, 8.5, 'Martin Scorsese', 0, 80, '2025-06-03 06:03:00', '2025-06-03 06:03:00'),
(256, 'HIT: The Third Case', 'The Homicide Intervention Team (HIT) sends ruthless police officer Arjun Sarkaar to find a group of killers and stop their grisly murder spree.', '2025-04-30', 'https://image.tmdb.org/t/p/w500/wT9tGyFol4RBwkjESXUWeBdnLJn.jpg', NULL, 157, 7.9, 'Sailesh Kolanu', 0, 80, '2025-06-03 06:03:01', '2025-06-03 06:03:01'),
(257, 'The Hard Hit', 'An Interpol agent hunting the head of a global crime syndicate tracks his target to Las Vegas, but when the criminal organization kills his wife and daughter, he goes above the law to get his revenge.', '2023-10-20', 'https://image.tmdb.org/t/p/w500/whkFbOZTamHeugEG95jvQehSzAH.jpg', 'https://www.youtube.com/embed/56OSxe68mo8', 76, 6.8, 'Darien Smith', 0, 80, '2025-06-03 06:03:03', '2025-06-03 06:03:03'),
(258, 'The Beekeeper', 'One man\'s campaign for vengeance takes on national stakes after he is revealed to be a former operative of a powerful and clandestine organization known as Beekeepers.', '2024-01-08', 'https://image.tmdb.org/t/p/w500/A7EByudX0eOzlkQ2FIbogzyazm2.jpg', 'https://www.youtube.com/embed/CHKn-yDCE2w', 105, 7.3, 'David Ayer', 0, 80, '2025-06-03 06:03:04', '2025-06-03 06:03:04'),
(259, 'Se7en', 'Two homicide detectives are on a desperate hunt for a serial killer whose crimes are based on the \"seven deadly sins\" in this dark and haunting film that takes viewers from the tortured remains of one victim to the next. The seasoned Det. Somerset researches each sin in an effort to get inside the killer\'s mind, while his novice partner, Mills, scoffs at his efforts to unravel the case.', '1995-09-22', 'https://image.tmdb.org/t/p/w500/191nKfP0ehp3uIvWqgPbFmI4lv9.jpg', 'https://www.youtube.com/embed/KPOuJGkpblk', 127, 8.4, 'David Fincher', 0, 80, '2025-06-03 06:03:05', '2025-06-03 06:03:05'),
(260, 'The Batman', 'In his second year of fighting crime, Batman uncovers corruption in Gotham City that connects to his own family while facing a serial killer known as the Riddler.', '2022-03-01', 'https://image.tmdb.org/t/p/w500/74xTEgt7R36Fpooo50r9T25onhq.jpg', 'https://www.youtube.com/embed/vc7_mH2PWHs', 177, 7.7, 'Matt Reeves', 0, 80, '2025-06-03 06:03:07', '2025-06-03 06:03:07'),
(261, 'Hellhound', 'Ready to leave his profession behind, Loreno, an assassin, lends help to an old friend, Cetan, and taking one last job in Thailand seeking out a local kingpin. A lapse in judgment means Loreno crosses paths with old colleague Paul.', '2024-06-20', 'https://image.tmdb.org/t/p/w500/f9hkaCIha8hIhRo0XXShhcosrPH.jpg', 'https://www.youtube.com/embed/g01P-koF8Xw', 103, 6.6, 'Joshua Dixon', 0, 80, '2025-06-03 06:03:08', '2025-06-03 06:03:08'),
(262, 'John Wick: Chapter 3 - Parabellum', 'Super-assassin John Wick returns with a $14 million price tag on his head and an army of bounty-hunting killers on his trail. After killing a member of the shadowy international assassin’s guild, the High Table, John Wick is excommunicado, but the world’s most ruthless hit men and women await his every turn.', '2019-05-15', 'https://image.tmdb.org/t/p/w500/ziEuG1essDuWuC5lpWUaw1uXY2O.jpg', 'https://www.youtube.com/embed/pU8-7BX9uxs', 131, 7.4, 'Chad Stahelski', 0, 80, '2025-06-03 06:03:09', '2025-06-03 06:03:09'),
(263, 'The Green Mile', 'A supernatural tale set on death row in a Southern prison, where gentle giant John Coffey possesses the mysterious power to heal people\'s ailments. When the cell block\'s head guard, Paul Edgecomb, recognizes Coffey\'s miraculous gift, he tries desperately to help stave off the condemned man\'s execution.', '1999-12-10', 'https://image.tmdb.org/t/p/w500/8VG8fDNiy50H4FedGwdSVUPoaJe.jpg', 'https://www.youtube.com/embed/Bg7epsq0OIQ', 189, 8.5, 'Frank Darabont', 0, 80, '2025-06-03 06:03:10', '2025-06-03 06:03:10'),
(264, 'The Island', 'When his brother is killed, LAPD officer Mark leaves the city to return to the island he grew up on. Seeking answers and ultimately vengeance, he soon finds himself in a bloody battle with the corrupt tycoon who\'s taken over the island paradise.', '2023-07-21', 'https://image.tmdb.org/t/p/w500/ajb1rMiorchfRemYHZCkbV9DBg6.jpg', 'https://www.youtube.com/embed/vInLr1OZ_0w', 93, 6.2, 'Shaun Paul Piccinino', 0, 80, '2025-06-03 06:03:11', '2025-06-03 06:03:11'),
(265, 'Pulp Fiction', 'A burger-loving hit man, his philosophical partner, a drug-addled gangster\'s moll and a washed-up boxer converge in this sprawling, comedic crime caper. Their adventures unfurl in three stories that ingeniously trip back and forth in time.', '1994-09-10', 'https://image.tmdb.org/t/p/w500/vQWk5YBFWF4bZaofAbv0tShwBvQ.jpg', 'https://www.youtube.com/embed/tGpTpVyI_OQ', 154, 8.5, 'Quentin Tarantino', 0, 80, '2025-06-03 06:03:13', '2025-06-03 06:03:13'),
(266, 'Absolution', 'An aging ex-boxer gangster working as muscle for a Boston crime boss receives an upsetting diagnosis.  Despite a faltering memory, he attempts to rectify the sins of his past and reconnect with his estranged children. He is determined to leave a positive legacy for his grandson, but the criminal underworld isn’t done with him and won’t loosen their grip willingly.', '2024-10-31', 'https://image.tmdb.org/t/p/w500/gt70JOD9xsPlpJnuBJAWdOT4yRg.jpg', 'https://www.youtube.com/embed/m0zbtMTXZog', 112, 5.9, 'Hans Petter Moland', 0, 80, '2025-06-03 06:03:14', '2025-06-03 06:03:14'),
(267, 'Catch Me If You Can', 'A true story about Frank Abagnale Jr. who, before his 19th birthday, successfully conned millions of dollars worth of checks as a Pan Am pilot, doctor, and legal prosecutor. An FBI agent makes it his mission to put him behind bars. But Frank not only eludes capture, he revels in the pursuit.', '2002-12-16', 'https://image.tmdb.org/t/p/w500/sdYgEkKCDPWNU6KnoL4qd8xZ4w7.jpg', 'https://www.youtube.com/embed/71rDQ7z4eFg', 141, 8.0, 'Steven Spielberg', 0, 80, '2025-06-03 06:03:15', '2025-06-03 06:03:15'),
(268, 'The Equalizer', 'McCall believes he has put his mysterious past behind him and dedicated himself to beginning a new, quiet life. But when he meets Teri, a young girl under the control of ultra-violent Russian gangsters, he can’t stand idly by – he has to help her. Armed with hidden skills that allow him to serve vengeance against anyone who would brutalize the helpless, McCall comes out of his self-imposed retirement and finds his desire for justice reawakened. If someone has a problem, if the odds are stacked against them, if they have nowhere else to turn, McCall will help. He is The Equalizer.', '2014-09-24', 'https://image.tmdb.org/t/p/w500/9u4yW7yPA0BQ2pv9XwiNzItwvp8.jpg', 'https://www.youtube.com/embed/BP_FwE0Z7no', 132, 7.3, 'Antoine Fuqua', 0, 80, '2025-06-03 06:03:16', '2025-06-03 06:03:16'),
(269, 'Air Force Elite: Thunderbirds', 'The elite pilots of the Air Force Thunderbirds display exceptional skill, trust and courage during a high-stakes training season.', '2025-05-22', 'https://image.tmdb.org/t/p/w500/hsJtBhMxNDGzW5KcQ9qz3EQGnEt.jpg', 'https://www.youtube.com/embed/0-BjU97fvPM', 91, 7.1, 'Matt Wilcox', 0, 99, '2025-06-03 06:03:18', '2025-06-03 06:03:18'),
(270, 'Amazing Earth', 'Join narrator Patrick Stewart on a sweeping journey through Earth\'s fascinating history -- from the formation of ancient, geological artifacts to the modern exploration of the moon. The film is a storehouse of facts you probably didn\'t know. For instance, more than 18,000 meteorites strike Earth each year; it\'s 3,000 degrees four miles below Earth\'s surface; and Mount Everest\'s peak was once part of the ocean floor.', '1998-12-13', 'https://image.tmdb.org/t/p/w500/iO97IJRvBDpN017FcB8N5dLKbDQ.jpg', NULL, 94, 7.0, 'Brian Skilton', 0, 99, '2025-06-03 06:03:19', '2025-06-03 06:03:19'),
(271, 'Implosion: The Titanic Sub Disaster', 'A Titanic dive. A fatal implosion. Five lives lost. As the world watched, investigators raced to uncover the truth behind the disaster. But was this more than a tragic accident?', '2025-05-27', 'https://image.tmdb.org/t/p/w500/zgK9Q5lToGM69l7lVy3prwnAMU4.jpg', NULL, 90, 6.0, 'Pamela Gordon', 0, 99, '2025-06-03 06:03:20', '2025-06-03 06:03:20'),
(272, 'Making Squid Game: The Challenge', 'Go behind the scenes and witness how the \"Squid Game\"-inspired reality show transformed from a scripted drama to a cutthroat, nail-biting competition.', '2023-12-06', 'https://image.tmdb.org/t/p/w500/78yTLvtsMntVN1cLfzBuZj870pe.jpg', NULL, 30, 7.6, NULL, 0, 99, '2025-06-03 06:03:21', '2025-06-03 06:03:21'),
(273, 'Bono: Stories of Surrender', 'Through words, music, and mischief, Bono pulls back the curtain on his deeply personal experiences that have shaped him as a son, father, husband, activist, and U2 frontman.', '2025-05-16', 'https://image.tmdb.org/t/p/w500/ctofSj5nMQDtB1q9TdIQx30P3bY.jpg', 'https://www.youtube.com/embed/p6U1sDbzraE', 86, 6.4, 'Andrew Dominik', 0, 99, '2025-06-03 06:03:22', '2025-06-03 06:03:22'),
(274, 'Harry Potter 20th Anniversary: Return to Hogwarts', 'An enchanting making-of story told through all-new in-depth interviews and cast conversations, inviting fans on a magical first-person journey through one of the most beloved film franchises of all time.', '2022-01-01', 'https://image.tmdb.org/t/p/w500/jntLBq0MLR3hrwKaTQswxACRPMs.jpg', 'https://www.youtube.com/embed/fFGS4zZWGoA', 103, 7.3, 'Joe Pearlman', 0, 99, '2025-06-03 06:03:23', '2025-06-03 06:03:23'),
(275, 'TINA', 'Tina Turner overcame impossible odds to become one of the first female Black artists to reach a mainstream international audience. Her road to superstardom is an undeniable story of triumph over adversity. It’s the ultimate story of survival – and an inspirational story of our times.', '2021-08-20', 'https://image.tmdb.org/t/p/w500/g2Fm6iZr2LNwy8Nz2tY8Wgdo4vp.jpg', 'https://www.youtube.com/embed/w9IkVtLvflU', 118, 7.7, 'T.J. Martin', 0, 99, '2025-06-03 06:03:25', '2025-06-03 06:03:25'),
(276, 'Fed Up', 'Fed Up blows the lid off everything we thought we knew about food and weight loss, revealing a 30-year campaign by the food industry, aided by the U.S. government, to mislead and confuse the American public, resulting in one of the largest health epidemics in history.', '2014-05-09', 'https://image.tmdb.org/t/p/w500/qwsR5gwz6RYch4LtxtN8FdMPATC.jpg', 'https://www.youtube.com/embed/aCUbvOwwfWM', 95, 7.3, 'Stephanie Soechtig', 0, 99, '2025-06-03 06:03:28', '2025-06-03 06:03:28'),
(277, 'The Flamenco Guitar of Yerai Cortés', 'A thoughtful exploration of gypsy culture, an intimate portrait of flamenco guitar player Yerai Cortés and a healing family exorcism through music. Antón Álvarez (aka C. Tangana) makes his filmmaking debut with this documentary.', '2024-12-20', 'https://image.tmdb.org/t/p/w500/fCkUmnzlbxpMhHieiQAGQwo50hQ.jpg', 'https://www.youtube.com/embed/gs5s7g2kXJo', 95, 7.3, 'Antón Álvarez', 0, 99, '2025-06-03 06:03:30', '2025-06-03 06:03:30'),
(278, 'Chaos: The Manson Murders', 'In August 1969, Charles Manson\'s followers killed seven people on his orders. Why? Explore a conspiracy of mind control, CIA experiments, and murder.', '2025-03-06', 'https://image.tmdb.org/t/p/w500/lcWOKxTVZybE8aRUhzkKokU2s0s.jpg', 'https://www.youtube.com/embed/YwoA7NvaacI', 96, 6.0, 'Errol Morris', 0, 99, '2025-06-03 06:03:31', '2025-06-03 06:03:31'),
(279, 'X-Rated: The Greatest Adult Movies of All Time', 'The evolution of adult cinema through the most influential films in history, a journey that begins in the 1970s and ends nowadays. An in-depth analysis of the success of the most prestigious erotic films, their impact on industry and society, and their influence on cinema and contemporary culture.', '2015-02-06', 'https://image.tmdb.org/t/p/w500/1UgdqTHgwNivULiZvNcJ0Mj3skl.jpg', 'https://www.youtube.com/embed/NPXchkq_JPc', 94, 6.4, 'Eli Cross', 0, 99, '2025-06-03 06:03:33', '2025-06-03 06:03:33'),
(280, 'El Apocalipsis de san Juan', 'Embark on an epic journey through time and faith with \'The Apocalypse of Saint John.\' Join the Apostle John in a stunning visual narrative that unravels the visions of the End Times. Experience each vision like never before, with striking visual effects and epic scenes that immerse you in the apocalyptic narrative.', '2024-10-07', 'https://image.tmdb.org/t/p/w500/zzXU586n4uDBgMtVMPPQW7UJwu8.jpg', NULL, 110, 8.0, 'Patricio Dondo', 0, 99, '2025-06-03 06:03:34', '2025-06-03 06:03:34'),
(281, 'Who Is Luigi Mangione?', 'Writings and social media posts help to reveal the secret life and troubles of Luigi Mangione, the man accused of the brazen murder of United Healthcare CEO Brian Thompson and whom so many people are calling a hero.', '2025-02-17', 'https://image.tmdb.org/t/p/w500/lfGZ8tjK4HVTRjmD5X9JIKDepGC.jpg', 'https://www.youtube.com/embed/L52EzoLU_c8', 42, 6.2, 'Brian Ross', 0, 99, '2025-06-03 06:03:35', '2025-06-03 06:03:35'),
(282, 'Le Clitoris', 'Women are lucky, they get to have the only organ in the human body dedicated exclusively for pleasure: the clitoris! In this humorous and instructive animated documentary, find out its unrecognized anatomy and its unknown herstory.', '2016-06-18', 'https://image.tmdb.org/t/p/w500/p5i1yyQW6OpLfB59w7ZkX5lvBqD.jpg', 'https://www.youtube.com/embed/AAs0kYlNWdY', 4, 6.8, 'Lori Malépart-Traversy', 0, 99, '2025-06-03 06:03:36', '2025-06-03 06:03:36'),
(283, 'The Lost Children', 'After a plane crash, four indigenous children fight to survive in the Colombian Amazon using ancestral wisdom as an unprecedented rescue mission unfolds.', '2024-11-13', 'https://image.tmdb.org/t/p/w500/5Te2bKuSyVkqt0m2GdSueU4dfCZ.jpg', 'https://www.youtube.com/embed/mTmSaHTVRPo', 97, 7.4, 'Orlando von Einsiedel', 0, 99, '2025-06-03 06:03:40', '2025-06-03 06:03:40'),
(284, 'The Alcove', 'In 1936 Italy, Elio returns home from Africa with a present for his wife in the form of Zerbal, the daughter of a tribal king. Unbeknown to him, his neglected wife Alessandra has formed a relationship with Elio’s otherwise frigid secretary Velma who is less than pleased at Elio’s return.', '1985-01-21', 'https://image.tmdb.org/t/p/w500/ipFdgjiF3wsDB8NdoLxloFEeHYl.jpg', NULL, 88, 5.2, 'Joe D\'Amato', 0, 18, '2025-06-03 06:03:43', '2025-06-03 06:03:43'),
(285, 'Victoria', 'Victoria, a young beautician in a suburban beauty parlour, decides to elope with her Hindu boyfriend after a fierce clash with her conservative Catholic parents. Amidst the turmoil, a neighbour asks her to temporarily house an offering rooster destined for a festival at St. George church inside the parlour. Juggling the rooster\'s antics, unexpected clients, and her boyfriend\'s uncertainty, Victoria grapples with conflicting emotions leading to a day of intense personal and spiritual revelations.', '2024-12-14', 'https://image.tmdb.org/t/p/w500/hw09PdM2o7pF1zxn1pM8NTMPzno.jpg', NULL, 84, 5.0, 'Sivaranjini', 0, 18, '2025-06-03 06:03:45', '2025-06-03 06:03:45'),
(286, 'Hollywood Dream', 'Anya is sent under a contract to Los Angeles to work in a modeling agency. Waking up after a party, she finds a bloody knife in her hands. She is suspected of a crime, but unraveling the secrets of the young model will not be easy at all.', '2022-06-02', 'https://image.tmdb.org/t/p/w500/f1zXTHhVUvg6QlUJJCoadct1B3r.jpg', NULL, NULL, 10.0, 'Olga Land', 0, 18, '2025-06-03 06:03:47', '2025-06-03 06:03:47'),
(287, 'My Fault: London', '18-year-old Noah moves from America to London, with her mother who\'s recently fallen in love with William, a wealthy British businessman. Noah meets William’s son, bad-boy Nick, and soon discovers there is an attraction between them neither can avoid. As Noah spends the summer adjusting to her new life, her devastating past will catch up with her while falling in love for the first time.', '2025-02-12', 'https://image.tmdb.org/t/p/w500/ttN5D6GKOwKWHmCzDGctAvaNMAi.jpg', 'https://www.youtube.com/embed/14z9L_MwH5s', 118, 7.4, 'Dani Girdwood', 0, 18, '2025-06-03 06:03:48', '2025-06-03 06:03:48'),
(288, 'Titanic', '101-year-old Rose DeWitt Bukater tells the story of her life aboard the Titanic, 84 years later. A young Rose boards the ship with her mother and fiancé. Meanwhile, Jack Dawson and Fabrizio De Rossi win third-class tickets aboard the ship. Rose tells the whole story from Titanic\'s departure through to its death—on its first and last voyage—on April 15, 1912.', '1997-11-18', 'https://image.tmdb.org/t/p/w500/9xjZS2rlVxm8SFx8kPC3aIGCOYQ.jpg', 'https://www.youtube.com/embed/UFQ2AZVQ9mg', 194, 7.9, 'James Cameron', 0, 18, '2025-06-03 06:03:49', '2025-06-03 06:03:49'),
(289, 'Blade Runner 2049', 'Thirty years after the events of the first film, a new blade runner, LAPD Officer K, unearths a long-buried secret that has the potential to plunge what\'s left of society into chaos. K\'s discovery leads him on a quest to find Rick Deckard, a former LAPD blade runner who has been missing for 30 years.', '2017-10-04', 'https://image.tmdb.org/t/p/w500/gajva2L0rPYkEWjzgFlBXCAVBE5.jpg', 'https://www.youtube.com/embed/geFtxCSz8xI', 164, 7.6, 'Denis Villeneuve', 0, 18, '2025-06-03 06:03:51', '2025-06-03 06:03:51'),
(290, 'Claudia', 'Eager to escape her high-society life among the English Elite, a woman falls in love with a young musician. Her husband, however has other plans for her.', '1985-12-12', 'https://image.tmdb.org/t/p/w500/d8NYTygRU6ztSuvCdx6VoM5qQpF.jpg', NULL, 88, NULL, 'Anwar Kawadri', 0, 18, '2025-06-03 06:03:52', '2025-06-03 06:03:52'),
(291, 'Lamb', 'An Icelandic couple live with their herd of sheep on a beautiful but remote farm. When they discover a mysterious newborn on their land, they decide to keep it and raise it as their own. This unexpected development and the prospects of a new family brings them much joy before ultimately destroying them.', '2021-08-12', 'https://image.tmdb.org/t/p/w500/gP9yviboTGWGolqUZKIB1UkF1C2.jpg', 'https://www.youtube.com/embed/o7inbBuT6z8', 106, 6.4, 'Valdimar Jóhannsson', 0, 18, '2025-06-03 06:03:53', '2025-06-03 06:03:53'),
(292, 'The Heart Knows', 'After a heart transplant, Manuel feels a personality shift and explores his donor\'s life, leading him to meet the widowed Vale and her community.', '2025-05-30', 'https://image.tmdb.org/t/p/w500/vd96uk9eTTu3shHtP9rGQAfRGgm.jpg', 'https://www.youtube.com/embed/uGgpPSJY6lw', 89, 6.4, 'Marcos Carnevale', 0, 18, '2025-06-03 06:03:55', '2025-06-03 06:03:55'),
(293, 'Pleasure', '19 year old Linnéa leaves her small town in Sweden and heads for Los Angeles with the aim of becoming the world\'s next big porn star, but the road to her goal turns out to be bumpier than she imagined.', '2021-10-08', 'https://image.tmdb.org/t/p/w500/TcOsu6iO5prSJbDn9oIQgIW655.jpg', 'https://www.youtube.com/embed/knFkVoNPRHE', 108, 6.3, 'Ninja Thyberg', 0, 18, '2025-06-03 06:03:56', '2025-06-03 06:03:56'),
(294, '365 Days: This Day', 'Laura and Massimo are back and hotter than ever. But the reunited couple\'s new beginning is complicated by Massimo’s family ties and a mysterious man who enters Laura’s life to win her heart and trust, at any cost.', '2022-04-26', 'https://image.tmdb.org/t/p/w500/iLmG3HCXVyqXYbFvUO1rfOeGa3Z.jpg', 'https://www.youtube.com/embed/pyM3z73oMAk', 111, 5.9, 'Barbara Białowąs', 0, 18, '2025-06-03 06:03:57', '2025-06-03 06:03:57'),
(295, 'Apocalypse Z: The Beginning of the End', 'When a kind of rabies that transforms people into aggressive creatures spreads across the planet, Manel isolates himself at home with his cat, relying on his wits to survive; but soon they must go out in search of food, by land and by sea, dodging many dangers.', '2024-10-04', 'https://image.tmdb.org/t/p/w500/wIGJnIFQlESkC2rLpfA8EDHqk4g.jpg', 'https://www.youtube.com/embed/zeQXjn3JJ-A', 119, 6.7, 'Carles Torrens', 0, 18, '2025-06-03 06:03:59', '2025-06-03 06:03:59'),
(296, 'The Low Land', 'Carmen, a well-known writer on her fifties, has returned a year ago to a farmhouse in the small town where she was born, in Bajo Aragón (Teruel, Spain). Her vital crisis is complicated when Eduardo, a film producer with whom she had a love affair twenty years ago reappears in her life.', '2025-01-31', 'https://image.tmdb.org/t/p/w500/m28I4KLQVRmw5F4n5s7lfVdrFkk.jpg', NULL, 96, 6.0, 'Miguel Santesmases', 0, 18, '2025-06-03 06:04:00', '2025-06-03 06:04:00'),
(297, 'Wild Awakening', 'Toni and Emma are brother and sister who owns a stable farm. Ramon and his son, Aaron works for them. Toni is openly gay and loves to party, Emma has a crush on Aaron who is a closeted gay who is afraid that his father might find out, but his father also has a secret.', '2016-10-23', 'https://image.tmdb.org/t/p/w500/jD9MILmkIeBBoFJbOjHAaCQ3sEA.jpg', NULL, 105, 5.5, 'Joan Fermí Martí', 0, 18, '2025-06-03 06:04:02', '2025-06-03 06:04:02'),
(298, 'La mitad de Ana', 'Son confesses to his mother, Ana, that he does not feel like a girl; he is a boy. Confused and blocked, Ana will decide to stop in order to observe and understand him and, in the same way, to understand herself. Ana and Son are two sides of the same coin: a mother who does not take care of herself, of her own identity, and a boy in search of his identity with all his strength.', '2025-01-10', 'https://image.tmdb.org/t/p/w500/c24RWnJzwAtWZ039o9u6K7c8jyw.jpg', NULL, 95, 6.8, 'Marta Nieto', 0, 18, '2025-06-03 06:04:03', '2025-06-03 06:04:03'),
(299, 'My Favorite Martian', 'Ambitious television reporter Tim O\'Hara stumbles upon a martian whose spaceship has accidentally crashed on Earth. Thinking this is his ticket to a Pulitzer Prize, Tim makes plans to expose the martian, who, posing as Tim\'s Uncle Martin, takes human form and has plans of his own. In fact, all of Tim\'s efforts to divulge the truth are systematically thwarted by the resourceful alien, who ultimately recruits Tim to help him repair his ship for a return to Mars.', '1999-02-11', 'https://image.tmdb.org/t/p/w500/pOp4xriDEFUy2uN0BfnHJcjzqWt.jpg', 'https://www.youtube.com/embed/VXZ-b-ZB7Rw', 94, 5.6, 'Donald Petrie', 0, 10751, '2025-06-03 06:04:05', '2025-06-03 06:04:05'),
(300, 'The Karate Kid', 'New Jersey teen Daniel LaRusso moves to Los Angeles with his mother, and soon strikes up a relationship with Ali. He quickly finds himself the target of bullying by a group of thugs, led by Ali\'s ex-boyfriend Johnny, who study karate at the Cobra Kai dojo under ruthless sensei John Kreese. Fortunately, Daniel befriends Mr. Miyagi, an unassuming repairman who just happens to be a martial arts master himself. Miyagi takes Daniel under his wing, training him in a more compassionate form of karate for self-defense and, later, preparing him to compete against the brutal Cobra Kai.', '1984-06-22', 'https://image.tmdb.org/t/p/w500/1mp4ViklKvA0WXXsNvNx0RBuiit.jpg', 'https://www.youtube.com/embed/eEyhvUjCMcI', 126, 7.2, 'John G. Avildsen', 0, 10751, '2025-06-03 06:04:07', '2025-06-03 06:04:07'),
(301, 'Frozen', 'Young princess Anna of Arendelle dreams about finding true love at her sister Elsa’s coronation. Fate takes her on a dangerous journey in an attempt to end the eternal winter that has fallen over the kingdom. She\'s accompanied by ice delivery man Kristoff, his reindeer Sven, and snowman Olaf. On an adventure where she will find out what friendship, courage, family, and true love really means.', '2013-11-20', 'https://image.tmdb.org/t/p/w500/mbPrrbt8bSLcHSBCHnRclPlMZPl.jpg', 'https://www.youtube.com/embed/TbQm5doF_Uc', 102, 7.2, 'Chris Buck', 0, 10751, '2025-06-03 06:04:08', '2025-06-03 06:04:08'),
(302, 'Cinderella', 'When her father unexpectedly passes away, young Ella finds herself at the mercy of her cruel stepmother and her daughters. Never one to give up hope, Ella\'s fortunes begin to change after meeting a dashing stranger in the woods.', '2015-03-06', 'https://image.tmdb.org/t/p/w500/j91LJmcWo16CArFOoapsz84bwxb.jpg', 'https://www.youtube.com/embed/n44EWI92Tc8', 105, 6.8, 'Kenneth Branagh', 0, 10751, '2025-06-03 06:04:09', '2025-06-03 06:04:09'),
(303, 'Ratatouille', 'Remy, a resident of Paris, appreciates good food and has quite a sophisticated palate. He would love to become a chef so he can create and enjoy culinary masterpieces to his heart\'s delight. The only problem is, Remy is a rat. When he winds up in the sewer beneath one of Paris\' finest restaurants, the rodent gourmet finds himself ideally placed to realize his dream.', '2007-06-28', 'https://image.tmdb.org/t/p/w500/t3vaWRPSf6WjDSamIkKDs1iQWna.jpg', 'https://www.youtube.com/embed/NgsQ8mVkN8w', 111, 7.8, 'Brad Bird', 0, 10751, '2025-06-03 06:04:10', '2025-06-03 06:04:10'),
(304, 'Elemental', 'In a city where fire, water, land and air residents live together, a fiery young woman and a go-with-the-flow guy will discover something elemental: how much they have in common.', '2023-06-14', 'https://image.tmdb.org/t/p/w500/4Y1WNkd88JXmGfhtWR7dmDAo1T2.jpg', 'https://www.youtube.com/embed/hXzcyx9V0xw', 102, 7.6, 'Peter Sohn', 0, 10751, '2025-06-03 06:04:11', '2025-06-03 06:04:11'),
(305, 'Maleficent', 'A beautiful, pure-hearted young woman, Maleficent has an idyllic life growing up in a peaceable forest kingdom, until one day when an invading army threatens the harmony of the land. She rises to be the land\'s fiercest protector, but she ultimately suffers a ruthless betrayal – an act that begins to turn her heart into stone. Bent on revenge, Maleficent faces an epic battle with the invading King\'s successor and, as a result, places a curse upon his newborn infant Aurora. As the child grows, Maleficent realizes that Aurora holds the key to peace in the kingdom – and to Maleficent\'s true happiness as well.', '2014-05-28', 'https://image.tmdb.org/t/p/w500/bDG3yei6AJlEAK3A5wN7RwFXQ7V.jpg', 'https://www.youtube.com/embed/LaArkjF7AnM', 97, 7.1, 'Robert Stromberg', 0, 10751, '2025-06-03 06:04:13', '2025-06-03 06:04:13'),
(306, 'IF', 'After discovering she can see everyone\'s imaginary friends, a girl embarks on a magical adventure to reconnect forgotten imaginary friends with their kids.', '2024-05-08', 'https://image.tmdb.org/t/p/w500/xbKFv4KF3sVYuWKllLlwWDmuZP7.jpg', 'https://www.youtube.com/embed/TP47e3-nmw8', 104, 7.1, 'John Krasinski', 0, 10751, '2025-06-03 06:04:14', '2025-06-03 06:04:14'),
(307, 'Kung Fu Panda', 'When the Valley of Peace is threatened, lazy Po the panda discovers his destiny as the \"chosen one\" and trains to become a kung fu hero, but transforming the unsleek slacker into a brave warrior won\'t be easy. It\'s up to Master Shifu and the Furious Five -- Tigress, Crane, Mantis, Viper and Monkey -- to give it a try.', '2008-06-04', 'https://image.tmdb.org/t/p/w500/wWt4JYXTg5Wr3xBW2phBrMKgp3x.jpg', 'https://www.youtube.com/embed/TD0YUZw_oHY', 90, 7.3, 'Mark Osborne', 0, 10751, '2025-06-03 06:04:15', '2025-06-03 06:04:15'),
(308, 'The Family Plan', 'Dan Morgan is many things: a devoted husband, a loving father, a celebrated car salesman. He\'s also a former assassin. And when his past catches up to his present, he\'s forced to take his unsuspecting family on a road trip unlike any other.', '2023-12-14', 'https://image.tmdb.org/t/p/w500/jLLtx3nTRSLGPAKl4RoIv1FbEBr.jpg', 'https://www.youtube.com/embed/ns8weNznn1Y', 118, 7.3, 'Simon Cellan Jones', 0, 10751, '2025-06-03 06:04:17', '2025-06-03 06:04:17'),
(309, 'Shrek 2', 'Shrek, Fiona, and Donkey set off to Far, Far Away to meet Fiona\'s mother and father, the Queen and King. But not everyone is happily ever after. Shrek and the King find it difficult to get along, and there\'s tension in the marriage. The Fairy Godmother discovers that Fiona has married Shrek instead of her son Prince Charming and plots to destroy their marriage.', '2004-05-19', 'https://image.tmdb.org/t/p/w500/2yYP0PQjG8zVqturh1BAqu2Tixl.jpg', 'https://www.youtube.com/embed/xBgSfhp5Fxo', 92, 7.3, 'Conrad Vernon', 0, 10751, '2025-06-03 06:04:18', '2025-06-03 06:04:18'),
(310, 'Beauty and the Beast', 'A live-action adaptation of Disney\'s version of the classic tale of a cursed prince and a beautiful young woman who helps him break the spell.', '2017-03-16', 'https://image.tmdb.org/t/p/w500/hKegSKIDep2ewJWPUQD7u0KqFIp.jpg', NULL, 129, 7.0, 'Bill Condon', 0, 10751, '2025-06-03 06:04:19', '2025-06-03 06:04:19'),
(311, 'Finding Nemo', 'Nemo, an adventurous young clownfish, is unexpectedly taken from his Great Barrier Reef home to a dentist\'s office aquarium. It\'s up to his worrisome father Marlin and a friendly but forgetful fish Dory to bring Nemo home -- meeting vegetarian sharks, surfer dude turtles, hypnotic jellyfish, hungry seagulls, and more along the way.', '2003-05-30', 'https://image.tmdb.org/t/p/w500/eHuGQ10FUzK1mdOY69wF5pGgEf5.jpg', 'https://www.youtube.com/embed/ZS_8btMjx2U', 100, 7.8, 'Andrew Stanton', 0, 10751, '2025-06-03 06:04:21', '2025-06-03 06:04:21'),
(312, 'Wonka', 'Willy Wonka – chock-full of ideas and determined to change the world one delectable bite at a time – is proof that the best things in life begin with a dream, and if you’re lucky enough to meet Willy Wonka, anything is possible.', '2023-12-06', 'https://image.tmdb.org/t/p/w500/qhb1qOilapbapxWQn9jtRCMwXJF.jpg', 'https://www.youtube.com/embed/wYmtRhKvmVE', 117, 7.1, 'Paul King', 0, 10751, '2025-06-03 06:04:22', '2025-06-03 06:04:22'),
(313, 'Up', 'Carl Fredricksen spent his entire life dreaming of exploring the globe and experiencing life to its fullest. But at age 78, life seems to have passed him by, until a twist of fate (and a persistent 8-year old Wilderness Explorer named Russell) gives him a new lease on life.', '2009-05-28', 'https://image.tmdb.org/t/p/w500/mFvoEwSfLqbcWwFsDjQebn9bzFe.jpg', 'https://www.youtube.com/embed/AkdXuDAP2Ts', 96, 8.0, 'Pete Docter', 0, 10751, '2025-06-03 06:04:23', '2025-06-03 06:04:23'),
(314, 'Harry Potter and the Goblet of Fire', 'When Harry Potter\'s name emerges from the Goblet of Fire, he becomes a competitor in a grueling battle for glory among three wizarding schools—the Triwizard Tournament. But since Harry never submitted his name for the Tournament, who did? Now Harry must confront a deadly dragon, fierce water demons and an enchanted maze only to find himself in the cruel grasp of He Who Must Not Be Named.', '2005-11-16', 'https://image.tmdb.org/t/p/w500/fECBtHlr0RB3foNHDiCBXeg9Bv9.jpg', 'https://www.youtube.com/embed/4xkFJgcCQRE', 157, 7.8, 'Mike Newell', 0, 14, '2025-06-03 06:04:25', '2025-06-03 06:04:25'),
(315, 'Oshi no Ko -The Final Act-', 'Goro is a gynecologist and idol fan who’s in shock after his favorite star, Ai, announces an impromptu hiatus. Little does Goro realize that he’s about to forge a bond with her that defies all common sense! Lies are an idol’s weapon!', '2024-12-20', 'https://image.tmdb.org/t/p/w500/zEHdxq1cFaR7cC4AnGeeAG18FeT.jpg', 'https://www.youtube.com/embed/YOiA-uuaQ28', 129, 6.7, 'Smith', 0, 14, '2025-06-03 06:04:26', '2025-06-03 06:04:26'),
(316, 'Doctor Strange in the Multiverse of Madness', 'Doctor Strange, with the help of mystical allies both old and new, traverses the mind-bending and dangerous alternate realities of the Multiverse to confront a mysterious new adversary.', '2022-05-04', 'https://image.tmdb.org/t/p/w500/ddJcSKbcp4rKZTmuyWaMhuwcfMz.jpg', 'https://www.youtube.com/embed/Rf8LAYJSOL8', 126, 7.3, 'Sam Raimi', 0, 14, '2025-06-03 06:04:28', '2025-06-03 06:04:28'),
(317, 'Pirates of the Caribbean: The Curse of the Black Pearl', 'After Port Royal is attacked and pillaged by a mysterious pirate crew, capturing the governor\'s daughter Elizabeth Swann in the process, William Turner asks free-willing pirate Jack Sparrow to help him locate the crew\'s ship—The Black Pearl—so that he can rescue the woman he loves.', '2003-07-09', 'https://image.tmdb.org/t/p/w500/z8onk7LV9Mmw6zKz4hT6pzzvmvl.jpg', 'https://www.youtube.com/embed/-9HT0l9HV4c', 143, 7.8, 'Gore Verbinski', 0, 14, '2025-06-03 06:04:29', '2025-06-03 06:04:29'),
(318, 'Harry Potter and the Half-Blood Prince', 'As Lord Voldemort tightens his grip on both the Muggle and wizarding worlds, Hogwarts is no longer a safe haven. Harry suspects perils may even lie within the castle, but Dumbledore is more intent upon preparing him for the final battle fast approaching. Together they work to find the key to unlock Voldemorts defenses and to this end, Dumbledore recruits his old friend and colleague Horace Slughorn, whom he believes holds crucial information. Even as the decisive showdown looms, romance blossoms for Harry, Ron, Hermione and their classmates. Love is in the air, but danger lies ahead and Hogwarts may never be the same again.', '2009-07-15', 'https://image.tmdb.org/t/p/w500/z7uo9zmQdQwU5ZJHFpv2Upl30i1.jpg', 'https://www.youtube.com/embed/DgeDDXcw--I', 153, 7.7, 'David Yates', 0, 14, '2025-06-03 06:04:30', '2025-06-03 06:04:30'),
(319, 'The Neverending Wedding', 'When carefree Paul and reluctant maid of honor Louna have a chance encounter at a Moroccan wedding, things get complicated when they find themselves unable to escape the venue, themselves, or each other.', '2025-05-30', 'https://image.tmdb.org/t/p/w500/uvygZlicNXBIpklnLuAbgwkMMSL.jpg', NULL, 81, 5.0, 'Patrick Cassir', 0, 14, '2025-06-03 06:04:32', '2025-06-03 06:04:32'),
(320, 'Harry Potter and the Deathly Hallows: Part 2', 'Harry, Ron and Hermione continue their quest to vanquish the evil Voldemort once and for all. Just as things begin to look hopeless for the young wizards, Harry discovers a trio of magical objects that endow him with powers to rival Voldemort\'s formidable skills.', '2011-07-12', 'https://image.tmdb.org/t/p/w500/c54HpQmuwXjHq2C9wmoACjxoom3.jpg', 'https://www.youtube.com/embed/5NYt1qirBWg', 130, 8.1, 'David Yates', 0, 14, '2025-06-03 06:04:34', '2025-06-03 06:04:34'),
(321, 'Harry Potter and the Order of the Phoenix', 'Returning for his fifth year of study at Hogwarts, Harry is stunned to find that his warnings about the return of Lord Voldemort have been ignored. Left with no choice, Harry takes matters into his own hands, training a small group of students to defend themselves against the dark arts.', '2007-07-08', 'https://image.tmdb.org/t/p/w500/5aOyriWkPec0zUDxmHFP9qMmBaj.jpg', 'https://www.youtube.com/embed/47PHbQTmw5g', 138, 7.7, 'David Yates', 0, 14, '2025-06-03 06:04:35', '2025-06-03 06:04:35'),
(322, 'The Lord of the Rings: The Return of the King', 'As armies mass for a final battle that will decide the fate of the world--and powerful, ancient forces of Light and Dark compete to determine the outcome--one member of the Fellowship of the Ring is revealed as the noble heir to the throne of the Kings of Men. Yet, the sole hope for triumph over evil lies with a brave hobbit, Frodo, who, accompanied by his loyal friend Sam and the hideous, wretched Gollum, ventures deep into the very dark heart of Mordor on his seemingly impossible quest to destroy the Ring of Power.​', '2003-12-17', 'https://image.tmdb.org/t/p/w500/rCzpDGLbOoPwLjy3OAm5NUPOTrC.jpg', 'https://www.youtube.com/embed/zckJCxYxn1g', 201, 8.5, 'Peter Jackson', 0, 14, '2025-06-03 06:04:37', '2025-06-03 06:04:37'),
(323, 'The Hobbit: The Battle of the Five Armies', 'Following Smaug\'s attack on Laketown, Bilbo and the dwarves try to defend Erebor\'s mountain of treasure from others who claim it: the men of the ruined Laketown and the elves of Mirkwood. Meanwhile an army of Orcs led by Azog the Defiler is marching on Erebor, fueled by the rise of the dark lord Sauron. Dwarves, elves and men must unite, and the hope for Middle-Earth falls into Bilbo\'s hands.', '2014-12-10', 'https://image.tmdb.org/t/p/w500/xT98tLqatZPQApyRmlPL12LtiWp.jpg', 'https://www.youtube.com/embed/Y6Fv5StfAxA', 144, 7.3, 'Peter Jackson', 0, 14, '2025-06-03 06:04:38', '2025-06-03 06:04:38'),
(324, 'Harry Potter and the Deathly Hallows: Part 1', 'Harry, Ron and Hermione walk away from their last year at Hogwarts to find and destroy the remaining Horcruxes, putting an end to Voldemort\'s bid for immortality. But with Harry\'s beloved Dumbledore dead and Voldemort\'s unscrupulous Death Eaters on the loose, the world is more dangerous than ever.', '2010-11-17', 'https://image.tmdb.org/t/p/w500/iGoXIpQb7Pot00EEdwpwPajheZ5.jpg', 'https://www.youtube.com/embed/MxqsmsA8y5k', 146, 7.7, 'David Yates', 0, 14, '2025-06-03 06:04:39', '2025-06-03 06:04:39'),
(325, 'Aquaman and the Lost Kingdom', 'Black Manta seeks revenge on Aquaman for his father\'s death. Wielding the Black Trident\'s power, he becomes a formidable foe. To defend Atlantis, Arthur (Aquaman) forges an alliance with his imprisoned brother. They must protect the kingdom.', '2023-12-20', 'https://image.tmdb.org/t/p/w500/jcA2QFJ4wuFcG79P97wA7OBLQoL.jpg', 'https://www.youtube.com/embed/4cSkHPW-MPE', 124, 6.6, 'James Wan', 0, 14, '2025-06-03 06:04:41', '2025-06-03 06:04:41'),
(326, 'Pirates of the Caribbean: Dead Man\'s Chest', 'Captain Jack Sparrow races to recover the heart of Davy Jones to avoid enslaving his soul to Jones\' service, as other friends and foes seek the heart for their own agenda as well.', '2006-07-06', 'https://image.tmdb.org/t/p/w500/lAhcKRt0ggTFkeFL95jrGQYaRXs.jpg', 'https://www.youtube.com/embed/9SFWn9taQTw', 151, 7.4, 'Gore Verbinski', 0, 14, '2025-06-03 06:04:42', '2025-06-03 06:04:42'),
(327, 'Pirates of the Caribbean: On Stranger Tides', 'Captain Jack Sparrow crosses paths with a woman from his past, and he\'s not sure if it\'s love — or if she\'s a ruthless con artist who\'s using him to find the fabled Fountain of Youth. When she forces him aboard the Queen Anne\'s Revenge, the ship of the formidable pirate Blackbeard, Jack finds himself on an unexpected adventure in which he doesn\'t know who to fear more: Blackbeard or the woman from his past.', '2011-05-15', 'https://image.tmdb.org/t/p/w500/keGfSvCmYj7CvdRx36OdVrAEibE.jpg', 'https://www.youtube.com/embed/0BXCVe8Yww4', 136, 6.6, 'Rob Marshall', 0, 14, '2025-06-03 06:04:43', '2025-06-03 06:04:43'),
(328, 'Shang-Chi and the Legend of the Ten Rings', 'Shang-Chi must confront the past he thought he left behind when he is drawn into the web of the mysterious Ten Rings organization.', '2021-09-01', 'https://image.tmdb.org/t/p/w500/d08HqqeBQSwN8i8MEvpsZ8Cb438.jpg', 'https://www.youtube.com/embed/8YjFbMbfXaQ', 132, 7.5, 'Destin Daniel Cretton', 0, 14, '2025-06-03 06:04:44', '2025-06-03 06:04:44'),
(329, 'Waves', 'At the end of the 1960s, when the air is filled with rock-and-roll and student rebellions are changing the world, the older of two brothers joins a prestigious newsroom of the public radio broadcaster. Not long after, he finds himself in the middle of a dangerous conflict between journalists and the secret service.', '2024-08-01', 'https://image.tmdb.org/t/p/w500/sXxvWOBdWDJwWXmX4nKgQsWLLKC.jpg', 'https://www.youtube.com/embed/pxSeWimkAOI', 131, 7.6, 'Jiří Mádl', 0, 36, '2025-06-03 06:04:46', '2025-06-03 06:04:46'),
(330, 'Spartacus', 'The rebellious Thracian Spartacus, born and raised a slave, is sold to Gladiator trainer Batiatus. After weeks of being trained to kill for the arena, Spartacus turns on his owners and leads the other slaves in rebellion. As the rebels move from town to town, their numbers swell as escaped slaves join their ranks. Under the leadership of Spartacus, they make their way to southern Italy, where they will cross the sea and return to their homes.', '1960-10-13', 'https://image.tmdb.org/t/p/w500/xLPpQlFWE12cbqNJQ5Vf4eJU8ij.jpg', 'https://www.youtube.com/embed/HcIMY1Ah3aw', 197, 7.5, 'Stanley Kubrick', 0, 36, '2025-06-03 06:04:47', '2025-06-03 06:04:47'),
(331, 'Amadeus', 'Disciplined Italian composer Antonio Salieri becomes consumed by jealousy and resentment towards the hedonistic and remarkably talented young Viennese composer Wolfgang Amadeus Mozart.', '1984-09-19', 'https://image.tmdb.org/t/p/w500/1n5VUlCqgmVax1adxGZm8oCFaKc.jpg', 'https://www.youtube.com/embed/ZQV9yySOmhs', 160, 8.0, 'Miloš Forman', 0, 36, '2025-06-03 06:04:49', '2025-06-03 06:04:49'),
(332, 'Sa Bang-ji', 'Sa Bangji was an intersex person who according to historical records lived during Korea’s Joseon Dynasty. Taken in by a kindly benefactor, Sa Bangji lives in a monastery that is one day visited by a young widow, Lee So-sa, who is in mourning following the death of her husband. The pair’s meeting seems predestined, with the erotic attraction between Sa Bangji and Lee So-sa soon evolving into something far more transcendent – and dangerous.  While aspects of the film – its stylised depiction of female actors and sex – identify it as a product of its time, Sa Bangji is undeniably a milestone in screen representations of intersex people, a film that refuses to shy away from the horrendous stigmatization faced by its titular character.', '1988-10-29', 'https://image.tmdb.org/t/p/w500/uFsTrW5qzU2l3YE0ataLoUgfsjJ.jpg', NULL, 94, 6.0, 'Song Gyeong-sik', 0, 36, '2025-06-03 06:04:50', '2025-06-03 06:04:50'),
(333, 'Apocalypto', 'Set in the Mayan civilization, when a man\'s idyllic presence is brutally disrupted by a violent invading force, he is taken on a perilous journey to a world ruled by fear and oppression where a harrowing end awaits him. Through a twist of fate and spurred by the power of his love for his woman and his family he will make a desperate break to return home and to ultimately save his way of life.', '2006-12-07', 'https://image.tmdb.org/t/p/w500/cRY25Q32kDNPFDkFkxAs6bgCq3L.jpg', 'https://www.youtube.com/embed/ngWBddVNVZs', 139, 7.6, 'Mel Gibson', 0, 36, '2025-06-03 06:04:51', '2025-06-03 06:04:51'),
(334, 'Black Hawk Down', 'When U.S. Rangers and an elite Delta Force team attempt to kidnap two underlings of a Somali warlord, their Black Hawk helicopters are shot down, and the Americans suffer heavy casualties, facing intense fighting from the militia on the ground.', '2001-12-28', 'https://image.tmdb.org/t/p/w500/imGygQbmuc7gC1JZiAVhJLsUWXq.jpg', 'https://www.youtube.com/embed/V1UV3Vj4z0w', 145, 7.4, 'Ridley Scott', 0, 36, '2025-06-03 06:04:53', '2025-06-03 06:04:53'),
(335, 'All Quiet on the Western Front', 'Paul Baumer and his friends Albert and Muller, egged on by romantic dreams of heroism, voluntarily enlist in the German army. Full of excitement and patriotic fervour, the boys enthusiastically march into a war they believe in. But once on the Western Front, they discover the soul-destroying horror of World War I.', '2022-10-07', 'https://image.tmdb.org/t/p/w500/2IRjbi9cADuDMKmHdLK7LaqQDKA.jpg', 'https://www.youtube.com/embed/hf8EYbVxtCY', 147, 7.7, 'Edward Berger', 0, 36, '2025-06-03 06:04:55', '2025-06-03 06:04:55'),
(336, 'The Imitation Game', 'Based on the real life story of legendary cryptanalyst Alan Turing, the film portrays the nail-biting race against time by Turing and his brilliant team of code-breakers at Britain\'s top-secret Government Code and Cypher School at Bletchley Park, during the darkest days of World War II.', '2014-11-14', 'https://image.tmdb.org/t/p/w500/zSqJ1qFq8NXFfi7JeIYMlzyR0dx.jpg', 'https://www.youtube.com/embed/j2jRs4EAvWM', 113, 8.0, 'Morten Tyldum', 0, 36, '2025-06-03 06:04:56', '2025-06-03 06:04:56');
INSERT INTO `movies` (`id`, `title`, `description`, `release_date`, `poster_url`, `trailer_url`, `duration`, `imdb_rating`, `director`, `views`, `genre_id`, `created_at`, `updated_at`) VALUES
(337, 'Ford v Ferrari', 'American car designer Carroll Shelby and the British-born driver Ken Miles work together to battle corporate interference, the laws of physics, and their own personal demons to build a revolutionary race car for Ford Motor Company and take on the dominating race cars of Enzo Ferrari at the 24 Hours of Le Mans in France in 1966.', '2019-11-13', 'https://image.tmdb.org/t/p/w500/dR1Ju50iudrOh3YgfwkAU1g2HZe.jpg', 'https://www.youtube.com/embed/I3h9Z89U9ZA', 153, 8.0, 'James Mangold', 0, 36, '2025-06-03 06:04:57', '2025-06-03 06:04:57'),
(338, 'The Founder', 'The true story of how Ray Kroc, a salesman from Illinois, met Mac and Dick McDonald, who were running a burger operation in 1950s Southern California. Kroc was impressed by the brothers’ speedy system of making the food and saw franchise potential. He maneuvered himself into a position to be able to pull the company from the brothers and create a billion-dollar empire.', '2016-11-24', 'https://image.tmdb.org/t/p/w500/8gLIksu5ggdfBL1UbeTeonHquxl.jpg', 'https://www.youtube.com/embed/oprJX5BomEc', 115, 7.1, 'John Lee Hancock', 0, 36, '2025-06-03 06:04:58', '2025-06-03 06:04:58'),
(339, 'Peacemaker Kurogane: Belief', 'Although traumatized by witnessing the murder of his parents by one of the Choushuu, Ichimura Tetsunosuke\'s thirst for revenge leads him to desire strength. At the age of 15, Tetsunosuke approached the Shinsengumi, wanting to become one of its members. However, Tetsunosuke lacked the skill, mind, and will to emotionlessly cut down whoever threatened peace and the Shinsengumi. Even with the support of his brother Tatsunosuke and his newfound friends of the Shinsengumi, little did Tetsunosuke know the blood and pain he would have to face being part of this historical group.', '2018-06-02', 'https://image.tmdb.org/t/p/w500/wbyIM5s7ZgwOmXycjBttBhhXtTq.jpg', NULL, 109, 5.1, 'Shigeru Kimiya', 0, 36, '2025-06-03 06:05:00', '2025-06-03 06:05:00'),
(340, '1917', 'At the height of the First World War, two young British soldiers must cross enemy territory and deliver a message that will stop a deadly attack on hundreds of soldiers.', '2019-12-25', 'https://image.tmdb.org/t/p/w500/iZf0KyrE25z1sage4SYFLCCrMi9.jpg', 'https://www.youtube.com/embed/gZjQROMAh_s', 119, 8.0, 'Sam Mendes', 0, 36, '2025-06-03 06:05:01', '2025-06-03 06:05:01'),
(341, 'The Boy in the Striped Pyjamas', 'When his family moves from their home in Berlin to a strange new house in Poland, young Bruno befriends Shmuel, a boy who lives on the other side of the fence where everyone seems to be wearing striped pajamas. Unaware of Shmuel\'s fate as a Jewish prisoner or the role his own Nazi father plays in his imprisonment, Bruno embarks on a dangerous journey inside the camp\'s walls.', '2008-05-07', 'https://image.tmdb.org/t/p/w500/sLwYSEVVV3r047cjrpRAbGgNsfL.jpg', 'https://www.youtube.com/embed/uwysOfnX2Qg', 94, 7.8, 'Mark Herman', 0, 36, '2025-06-03 06:05:03', '2025-06-03 06:05:03'),
(342, 'Apollo 13', 'The true story of technical troubles that scuttle the Apollo 13 lunar mission in 1970, risking the lives of astronaut Jim Lovell and his crew, with the failed journey turning into a thrilling saga of heroism. Drifting more than 200,000 miles from Earth, the astronauts work furiously with the ground crew to avert tragedy.', '1995-06-30', 'https://image.tmdb.org/t/p/w500/oYUZHYMwNKnE1ef4WE5Hw2a9OAY.jpg', 'https://www.youtube.com/embed/s6J6x9DojNg', 140, 7.4, 'Ron Howard', 0, 36, '2025-06-03 06:05:04', '2025-06-03 06:05:04'),
(343, 'The Irishman', 'Pennsylvania, 1956. Frank Sheeran, a war veteran of Irish origin who works as a truck driver, accidentally meets mobster Russell Bufalino. Once Frank becomes his trusted man, Bufalino sends him to Chicago with the task of helping Jimmy Hoffa, a powerful union leader related to organized crime, with whom Frank will maintain a close friendship for nearly twenty years.', '2019-11-01', 'https://image.tmdb.org/t/p/w500/mbm8k3GFhXS0ROd9AD1gqYbIFbM.jpg', 'https://www.youtube.com/embed/RS3aHkkfuEI', 209, 7.6, 'Martin Scorsese', 0, 36, '2025-06-03 06:05:06', '2025-06-03 06:05:06'),
(344, 'Sinners', 'Trying to leave their troubled lives behind, twin brothers return to their hometown to start again, only to discover that an even greater evil is waiting to welcome them back.', '2025-04-16', 'https://image.tmdb.org/t/p/w500/yqsCU5XOP2mkbFamzAqbqntmfav.jpg', 'https://www.youtube.com/embed/O98jSd24lmA', 138, 7.5, 'Ryan Coogler', 0, 27, '2025-06-06 14:27:18', '2025-06-06 14:27:18'),
(345, 'Final Destination Bloodlines', 'Plagued by a violent recurring nightmare, college student Stefanie heads home to track down the one person who might be able to break the cycle and save her family from the grisly demise that inevitably awaits them all.', '2025-05-14', 'https://image.tmdb.org/t/p/w500/6WxhEvFsauuACfv8HyoVX6mZKFj.jpg', 'https://www.youtube.com/embed/xitSoRbHJ50', 110, 7.0, 'Adam B. Stein', 0, 27, '2025-06-06 14:27:19', '2025-06-06 14:27:19'),
(346, 'The Containment', 'A girl is possessed by a dark and mysterious entity. She will fight with all the elements at her disposal to get rid of it. Neither her mother, nor traditional medicine, nor a supposed expert in exorcisms, will be able to make the demon disappear, until a nun gets involved in the case and sows a doubt more terrible than the possession itself.', '2025-06-05', 'https://image.tmdb.org/t/p/w500/nHNwBOccmQ7rK9yQI1HUSnHm1Ny.jpg', 'https://www.youtube.com/embed/-m0ezRalv_g', 88, 7.7, 'Jack Zagha Kababie', 0, 27, '2025-06-06 14:27:20', '2025-06-06 14:27:20'),
(347, 'Until Dawn', 'One year after her sister Melanie mysteriously disappeared, Clover and her friends head into the remote valley where she vanished in search of answers. Exploring an abandoned visitor center, they find themselves stalked by a masked killer and horrifically murdered one by one...only to wake up and find themselves back at the beginning of the same evening.', '2025-04-23', 'https://image.tmdb.org/t/p/w500/juA4IWO52Fecx8lhAsxmDgy3M3.jpg', 'https://www.youtube.com/embed/xR3lVHnh0Gg', 103, 6.5, 'David F. Sandberg', 0, 27, '2025-06-06 14:27:20', '2025-06-06 14:27:20'),
(348, 'Párvulos: Children of the Apocalypse', 'In a dystopian future ravaged by a viral apocalypse, three young brothers—Salvador, Oliver, and Benjamin—find themselves isolated in a remote cabin deep within the woods. As they navigate this desolate world, they harbor a dark and disturbing secret in their basement, a presence they must feed to ensure their own survival.', '2024-10-18', 'https://image.tmdb.org/t/p/w500/pHehmoG3gbTb5RsKWOdxqLmnhpD.jpg', 'https://www.youtube.com/embed/mVLk9eTqwUw', 120, 6.5, 'Isaac Ezban', 0, 27, '2025-06-06 14:27:21', '2025-06-06 14:27:21'),
(349, 'Fear Below', 'A rag-tag team of divers attempting to salvage a sunken car from a river are thwarted by a highly aggressive bull shark.', '2025-05-02', 'https://image.tmdb.org/t/p/w500/24uJJJSRYwxHfNAqVCUmqjtmXgz.jpg', 'https://www.youtube.com/embed/-OnUk2ITg_w', 85, 6.4, 'Matthew Holmes', 0, 27, '2025-06-06 14:27:22', '2025-06-06 14:27:22'),
(350, 'Ready or Not', 'A young bride\'s wedding night turns into her worst nightmare when her ridiculously rich in-laws force her to play a gruesome game of hide-and-seek.', '2019-08-21', 'https://image.tmdb.org/t/p/w500/oJD9KQFoObZmxAS1je56SIFVNJt.jpg', 'https://www.youtube.com/embed/ZtYTwUxhAoI', 95, 7.0, 'Tyler Gillett', 0, 27, '2025-06-06 14:27:23', '2025-06-06 14:27:23'),
(351, 'Fear Street: Prom Queen', 'Who will be voted queen at Shadyside High\'s 1988 prom? For underdog Lori, competition is cutthroat even before someone starts killing off the candidates.', '2025-05-23', 'https://image.tmdb.org/t/p/w500/gevScWYkF8l5i9NjFSXo8HfPNyy.jpg', 'https://www.youtube.com/embed/gYbnjaK5nsI', 90, 5.4, 'Matt Palmer', 0, 27, '2025-06-06 14:27:24', '2025-06-06 14:27:24'),
(352, 'Rosario', 'Wall Street stockbroker Rosario Fuentes returns to her grandmother\'s apartment after her sudden death. While sorting through her belongings, Rosario discovers a hidden chamber that\'s filled with occult artifacts tied to dark generational rituals. As supernatural occurrences begin to plague her, she must confront her family\'s buried secrets and face the truth about the sacrifices and choices they made.', '2025-05-01', 'https://image.tmdb.org/t/p/w500/beLZhuHT97849WkWgty2X1hkWUa.jpg', 'https://www.youtube.com/embed/gHalJwAHJC8', 88, 5.2, 'Felipe Vargas', 0, 27, '2025-06-06 14:27:25', '2025-06-06 14:27:25'),
(353, 'Abduct', 'A woman\'s peaceful mountain getaway takes a bizarre turn when her boyfriend disappears, and a random naked man shows up claiming to be him.', '2025-04-02', 'https://image.tmdb.org/t/p/w500/ls2JG1vDzmeHmiDHUt1eKwRVKTL.jpg', 'https://www.youtube.com/embed/5DcOf6FRRB8', 70, 5.2, 'Chris Riggi', 0, 27, '2025-06-06 14:27:26', '2025-06-06 14:27:26'),
(354, 'Infinity Pool', 'While staying at an isolated island resort, James and Em are enjoying a perfect vacation of pristine beaches, exceptional staff, and soaking up the sun. But guided by the seductive and mysterious Gabi, they venture outside the resort grounds and find themselves in a culture filled with violence, hedonism, and untold horror. A tragic accident leaves them facing a zero tolerance policy for crime: either you\'ll be executed, or, if you’re rich enough to afford it, you can watch yourself die instead.', '2023-01-27', 'https://image.tmdb.org/t/p/w500/cQKyNm0Nz6KWiDBQF9w4aZAmOfC.jpg', 'https://www.youtube.com/embed/W5mfHz-5dx8', 118, 6.1, 'Brandon Cronenberg', 0, 27, '2025-06-06 14:27:27', '2025-06-06 14:27:27'),
(355, 'The Haunting at Saint Joseph\'s', 'An engaged Muslim doctor, her fiancé, and their friends go on a holiday at St. Joseph’s Guesthouse, unaware that it was the site of a sacrifice of an innocent centuries before. They soon come to believe that it\'s haunted and causing them to go crazy, as their emotions spiral out of control.', '2023-02-26', 'https://image.tmdb.org/t/p/w500/eDzQFxs0KTzHUPkIR0c44TSGJUR.jpg', 'https://www.youtube.com/embed/HsxrWHJC4Q0', 100, 4.5, 'Jon Cohen', 0, 27, '2025-06-06 14:27:28', '2025-06-06 14:27:28'),
(356, 'Final Destination', 'After a teenager has a terrifying vision of him and his friends dying in a plane crash, he prevents the accident only to have Death hunt them down, one by one.', '2000-03-17', 'https://image.tmdb.org/t/p/w500/1mXhlQMnlfvJ2frxTjZSQNnA9Vp.jpg', 'https://www.youtube.com/embed/9ag5hfs9wKM', 98, 6.6, 'James Wong', 0, 27, '2025-06-06 14:27:29', '2025-06-06 14:27:29'),
(357, 'Final Destination 5', 'Death is just as omnipresent as ever, and is unleashed after one man’s premonition saves a group of coworkers from a terrifying suspension bridge collapse. But this group of unsuspecting souls was never supposed to survive, and, in a terrifying race against time, the ill-fated group frantically tries to discover a way to escape Death’s sinister agenda.', '2011-08-12', 'https://image.tmdb.org/t/p/w500/5uRF7zATPr0hIMfDcMEfnhMGw6a.jpg', 'https://www.youtube.com/embed/PI87-0g_SI8', 91, 6.1, 'Steven Quale', 0, 27, '2025-06-06 14:27:30', '2025-06-06 14:27:30'),
(358, 'The Substance', 'A fading celebrity decides to use a black market drug, a cell-replicating substance that temporarily creates a younger, better version of herself.', '2024-09-07', 'https://image.tmdb.org/t/p/w500/lqoMzCcZYEFK729d6qzt349fB4o.jpg', 'https://www.youtube.com/embed/lR5nlovVgvQ', 141, 7.1, 'Coralie Fargeat', 0, 27, '2025-06-06 14:27:31', '2025-06-06 14:27:31'),
(359, 'The Balconettes', 'As a heat wave brings a Marseille neighbourhood to the boil, three roommates gleefully meddle in the lives of their neighbours from their balcony. Until a late night drink turns into a bloody affair.', '2024-11-15', 'https://image.tmdb.org/t/p/w500/rEgAdJtf8S8JgUG2NJoWiRvpTz.jpg', 'https://www.youtube.com/embed/nBz48S2JJmM', 105, 6.4, 'Noémie Merlant', 0, 27, '2025-06-06 14:27:32', '2025-06-06 14:27:32'),
(360, 'Saint Catherine', 'An orphaned girl is rescued from a satanic ritual and taken to Saint Catherine Institute for homeless youth. There she will learn new skills while facing demons that stalk her.', '2024-09-24', 'https://image.tmdb.org/t/p/w500/hBJdzKPeDaC96AzlrtMWBomYSZV.jpg', 'https://www.youtube.com/embed/nq1ReNQSSWg', 86, 6.7, 'Gonzalo Mellid', 0, 27, '2025-06-06 14:27:33', '2025-06-06 14:27:33'),
(361, 'Alien', 'During its return to the earth, commercial spaceship Nostromo intercepts a distress signal from a distant planet. When a three-member team of the crew discovers a chamber containing thousands of eggs on the planet, a creature inside one of the eggs attacks an explorer. The entire crew is unaware of the impending nightmare set to descend upon them when the alien parasite planted inside its unfortunate host is birthed.', '1979-05-25', 'https://image.tmdb.org/t/p/w500/vfrQk5IPloGg1v9Rzbh2Eg3VGyM.jpg', 'https://www.youtube.com/embed/sVwH0hIvV5k', 117, 8.2, 'Ridley Scott', 0, 27, '2025-06-06 14:27:34', '2025-06-06 14:27:34'),
(362, 'The Woman in the Yard', 'In the aftermath of her husband\'s death, widow Ramona\'s struggle to raise her two kids is hindered by the arrival of a mysterious woman with supernatural abilities.', '2025-03-27', 'https://image.tmdb.org/t/p/w500/n0WS2TsNcS6dtaZKzxipyO7LuCJ.jpg', 'https://www.youtube.com/embed/27aEM6q1Wqs', 87, 6.3, 'Jaume Collet-Serra', 0, 27, '2025-06-06 14:27:35', '2025-06-06 14:27:35'),
(363, 'Alien: Romulus', 'While scavenging the deep ends of a derelict space station, a group of young space colonizers come face to face with the most terrifying life form in the universe.', '2024-08-13', 'https://image.tmdb.org/t/p/w500/b33nnKl1GSFbao4l3fZDDqsMx0F.jpg', 'https://www.youtube.com/embed/x0XDEhP4MQs', 119, 7.2, 'Fede Álvarez', 0, 27, '2025-06-06 14:27:36', '2025-06-06 14:27:36'),
(364, 'Final Destination 2', 'When Kimberly has a violent premonition of a highway pileup she blocks the freeway, keeping a few others meant to die, safe...Or are they? The survivors mysteriously start dying and it\'s up to Kimberly to stop it before she\'s next.', '2003-01-31', 'https://image.tmdb.org/t/p/w500/dg6Tf98InieJSClSKQJTQevYWmB.jpg', 'https://www.youtube.com/embed/MNXpuPu4URk', 90, 6.3, 'David R. Ellis', 0, 27, '2025-06-06 14:27:37', '2025-06-06 14:27:37'),
(365, 'Companion', 'During a weekend getaway at a secluded lakeside estate, a group of friends finds themselves entangled in a web of secrets, deception, and advanced technology. As tensions rise and loyalties are tested, they uncover unsettling truths about themselves and the world around them.', '2025-01-22', 'https://image.tmdb.org/t/p/w500/oCoTgC3UyWGfyQ9thE10ulWR7bn.jpg', 'https://www.youtube.com/embed/Qr_kX0D3DNA', 97, 7.1, 'Drew Hancock', 0, 27, '2025-06-06 14:27:38', '2025-06-06 14:27:38'),
(366, 'Final Destination 3', 'High school senior Wendy\'s premonition of a deadly rollercoaster ride saves her life and a lucky few, but not from death itself — which seeks out those who escaped their fate.', '2006-02-09', 'https://image.tmdb.org/t/p/w500/p7ARuNKUGPGvkBiDtIDvAzYzonX.jpg', 'https://www.youtube.com/embed/ectjqGg92M8', 92, 6.1, 'James Wong', 0, 27, '2025-06-06 14:27:39', '2025-06-06 14:27:39'),
(367, 'The Final Destination', 'A horrifying premonition saves a young man and his friends from death during a racetrack accident but terrible fates await them nonetheless.', '2009-08-26', 'https://image.tmdb.org/t/p/w500/5vxXrr1MqGsT4NNeRITpfDnl4Rq.jpg', 'https://www.youtube.com/embed/mWDAgB9Q4Qw', 82, 5.6, 'David R. Ellis', 0, 27, '2025-06-06 14:27:40', '2025-06-06 14:27:40'),
(368, 'The Conjuring', 'Paranormal investigators Ed and Lorraine Warren work to help a family terrorized by a dark presence in their farmhouse. Forced to confront a powerful entity, the Warrens find themselves caught in the most terrifying case of their lives.', '2013-07-18', 'https://image.tmdb.org/t/p/w500/wVYREutTvI2tmxr6ujrHT704wGF.jpg', 'https://www.youtube.com/embed/k10ETZ41q5o', 112, 7.5, 'James Wan', 0, 27, '2025-06-06 14:27:41', '2025-06-06 14:27:41'),
(369, 'Locked', 'When Eddie breaks into a luxury SUV, he steps into a deadly trap set by William, a self-proclaimed vigilante delivering his own brand of twisted justice. With no means of escape, Eddie must fight to survive in a ride where escape is an illusion, survival is a nightmare, and justice shifts into high gear.', '2025-03-20', 'https://image.tmdb.org/t/p/w500/hhkiqXpfpufwxVrdSftzeKIANl3.jpg', 'https://www.youtube.com/embed/MHAf0S9kEZw', 95, 6.3, 'David Yarovesky', 0, 27, '2025-06-06 14:27:42', '2025-06-06 14:27:42'),
(370, 'Stream', 'Craven, a streamer with thousands of followers on a live streaming platform, has prepared a very special stream for Halloween. What no one expects when reacting to a video of Pentagram, a group of young paranormal investigators, is that the live experience will turn into the worst night of their lives. And maybe... the last.', '2024-02-06', 'https://image.tmdb.org/t/p/w500/nnyjtBfUYA8ASHA9OhADrX0sMNQ.jpg', 'https://www.youtube.com/embed/EiCrTCeNo5k', 84, 5.9, 'Sergio Pereda', 0, 27, '2025-06-06 14:27:43', '2025-06-06 14:27:43'),
(371, 'Scouts Guide to the Zombie Apocalypse', 'Three scouts and lifelong friends join forces with one badass cocktail waitress to become the world’s most unlikely team of heroes.  When their peaceful town is ravaged by a zombie invasion, they’ll fight for the badge of a lifetime and put their scouting skills to the test to save mankind from the undead.', '2015-10-23', 'https://image.tmdb.org/t/p/w500/lUKvvSnjFlazrdh6wyHxHrdMknD.jpg', 'https://www.youtube.com/embed/hKrAyaadZLg', 93, 6.5, 'Christopher Landon', 0, 27, '2025-06-06 14:27:44', '2025-06-06 14:27:44'),
(372, '28 Years Later', 'Twenty-eight years since the rage virus escaped a biological weapons laboratory, now, still in a ruthlessly enforced quarantine, some have found ways to exist amidst the infected. One such group lives on a small island connected to the mainland by a single, heavily-defended causeway. When one member departs on a mission into the dark heart of the mainland, he discovers secrets, wonders, and horrors that have mutated not only the infected but other survivors as well.', '2025-06-18', 'https://image.tmdb.org/t/p/w500/hVKHzr4GwSw0FepqhqQ0DDiYHNY.jpg', 'https://www.youtube.com/embed/IYGG55qwQZQ', 115, NULL, 'Danny Boyle', 0, 27, '2025-06-06 14:27:45', '2025-06-06 14:27:45'),
(373, 'The Meg', 'A deep sea submersible pilot revisits his past fears in the Mariana Trench, and accidentally unleashes the seventy foot ancestor of the Great White Shark believed to be extinct.', '2018-08-09', 'https://image.tmdb.org/t/p/w500/eyWICPcxOuTcDDDbTMOZawoOn8d.jpg', 'https://www.youtube.com/embed/X_HfzGwzVP8', 113, 6.2, 'Jon Turteltaub', 0, 27, '2025-06-06 14:27:46', '2025-06-06 14:27:46'),
(374, 'Top Hat', 'Showman Jerry Travers is working for producer Horace Hardwick in London. Jerry demonstrates his new dance steps late one night in Horace\'s hotel room, much to the annoyance of sleeping Dale Tremont below. She goes upstairs to complain and the two are immediately attracted to each other. Complications arise when Dale mistakes Jerry for Horace.', '1935-08-29', 'https://image.tmdb.org/t/p/w500/qoPBiN6PBs2NsP7BNOJGCnmwruG.jpg', 'https://www.youtube.com/embed/FZUwE1n5zsE', 101, 7.3, 'Mark Sandrich', 0, 10402, '2025-06-06 14:27:47', '2025-06-06 14:27:47'),
(375, 'Whiplash', 'Under the direction of a ruthless instructor, a talented young drummer begins to pursue perfection at any cost, even his humanity.', '2014-10-10', 'https://image.tmdb.org/t/p/w500/7fn624j5lj3xTme2SgiLCeuedmO.jpg', 'https://www.youtube.com/embed/Q7kZy3T6vRM', 107, 8.4, 'Damien Chazelle', 0, 10402, '2025-06-06 14:27:48', '2025-06-06 14:27:48'),
(376, 'La La Land', 'Mia, an aspiring actress, serves lattes to movie stars in between auditions and Sebastian, a jazz musician, scrapes by playing cocktail party gigs in dingy bars, but as success mounts they are faced with decisions that begin to fray the fragile fabric of their love affair, and the dreams they worked so hard to maintain in each other threaten to rip them apart.', '2016-12-01', 'https://image.tmdb.org/t/p/w500/uDO8zWDhfWwoFdKS4fzkUJt0Rf0.jpg', 'https://www.youtube.com/embed/0pdqf4P9MB8', 129, 7.9, 'Damien Chazelle', 0, 10402, '2025-06-06 14:27:49', '2025-06-06 14:27:49'),
(377, 'Phineas and Ferb The Movie: Across the 2nd Dimension', 'Phineas and Ferb get trapped in an alternate dimension where the evil Doofenshmirtz rules the tri-state area. They must find a way back home with the help of their pet platypus named Perry, who they discover is a secret agent.', '2011-08-05', 'https://image.tmdb.org/t/p/w500/updMFSOZwEftfkJRpozwBlRlYI2.jpg', 'https://www.youtube.com/embed/jwfNAPIfip4', 77, 7.1, 'Robert Hughes', 0, 10402, '2025-06-06 14:27:50', '2025-06-06 14:27:50'),
(378, 'A Complete Unknown', 'New York, early 1960s. Against the backdrop of a vibrant music scene and tumultuous cultural upheaval, an enigmatic 19-year-old from Minnesota arrives in the West Village with his guitar and revolutionary talent, destined to change the course of American music.', '2024-12-18', 'https://image.tmdb.org/t/p/w500/llWl3GtNoXosbvYboelmoT459NM.jpg', 'https://www.youtube.com/embed/ob4SHtT6cC0', 140, 7.1, 'James Mangold', 0, 10402, '2025-06-06 14:27:51', '2025-06-06 14:27:51'),
(379, 'Sing 2', 'Buster and his new cast now have their sights set on debuting a new show at the Crystal Tower Theater in glamorous Redshore City. But with no connections, he and his singers must sneak into the Crystal Entertainment offices, run by the ruthless wolf mogul Jimmy Crystal, where the gang pitches the ridiculous idea of casting the lion rock legend Clay Calloway in their show. Buster must embark on a quest to find the now-isolated Clay and persuade him to return to the stage.', '2021-12-01', 'https://image.tmdb.org/t/p/w500/aWeKITRFbbwY8txG5uCj4rMCfSP.jpg', 'https://www.youtube.com/embed/EPZu5MA2uqI', 109, 7.8, 'Garth Jennings', 0, 10402, '2025-06-06 14:27:52', '2025-06-06 14:27:52'),
(380, 'Trolls Band Together', 'When Branch\'s brother, Floyd, is kidnapped for his musical talents by a pair of nefarious pop-star villains, Branch and Poppy embark on a harrowing and emotional journey to reunite the other brothers and rescue Floyd from a fate even worse than pop-culture obscurity.', '2023-10-12', 'https://image.tmdb.org/t/p/w500/bkpPTZUdq31UGDovmszsg2CchiI.jpg', 'https://www.youtube.com/embed/vDrUY5sZFds', 91, 7.3, 'Walt Dohrn', 0, 10402, '2025-06-06 14:27:53', '2025-06-06 14:27:53'),
(381, 'Bohemian Rhapsody', 'Singer Freddie Mercury, guitarist Brian May, drummer Roger Taylor and bass guitarist John Deacon take the music world by storm when they form the rock \'n\' roll band Queen in 1970. Hit songs become instant classics. When Mercury\'s increasingly wild lifestyle starts to spiral out of control, Queen soon faces its greatest challenge yet – finding a way to keep the band together amid the success and excess.', '2018-10-24', 'https://image.tmdb.org/t/p/w500/lHu1wtNaczFPGFDTrjCSzeLPTKN.jpg', 'https://www.youtube.com/embed/27zlBpzdOZg', 135, 8.0, 'Bryan Singer', 0, 10402, '2025-06-06 14:27:54', '2025-06-06 14:27:54'),
(382, 'Hurry Up Tomorrow', 'A musician plagued by insomnia is pulled into an odyssey with a stranger who begins to unravel the very core of his existence.', '2025-05-14', 'https://image.tmdb.org/t/p/w500/9W44XSMYbjXdlXcQhD104zPhhhJ.jpg', 'https://www.youtube.com/embed/e5SkoTHsC0s', 106, 4.9, 'Trey Edward Shults', 0, 10402, '2025-06-06 14:27:55', '2025-06-06 14:27:55'),
(383, 'Sing: Thriller', 'Buster Moon dreams up a star-studded spectacle set to Michael Jackson\'s \"Thriller\" in this animated short featuring characters from the hit \"Sing\" films.', '2024-10-15', 'https://image.tmdb.org/t/p/w500/i77OInTKcrnRlAozFOaB6D5mk15.jpg', 'https://www.youtube.com/embed/RiRiTEhiyP4', 11, 7.2, 'Garth Jennings', 0, 10402, '2025-06-06 14:27:56', '2025-06-06 14:27:56'),
(384, '9 Songs', 'Matt, a young glaciologist, soars across the vast, silent, icebound immensities of the South Pole as he recalls his love affair with Lisa. They meet at a mobbed rock concert in a vast music hall - London\'s Brixton Academy. They are in bed at night\'s end. Together, over a period of several months, they pursue a mutual sexual passion whose inevitable stages unfold in counterpoint to nine live-concert songs.', '2004-07-16', 'https://image.tmdb.org/t/p/w500/91O7z0vo7MiNWd5xD2BoivwbQsb.jpg', 'https://www.youtube.com/embed/N1HWcofsxJk', 69, 5.6, 'Michael Winterbottom', 0, 10402, '2025-06-06 14:27:57', '2025-06-06 14:27:57'),
(385, 'Sing', 'A koala named Buster recruits his best friend to help him drum up business for his theater by hosting a singing competition.', '2016-11-23', 'https://image.tmdb.org/t/p/w500/xviEKU073QAzeFRzWDdW9xDHPbB.jpg', 'https://www.youtube.com/embed/GIgXWuLQPFY', 107, 7.1, 'Garth Jennings', 0, 10402, '2025-06-06 14:27:58', '2025-06-06 14:27:58'),
(386, 'One Piece Film Red', 'Uta — the most beloved singer in the world. Her voice, which she sings with while concealing her true identity, has been described as “otherworldly.” She will appear in public for the first time at a live concert. As the venue fills with all kinds of Uta fans — excited pirates, the Navy watching closely, and the Straw Hats led by Luffy who simply came to enjoy her sonorous performance — the voice that the whole world has been waiting for is about to resound.', '2022-08-06', 'https://image.tmdb.org/t/p/w500/ogDXuVkO92GcETZfSofXXemw7gb.jpg', 'https://www.youtube.com/embed/ZrhZvqgtdYY', 115, 7.2, 'Goro Taniguchi', 0, 10402, '2025-06-06 14:27:59', '2025-06-06 14:27:59'),
(387, '8 Mile', 'For Jimmy Smith, Jr., life is a daily fight just to keep hope alive. Feeding his dreams in Detroit\'s vibrant music scene, Jimmy wages an extraordinary personal struggle to find his own voice - and earn a place in a world where rhymes rule, legends are born and every moment… is another chance.', '2002-11-08', 'https://image.tmdb.org/t/p/w500/7BmQj8qE1FLuLTf7Xjf9sdIHzoa.jpg', 'https://www.youtube.com/embed/axGVrfwm9L4', 111, 7.1, 'Curtis Hanson', 0, 10402, '2025-06-06 14:28:00', '2025-06-06 14:28:00'),
(388, 'Dirty Dancing', 'Expecting the usual tedium that accompanies a summer in the Catskills with her family, 17-year-old Frances \'Baby\' Houseman is surprised to find herself stepping into the shoes of a professional hoofer—and unexpectedly falling in love.', '1987-08-21', 'https://image.tmdb.org/t/p/w500/9Jw6jys7q9gjzVX5zm1z0gC8gY9.jpg', 'https://www.youtube.com/embed/IJlyeKCn3PQ', 100, 7.3, 'Emile Ardolino', 0, 10402, '2025-06-06 14:28:01', '2025-06-06 14:28:01'),
(389, 'Better Man', 'Follow Robbie Williams\' journey from childhood, to being the youngest member of chart-topping boyband Take That, through to his unparalleled achievements as a record-breaking solo artist – all the while confronting the challenges that stratospheric fame and success can bring.', '2024-12-06', 'https://image.tmdb.org/t/p/w500/fbGCmMp0HlYnAPv28GOENPShezM.jpg', 'https://www.youtube.com/embed/KVeH5T4wxkE', 135, 7.8, 'Michael Gracey', 0, 10402, '2025-06-06 14:28:02', '2025-06-06 14:28:02'),
(390, 'Descendants', 'A present-day idyllic kingdom where the benevolent teenage son of King Adam and Queen Belle offers a chance of redemption for the troublemaking offspring of Disney\'s classic villains: Cruella De Vil (Carlos), Maleficent (Mal), the Evil Queen (Evie) and Jafar (Jay).', '2015-07-31', 'https://image.tmdb.org/t/p/w500/65DkgHPSLVjgr6IYkpY9Aqqqid5.jpg', 'https://www.youtube.com/embed/iQLFxkGyrRk', 112, 7.1, 'Kenny Ortega', 0, 10402, '2025-06-06 14:28:03', '2025-06-06 14:28:03'),
(391, 'Trolls World Tour', 'Queen Poppy and Branch make a surprising discovery — there are other Troll worlds beyond their own, and their distinct differences create big clashes between these various tribes. When a mysterious threat puts all of the Trolls across the land in danger, Poppy, Branch, and their band of friends must embark on an epic quest to create harmony among the feuding Trolls to unite them against certain doom.', '2020-03-11', 'https://image.tmdb.org/t/p/w500/7W0G3YECgDAfnuiHG91r8WqgIOe.jpg', 'https://www.youtube.com/embed/08AExF6dETA', 91, 7.3, 'Walt Dohrn', 0, 10402, '2025-06-06 14:28:04', '2025-06-06 14:28:04'),
(392, 'Maria', 'Maria Callas, the world\'s greatest opera singer, lives the last days of her life in 1970s Paris, as she confronts her identity and life.', '2024-11-27', 'https://image.tmdb.org/t/p/w500/3oQRG0bwPUqE4N4n8z2kAzr7e40.jpg', 'https://www.youtube.com/embed/5x8DpKkkUno', 122, 6.5, 'Pablo Larraín', 0, 10402, '2025-06-06 14:28:05', '2025-06-06 14:28:05'),
(393, 'Elvis', 'The life story of Elvis Presley as seen through the complicated relationship with his enigmatic manager, Colonel Tom Parker.', '2022-06-22', 'https://image.tmdb.org/t/p/w500/qBOKWqAFbveZ4ryjJJwbie6tXkQ.jpg', 'https://www.youtube.com/embed/ZbrmBotVIGw', 159, 7.5, 'Baz Luhrmann', 0, 10402, '2025-06-06 14:28:06', '2025-06-06 14:28:06'),
(394, 'Will', 'A person desperately searches for their lost little brother during a Memorial Day festival in this one take POV thriller', '2022-05-30', 'https://image.tmdb.org/t/p/w500/ymCmhUHvTPrwqZudzM6udEglIsY.jpg', NULL, 5, 1.0, 'Marcos Buznego', 0, 10402, '2025-06-06 14:28:07', '2025-06-06 14:28:07'),
(395, 'The Colors Within', 'Totsuko is a high school student with the ability to see the \'colors\' of others. Colors of bliss, excitement, and serenity, plus a color she treasures as her favorite. Kimi, a classmate at her school, gives off the most beautiful color of all. Although she doesn\'t play an instrument, Totsuko forms a band with Kimi and Rui, a quiet music enthusiast they meet at a used bookstore in a far corner of town. As they practice at an old church on a remote island, music brings them together, forming friendships and stirring affections.', '2024-08-30', 'https://image.tmdb.org/t/p/w500/gOWDvzglcQZOQPqGfVF6hfOhMNT.jpg', 'https://www.youtube.com/embed/jjfRNOVeuO8', 101, 6.8, 'Naoko Yamada', 0, 10402, '2025-06-06 14:28:08', '2025-06-06 14:28:08'),
(396, 'Straight Outta Compton', 'In 1987, five young men, using brutally honest rhymes and hardcore beats, put their frustration and anger about life in the most dangerous place in America into the most powerful weapon they had: their music.  Taking us back to where it all began, Straight Outta Compton tells the true story of how these cultural rebels—armed only with their lyrics, swagger, bravado and raw talent—stood up to the authorities that meant to keep them down and formed the world’s most dangerous group, N.W.A.  And as they spoke the truth that no one had before and exposed life in the hood, their voice ignited a social revolution that is still reverberating today.', '2015-08-11', 'https://image.tmdb.org/t/p/w500/1CiLJx8Xtv3TbbFj6k7BboSmKgC.jpg', 'https://www.youtube.com/embed/-F5WcFPDzko', 147, 7.8, 'F. Gary Gray', 0, 10402, '2025-06-06 14:28:09', '2025-06-06 14:28:09'),
(397, 'The Ballad of Wallis Island', 'Eccentric lottery winner Charles lives alone on a remote island but dreams of hiring his favourite musician, Herb McGwyer, to play an exclusive, private gig. Unbeknownst to Herb, Charles has also hired Herb’s ex-bandmate and ex-girlfriend, Nell, with her new husband in town, to perform the old favourites. As tempers flare and old tensions resurface, the stormy weather traps them all on the island and Charles desperately looks for a way to salvage his dream gig.', '2025-03-28', 'https://image.tmdb.org/t/p/w500/AhmJOYdUn9katXqDk0ZpZanQ0xp.jpg', 'https://www.youtube.com/embed/GjbVZWVWzPU', 100, 7.0, 'James Griffiths', 0, 10402, '2025-06-06 14:28:10', '2025-06-06 14:28:10'),
(398, 'CODA', 'As a CODA (Child of Deaf Adults), Ruby is the only hearing person in her deaf family. When the family\'s fishing business is threatened, Ruby finds herself torn between pursuing her love of music and her fear of abandoning her parents.', '2021-08-13', 'https://image.tmdb.org/t/p/w500/BzVjmm8l23rPsijLiNLUzuQtyd.jpg', 'https://www.youtube.com/embed/0pmfrE1YL4I', 112, 7.9, 'Siân Heder', 0, 10402, '2025-06-06 14:28:11', '2025-06-06 14:28:11'),
(399, 'The Ballad of Buster Scruggs', 'Vignettes weaving together the stories of six individuals in the old West at the end of the Civil War. Following the tales of a sharp-shooting songster, a wannabe bank robber, two weary traveling performers, a lone gold prospector, a woman traveling the West to an uncertain future, and a motley crew of strangers undertaking a carriage ride.', '2018-11-09', 'https://image.tmdb.org/t/p/w500/voxl654m7p36y8FLu8oQD7dfwwK.jpg', 'https://www.youtube.com/embed/_2PyxzSH1HM', 132, 7.1, 'Joel Coen', 0, 10402, '2025-06-06 14:28:12', '2025-06-06 14:28:12'),
(400, 'Trolls', 'After the monstrous Bergens invade Troll Village, Princess Poppy, the happiest Troll ever born, and overly-cautious, curmudgeonly outcast Branch set off on a journey to rescue her friends. Their mission is full of adventure and mishaps, as this mismatched duo try to tolerate each other long enough to get the job done.', '2016-10-13', 'https://image.tmdb.org/t/p/w500/9VlK2j0THZWzhQPq0W3Oc0IIdBB.jpg', 'https://www.youtube.com/embed/xyjm5VQ11TQ', 92, 6.6, 'Mike Mitchell', 0, 10402, '2025-06-06 14:28:13', '2025-06-06 14:28:13'),
(401, 'COLORFUL STAGE! The Movie: A Miku Who Can\'t Sing', 'Ichika is a high school musician who can enter a mysterious place called “SEKAI,” where she and her friends express their innermost emotions through music alongside Hatsune Miku. One day after giving a live performance, Ichika meets a new Miku that she has never seen before. No matter how hard this new Miku tries to sing, she struggles connecting with the hearts of her listeners. Miku must rely on the help of others to find a way to sing again.', '2025-01-17', 'https://image.tmdb.org/t/p/w500/qV3PskhMDONIWrLuz5tYS4XxTrf.jpg', 'https://www.youtube.com/embed/3bD1dfiRMu4', 105, 8.4, 'Hiroyuki Hata', 0, 10402, '2025-06-06 14:28:14', '2025-06-06 14:28:14'),
(402, 'The Blues Brothers', 'Jake Blues, just released from prison, puts his old band back together to save the Catholic home where he and his brother Elwood were raised.', '1980-06-16', 'https://image.tmdb.org/t/p/w500/rhYJKOt6UrQq7JQgLyQcSWW5R86.jpg', 'https://www.youtube.com/embed/zaCGMiFRJEA', 133, 7.7, 'John Landis', 0, 10402, '2025-06-06 14:28:15', '2025-06-06 14:28:15'),
(403, 'Lyle, Lyle, Crocodile', 'When the Primm family moves to New York City, their young son Josh struggles to adapt to his new school and new friends. All of that changes when he discovers Lyle — a singing crocodile who loves baths, caviar and great music — living in the attic of his new home. But when Lyle’s existence is threatened by evil neighbor Mr. Grumps, the Primms must band together to show the world that family can come from the most unexpected places.', '2022-10-07', 'https://image.tmdb.org/t/p/w500/dN6XnCEP3AO7N4XFOFyZ8V8kZF5.jpg', 'https://www.youtube.com/embed/s0W6O7mSlaU', 106, 7.0, 'Will Speck', 0, 10402, '2025-06-06 14:28:16', '2025-06-06 14:28:16'),
(404, 'A Widow\'s Game', 'When a man is found dead, the investigation shatters his widow\'s perfect facade and exposes a hidden double life in this thriller based on real events.', '2025-05-29', 'https://image.tmdb.org/t/p/w500/yZOdrJDl2GwREoigC0y40kMosxj.jpg', 'https://www.youtube.com/embed/DETBsFN1iqg', 122, 6.4, 'Carlos Sedes', 0, 9648, '2025-06-06 14:28:17', '2025-06-06 14:28:17'),
(405, 'The Little Girl Who Lives Down the Lane', 'Quiet, withdrawn 13-year-old Rynn Jacobs lives peacefully in her home in a New England beach town. Whenever the prying landlady inquires after Rynn\'s father, she politely claims that he\'s in the city on business. But when the landlady\'s creepy and increasingly persistent son, Frank, won\'t leave Rynn alone, she teams up with kindly neighbor boy Mario to maintain the dark family secret that she\'s been keeping to herself.', '1976-12-25', 'https://image.tmdb.org/t/p/w500/qlH7atDoN2iOmq6pNsoFIlebhgA.jpg', 'https://www.youtube.com/embed/WWCO_PdJMao', 91, 7.0, 'Nicolas Gessner', 0, 9648, '2025-06-06 14:28:18', '2025-06-06 14:28:18'),
(406, 'Drop', 'Violet, a widowed mother on her first date in years, arrives at an upscale restaurant where she is relieved that her date, Henry, is more charming and handsome than she expected. But their chemistry begins to curdle as Violet begins being irritated and then terrorized by a series of anonymous drops to her phone.', '2025-04-10', 'https://image.tmdb.org/t/p/w500/dS2S5lpfgRIRQOb7LDCjNsQqKjp.jpg', 'https://www.youtube.com/embed/tZoNPCc-2Vw', 95, 6.5, 'Christopher Landon', 0, 9648, '2025-06-06 14:28:19', '2025-06-06 14:28:19'),
(407, 'The Maze Runner', 'Set in a post-apocalyptic world, young Thomas is deposited in a community of boys after his memory is erased, soon learning they\'re all trapped in a maze that will require him to join forces with fellow “runners” for a shot at escape.', '2014-09-10', 'https://image.tmdb.org/t/p/w500/ode14q7WtDugFDp78fo9lCsmay9.jpg', 'https://www.youtube.com/embed/3b946aGm0zs', 113, 7.2, 'Wes Ball', 0, 9648, '2025-06-06 14:28:20', '2025-06-06 14:28:20'),
(408, 'Smile 2', 'About to embark on a new world tour, global pop sensation Skye Riley begins experiencing increasingly terrifying and inexplicable events. Overwhelmed by the escalating horrors and the pressures of fame, Skye is forced to face her dark past to regain control of her life before it spirals out of control.', '2024-10-16', 'https://image.tmdb.org/t/p/w500/ht8Uv9QPv9y7K0RvUyJIaXOZTfd.jpg', 'https://www.youtube.com/embed/FU_bAopCcSE', 127, 6.6, 'Parker Finn', 0, 9648, '2025-06-06 14:28:21', '2025-06-06 14:28:21'),
(409, 'Watchmen', 'In a gritty and alternate 1985, the glory days of costumed vigilantes have been brought to a close by a government crackdown. But after one of the masked veterans is brutally murdered, an investigation into the killer is initiated. The reunited heroes set out to prevent their own destruction, but in doing so they uncover a sinister plot that puts all of humanity in grave danger.', '2009-03-04', 'https://image.tmdb.org/t/p/w500/aVURelN3pM56lFM7Dgfs5TixcIf.jpg', 'https://www.youtube.com/embed/89xoXmHgG00', 163, 7.3, 'Zack Snyder', 0, 9648, '2025-06-06 14:28:22', '2025-06-06 14:28:22'),
(410, 'It\'s Called \'Murder\', Baby', 'In 1940s Los Angeles, private investigator Nick Popodopolis, is hired by actress Dixie Ray, to find her blackmailer.  Edited R version of adult film, Dixie Ray Hollywood Star.', '1983-06-15', 'https://image.tmdb.org/t/p/w500/3t0AGedAVSiVOu8614okkVRyU1i.jpg', 'https://www.youtube.com/embed/io2ibNvqTsQ', 94, 6.3, 'Anthony Spinelli', 0, 9648, '2025-06-06 14:28:23', '2025-06-06 14:28:23'),
(411, 'Door', 'Yasuko, a housewife, lives in an urban high-rise apartment with her husband Satoru and her son Takuto.  Annoyed by spam calls and door-to-door salesmen, Yasuko slams the door on a salesman’s hand when he tries to squeeze a flyer through the apartment\'s chained front door. He leaves, but the next day, her nightmare starts.', '1988-05-14', 'https://image.tmdb.org/t/p/w500/mffMDHMhZ4zw25vAjtRJShlnfGR.jpg', 'https://www.youtube.com/embed/aSfs0peFoEo', 94, 6.5, 'Banmei Takahashi', 0, 9648, '2025-06-06 14:28:24', '2025-06-06 14:28:24'),
(412, 'The Conjuring: The Devil Made Me Do It', 'Paranormal investigators Ed and Lorraine Warren encounter what would become one of the most sensational cases from their files. The fight for the soul of a young boy takes them beyond anything they\'d ever seen before, to mark the first time in U.S. history that a murder suspect would claim demonic possession as a defense.', '2021-05-25', 'https://image.tmdb.org/t/p/w500/xbSuFiJbbBWCkyCCKIMfuDCA4yV.jpg', 'https://www.youtube.com/embed/tLFnRAzcaEc', 111, 7.4, 'Michael Chaves', 0, 9648, '2025-06-06 14:28:25', '2025-06-06 14:28:25'),
(413, 'Black Bag', 'When intelligence agent Kathryn Woodhouse is suspected of betraying the nation, her husband – also a legendary agent – faces the ultimate test of whether to be loyal to his marriage, or his country.', '2025-03-12', 'https://image.tmdb.org/t/p/w500/hHPovtU4b96LHcoeEwRkGHI5btw.jpg', 'https://www.youtube.com/embed/n_56L6WzLT8', 94, 6.3, 'Steven Soderbergh', 0, 9648, '2025-06-06 14:28:26', '2025-06-06 14:28:26'),
(414, 'Pi', 'A mathematical genius discovers a link between numbers and reality, and thus believes he can predict the future.', '1998-07-10', 'https://image.tmdb.org/t/p/w500/fJA22FjlAW8rzrOw9Mwanl6oTc9.jpg', 'https://www.youtube.com/embed/yRjkQT9xLZs', 84, 7.1, 'Darren Aronofsky', 0, 9648, '2025-06-06 14:28:27', '2025-06-06 14:28:27'),
(415, 'Gone Girl', 'With his wife\'s disappearance having become the focus of an intense media circus, a man sees the spotlight turned on him when it\'s suspected that he may not be innocent.', '2014-10-01', 'https://image.tmdb.org/t/p/w500/ts996lKsxvjkO2yiYG0ht4qAicO.jpg', 'https://www.youtube.com/embed/2-_-1nJf8Vg', 149, 7.9, 'David Fincher', 0, 9648, '2025-06-06 14:28:28', '2025-06-06 14:28:28'),
(416, 'Get Out', 'Chris and his girlfriend Rose go upstate to visit her parents for the weekend. At first, Chris reads the family\'s overly accommodating behavior as nervous attempts to deal with their daughter\'s interracial relationship, but as the weekend progresses, a series of increasingly disturbing discoveries lead him to a truth that he never could have imagined.', '2017-02-24', 'https://image.tmdb.org/t/p/w500/mE24wUCfjK8AoBBjaMjho7Rczr7.jpg', 'https://www.youtube.com/embed/gsB70ZRY-hI', 104, 7.6, 'Jordan Peele', 0, 9648, '2025-06-06 14:28:29', '2025-06-06 14:28:29'),
(417, 'Oldboy', 'With no clue how he came to be imprisoned, drugged and tortured for 15 years, a desperate man seeks revenge on his captors.', '2003-11-21', 'https://image.tmdb.org/t/p/w500/pWDtjs568ZfOTMbURQBYuT4Qxka.jpg', 'https://www.youtube.com/embed/tAaBkFChaRg', 120, 8.3, 'Park Chan-wook', 0, 9648, '2025-06-06 14:28:30', '2025-06-06 14:28:30'),
(418, 'Shutter Island', 'World War II soldier-turned-U.S. Marshal Teddy Daniels investigates the disappearance of a patient from a hospital for the criminally insane, but his efforts are compromised by troubling visions and a mysterious doctor.', '2010-02-14', 'https://image.tmdb.org/t/p/w500/nrmXQ0zcZUL8jFLrakWc90IR8z9.jpg', 'https://www.youtube.com/embed/qdPw9x9h5CY', 138, 8.2, 'Martin Scorsese', 0, 9648, '2025-06-06 14:28:31', '2025-06-06 14:28:31'),
(419, 'Scream', 'A year after the murder of her mother, a teenage girl is terrorized by a masked killer who targets her and her friends by using scary movies as part of a deadly game.', '1996-12-20', 'https://image.tmdb.org/t/p/w500/lr9ZIrmuwVmZhpZuTCW8D9g0ZJe.jpg', 'https://www.youtube.com/embed/U0LETmDvuXc', 112, 7.4, 'Wes Craven', 0, 9648, '2025-06-06 14:28:32', '2025-06-06 14:28:32'),
(420, 'Knives Out', 'When renowned crime novelist Harlan Thrombey is found dead at his estate just after his 85th birthday, the inquisitive and debonair Detective Benoit Blanc is mysteriously enlisted to investigate. From Harlan\'s dysfunctional family to his devoted staff, Blanc sifts through a web of red herrings and self-serving lies to uncover the truth behind Harlan\'s untimely death.', '2019-11-27', 'https://image.tmdb.org/t/p/w500/pThyQovXQrw2m0s9x82twj48Jq4.jpg', 'https://www.youtube.com/embed/qOg3AoRc4nI', 131, 7.8, 'Rian Johnson', 0, 9648, '2025-06-06 14:28:33', '2025-06-06 14:28:33'),
(421, 'Smile', 'After witnessing a bizarre, traumatic incident involving a patient, Dr. Rose Cotter starts experiencing frightening occurrences that she can\'t explain.', '2022-09-23', 'https://image.tmdb.org/t/p/w500/aPqcQwu4VGEewPhagWNncDbJ9Xp.jpg', 'https://www.youtube.com/embed/-8d987Wtkxs', 115, 6.7, 'Parker Finn', 0, 9648, '2025-06-06 14:28:33', '2025-06-06 14:28:33'),
(422, 'Blink Twice', 'When tech billionaire Slater King meets cocktail waitress Frida at his fundraising gala, he invites her to join him and his friends on a dream vacation on his private island. But despite the epic setting, beautiful people, ever-flowing champagne, and late-night dance parties, Frida can sense that there’s something sinister hiding beneath the island’s lush façade.', '2024-08-21', 'https://image.tmdb.org/t/p/w500/lZGOK0I2DJSRlEPNOAFTSNxSjDD.jpg', 'https://www.youtube.com/embed/jmCCQ80iAf8', 102, 6.7, 'Zoë Kravitz', 0, 9648, '2025-06-06 14:28:34', '2025-06-06 14:28:34'),
(423, 'Arrival', 'Taking place after alien crafts land around the world, an expert linguist is recruited by the military to determine whether they come in peace or are a threat.', '2016-11-10', 'https://image.tmdb.org/t/p/w500/x2FJsf1ElAgr63Y3PNPtJrcmpoe.jpg', 'https://www.youtube.com/embed/7W1m5ER3I1Y', 116, 7.6, 'Denis Villeneuve', 0, 9648, '2025-06-06 14:28:35', '2025-06-06 14:28:35'),
(424, 'The Prestige', 'A mysterious story of two magicians whose intense rivalry leads them on a life-long battle for supremacy -- full of obsession, deceit and jealousy with dangerous and deadly consequences.', '2006-10-17', 'https://image.tmdb.org/t/p/w500/bdN3gXuIZYaJP7ftKK2sU0nPtEA.jpg', 'https://www.youtube.com/embed/ObGVA1WOqyE', 130, 8.2, 'Christopher Nolan', 0, 9648, '2025-06-06 14:28:36', '2025-06-06 14:28:36'),
(425, 'Saw', 'Two men wake up to find themselves shackled in a grimy, abandoned bathroom. As they struggle to comprehend their predicament, they discover a disturbing tape left behind by the sadistic mastermind known as Jigsaw. With a chilling voice and cryptic instructions, Jigsaw informs them that they must partake in a gruesome game in order to secure their freedom.', '2004-10-01', 'https://image.tmdb.org/t/p/w500/4da0TS3iQ1IzuyhDS8elgkmOfrN.jpg', 'https://www.youtube.com/embed/0bHDblokwv0', 103, 7.4, 'James Wan', 0, 9648, '2025-06-06 14:28:38', '2025-06-06 14:28:38'),
(426, 'Scream', 'Twenty-five years after a streak of brutal murders shocked the quiet town of Woodsboro, a new killer has donned the Ghostface mask and begins targeting a group of teenagers to resurrect secrets from the town’s deadly past.', '2022-01-12', 'https://image.tmdb.org/t/p/w500/1m3W6cpgwuIyjtg5nSnPx7yFkXW.jpg', 'https://www.youtube.com/embed/nRwLyKIBNU8', 114, 6.7, 'Tyler Gillett', 0, 9648, '2025-06-06 14:28:39', '2025-06-06 14:28:39'),
(427, 'The Thing', 'In the winter of 1982, a twelve-man research team at a remote Antarctic research station discovers an alien buried in the snow for over 100,000 years. Soon unfrozen, the form-changing creature wreaks havoc, creates terror... and becomes one of them.', '1982-06-25', 'https://image.tmdb.org/t/p/w500/a9RjXOIIB56k2rGoL3Fk3nRHHHQ.jpg', 'https://www.youtube.com/embed/eke95-lTPnY', 109, 8.1, 'John Carpenter', 0, 9648, '2025-06-06 14:28:40', '2025-06-06 14:28:40'),
(428, 'Deep Water', 'A well-to-do husband who allows his wife to have affairs in order to avoid a divorce becomes a prime suspect in the disappearance of her lovers.', '2022-03-17', 'https://image.tmdb.org/t/p/w500/6yRMyWwjuhKg6IU66uiZIGhaSc8.jpg', 'https://www.youtube.com/embed/90JsrQwE5CA', 116, 5.8, 'Adrian Lyne', 0, 9648, '2025-06-06 14:28:41', '2025-06-06 14:28:41'),
(429, 'The Witch: Part 2. The Other One', 'A girl wakes up in a huge secret laboratory, then accidentally meets another girl who is trying to protect her house from a gang. The mystery girl overthrows the gang with her unexpected powers, and laboratory staff set out to find her.', '2022-06-15', 'https://image.tmdb.org/t/p/w500/9YTuscJXmr9Iua62amCgGSU8PDW.jpg', 'https://www.youtube.com/embed/EgOiCWTR_JU', 137, 7.3, 'Park Hoon-jung', 0, 9648, '2025-06-06 14:28:41', '2025-06-06 14:28:41'),
(430, 'Psycho', 'When larcenous real estate clerk Marion Crane goes on the lam with a wad of cash and hopes of starting a new life, she ends up at the notorious Bates Motel, where manager Norman Bates cares for his housebound mother.', '1960-06-22', 'https://image.tmdb.org/t/p/w500/yz4QVqPx3h1hD1DfqqQkCq3rmxW.jpg', 'https://www.youtube.com/embed/D90QhegiVvo', 109, 8.4, 'Alfred Hitchcock', 0, 9648, '2025-06-06 14:28:42', '2025-06-06 14:28:42'),
(431, 'Holland', 'Teacher Nancy\'s life with her husband in Holland, Michigan, tumbles into a twisted tale when she and a colleague become suspicious of a secret.', '2025-03-09', 'https://image.tmdb.org/t/p/w500/39jIr3A4ScUeGxFdMeARYKNxTgU.jpg', 'https://www.youtube.com/embed/IJm3LHoqdA4', 110, 5.4, 'Mimi Cave', 0, 9648, '2025-06-06 14:28:43', '2025-06-06 14:28:43'),
(432, 'Midsommar', 'Several friends travel to Sweden to study as anthropologists a summer festival that is held every ninety years in the remote hometown of one of them. What begins as a dream vacation in a place where the sun never sets, gradually turns into a dark nightmare as the mysterious inhabitants invite them to participate in their disturbing festive activities.', '2019-07-03', 'https://image.tmdb.org/t/p/w500/7LEI8ulZzO5gy9Ww2NVCrKmHeDZ.jpg', 'https://www.youtube.com/embed/1Vnghdsjmd0', 147, 7.2, 'Ari Aster', 0, 9648, '2025-06-06 14:28:44', '2025-06-06 14:28:44'),
(433, 'Saw X', 'Between the events of \'Saw\' and \'Saw II\', a sick and desperate John Kramer travels to Mexico for a risky and experimental medical procedure in hopes of a miracle cure for his cancer, only to discover the entire operation is a scam to defraud the most vulnerable. Armed with a newfound purpose, the infamous serial killer returns to his work, turning the tables on the con artists in his signature visceral way through devious, deranged, and ingenious traps.', '2023-09-27', 'https://image.tmdb.org/t/p/w500/u7Lp1Hi8aBS73jv4KRMIv5aK4ax.jpg', 'https://www.youtube.com/embed/t3PzUo4P21c', 118, 7.2, 'Kevin Greutert', 0, 9648, '2025-06-06 14:28:45', '2025-06-06 14:28:45');
INSERT INTO `movies` (`id`, `title`, `description`, `release_date`, `poster_url`, `trailer_url`, `duration`, `imdb_rating`, `director`, `views`, `genre_id`, `created_at`, `updated_at`) VALUES
(434, 'True Romance', 'Clarence marries hooker Alabama, steals cocaine from her pimp, and tries to sell it in Hollywood, while the owners of the coke try to reclaim it.', '1993-09-09', 'https://image.tmdb.org/t/p/w500/39lXk6ud6KiJgGbbWI2PUKS7y2.jpg', 'https://www.youtube.com/embed/6uoPeUa7Gkc', 118, 7.5, 'Tony Scott', 0, 10749, '2025-06-06 14:28:47', '2025-06-06 14:28:47'),
(435, 'The Gorge', 'Two highly trained operatives grow close from a distance after being sent to guard opposite sides of a mysterious gorge. When an evil below emerges, they must work together to survive what lies within.', '2025-02-13', 'https://image.tmdb.org/t/p/w500/7iMBZzVZtG0oBug4TfqDb9ZxAOa.jpg', 'https://www.youtube.com/embed/rUSdnuOLebE', 127, 7.7, 'Scott Derrickson', 0, 10749, '2025-06-06 14:28:47', '2025-06-06 14:28:47'),
(436, 'Juliet & Romeo', 'Set in 1301 at the end of Medieval times, our most famous star-crossed lovers turn the tides on the history Shakespeare based his own story on, as they reveal the truth to the very future of the Empire. But the biggest twist in this most beloved of tales, is leaving the poetry of Iambic Pentameter in the past, for the original pop music that rockets these ever-present themes right to the heart of our characters in the most surprising, and perhaps most powerful way that has ever been seen, or heard, before... The greatest love story of all time, set to the greatest music of our time.', '2025-05-09', 'https://image.tmdb.org/t/p/w500/4spOdjLgRAbIYO7mu22DQ2iInz7.jpg', 'https://www.youtube.com/embed/HLOfwe_0YsA', 122, 6.0, 'Timothy Scott Bogart', 0, 10749, '2025-06-06 14:28:48', '2025-06-06 14:28:48'),
(437, 'Sticky', 'When a man proposes marriage to his girlfriend, she wants to find out first if they are ready for a lifetime commitment. She meets her friend and her husband that will open up desires they are not aware of for a long time.', '2025-03-11', 'https://image.tmdb.org/t/p/w500/cEJe5DfzXb0hqOsMzJxHzRjYLWq.jpg', 'https://www.youtube.com/embed/Yk7agY-nug0', 72, 7.6, 'Bobby Bonifacio', 0, 10749, '2025-06-06 14:28:49', '2025-06-06 14:28:49'),
(438, 'Skin. Like. Sun.', 'Real-life young couple Wim and Floor spend an afternoon in the sunwashed rooms of a crumbling home in Belgium. In a unique twist, this artistic erotic documentary is edited in nearly real-time. In the slowness, we get the build, the sweetness, and the sexiness. Forget about fingersnapping fast editing. Slow is where it’s at.', '2009-10-10', 'https://image.tmdb.org/t/p/w500/uCkANtG6ezb7hjRKVudY3PUcbvn.jpg', NULL, 60, 5.9, 'Jennifer Lyon Bell', 0, 10749, '2025-06-06 14:28:50', '2025-06-06 14:28:50'),
(439, 'The Pursuit of Lust', 'Sensual Mongolian actress E.Khandmaa stars in this romantic drama, which highlights a housewife’s longing for pleasure her passionless husband fails to provide. That is until her spouse’s business client eventually gives in to her desires.', '2025-01-23', 'https://image.tmdb.org/t/p/w500/affsHDxbgTpCHQbC5GVyZCbuukO.jpg', NULL, 38, 5.8, 'Batdelger Byambasvren', 0, 10749, '2025-06-06 14:28:52', '2025-06-06 14:28:52'),
(440, 'After', 'Tessa Young is a dedicated student, dutiful daughter and loyal girlfriend to her high school sweetheart. Entering her first semester of college, Tessa\'s guarded world opens up when she meets Hardin Scott, a mysterious and brooding rebel who makes her question all she thought she knew about herself -- and what she wants out of life.', '2019-04-11', 'https://image.tmdb.org/t/p/w500/u3B2YKUjWABcxXZ6Nm9h10hLUbh.jpg', 'https://www.youtube.com/embed/2ZAdcWHuCmY', 106, 7.1, 'Jenny Gage', 0, 10749, '2025-06-06 14:28:53', '2025-06-06 14:28:53'),
(441, 'Pizza Dare 1', 'Seok, who wants to try perverted sex, pesters Hyun-jin every day, but Hyun-jin rejects it saying she only like normal things.  And then one day while delivering chicken, he found So-ra and Hyun-soo, a couple who enjoys delivery exposures.  Frustrated as he is with Hyun-jin, he starts neglecting her and became more and more hooked with the So-ra couple.  To recover their relationship, Hyun-jin goes on a date with Seok. But then a call came for him. The couple invites him for sex.  Will he be having a date with his wife, or will he accept the invitation he may only get once in a lifetime?  What would be his choice?', '2020-04-10', 'https://image.tmdb.org/t/p/w500/km7xKnZoHUXqiozCGzauunMp9OF.jpg', NULL, 68, 7.0, 'Kong Ja-kwan', 0, 10749, '2025-06-06 14:28:54', '2025-06-06 14:28:54'),
(442, 'Given the Movie: To the Sea', 'Second part of Given Movie: Hiiragi Mix.', '2024-09-20', 'https://image.tmdb.org/t/p/w500/2VLnT5JtJ77ErG6GD3c1J628VLp.jpg', 'https://www.youtube.com/embed/IRu6ZQzgMTA', NULL, 9.0, 'Noriko Hashimoto', 0, 10749, '2025-06-06 14:28:55', '2025-06-06 14:28:55'),
(443, 'Fifty Shades of Grey', 'When college senior Anastasia Steele steps in for her sick roommate to interview prominent businessman Christian Grey for their campus paper, little does she realize the path her life will take. Christian, as enigmatic as he is rich and powerful, finds himself strangely drawn to Ana, and she to him. Though sexually inexperienced, Ana plunges headlong into an affair -- and learns that Christian\'s true sexual proclivities push the boundaries of pain and pleasure.', '2015-02-11', 'https://image.tmdb.org/t/p/w500/63kGofUkt1Mx0SIL4XI4Z5AoSgt.jpg', 'https://www.youtube.com/embed/6FDTMRK7-24', 125, 5.9, 'Sam Taylor-Johnson', 0, 10749, '2025-06-06 14:28:56', '2025-06-06 14:28:56'),
(444, 'Sidelined: The QB and Me', 'Dallas, a burdened but headstrong dancer, is determined to get into the best dance school in the country—her late mother’s alma mater. However, that dream is suddenly derailed when the cheeky yet secretly grieving football star, Drayton, crashes into her life with a unique story of his own. Will the two of them be able to grow into their dreams together, or will their dreams be sidelined?', '2025-02-06', 'https://image.tmdb.org/t/p/w500/mSL6truNrWP1Bn9ng1rN0SkMI4f.jpg', 'https://www.youtube.com/embed/KJm3CNtYQpQ', 99, 6.0, 'Justin Wu', 0, 10749, '2025-06-06 14:28:56', '2025-06-06 14:28:56'),
(445, '10 Things I Hate About You', 'On the first day at his new school, Cameron instantly falls for Bianca, the gorgeous girl of his dreams. The only problem is that Bianca is forbidden to date until her ill-tempered, completely un-dateable older sister Kat goes out, too. In an attempt to solve his problem, Cameron singles out the only guy who could possibly be a match for Kat: a mysterious bad boy with a nasty reputation of his own.', '1999-03-30', 'https://image.tmdb.org/t/p/w500/ujERk3aKABXU3NDXOAxEQYTHe9A.jpg', 'https://www.youtube.com/embed/GbWQ_VXek6A', 97, 7.6, 'Gil Junger', 0, 10749, '2025-06-06 14:28:57', '2025-06-06 14:28:57'),
(446, 'Ghosted', 'Salt-of-the-earth Cole falls head over heels for enigmatic Sadie—but then makes the shocking discovery that she\'s a secret agent. Before they can decide on a second date, Cole and Sadie are swept away on an international adventure to save the world.', '2023-04-18', 'https://image.tmdb.org/t/p/w500/liLN69YgoovHVgmlHJ876PKi5Yi.jpg', 'https://www.youtube.com/embed/IAdCsNtEuBU', 117, 6.9, 'Dexter Fletcher', 0, 10749, '2025-06-06 14:28:58', '2025-06-06 14:28:58'),
(447, 'Room in Rome', 'A hotel room in the center of Rome serves as the setting for Alba and Natasha, two sexy and recently acquainted women, to have a physical adventure that touches their very souls.', '2010-05-07', 'https://image.tmdb.org/t/p/w500/gx2ENSap1D4nbjcz7cLLAs4S3fy.jpg', 'https://www.youtube.com/embed/27gpqR5ADUs', 109, 6.4, 'Julio Medem', 0, 10749, '2025-06-06 14:28:59', '2025-06-06 14:28:59'),
(448, 'Me Before You', 'A small town girl is caught between dead-end jobs. A high-profile, successful man becomes wheelchair bound following an accident. The man decides his life is not worth living until the girl is hired for six months to be his new caretaker. Worlds apart and trapped together by circumstance, the two get off to a rocky start. But the girl becomes determined to prove to the man that life is worth living and as they embark on a series of adventures together, each finds their world changing in ways neither of them could begin to imagine.', '2016-06-01', 'https://image.tmdb.org/t/p/w500/Ia3dzj5LnCj1ZBdlVeJrbKJQxG.jpg', 'https://www.youtube.com/embed/T0MmkG_nG1U', 110, 7.9, 'Thea Sharrock', 0, 10749, '2025-06-06 14:29:00', '2025-06-06 14:29:00'),
(449, 'The Notebook', 'An epic love story centered around an older man who reads aloud to a woman with Alzheimer\'s. From a faded notebook, the old man\'s words bring to life the story about a couple who is separated by World War II, and is then passionately reunited, seven years later, after they have taken different paths.', '2004-05-25', 'https://image.tmdb.org/t/p/w500/rNzQyW4f8B8cQeg7Dgj3n6eT5k9.jpg', 'https://www.youtube.com/embed/FC6biTjEyZw', 123, 7.9, 'Nick Cassavetes', 0, 10749, '2025-06-06 14:29:01', '2025-06-06 14:29:01'),
(450, 'Hotel Desire', 'Antonia is a single mother who works as a hotel maid in Berlin. A normal hot summer day takes a dramatic turn when she crosses paths with a particular guest of the hotel, famous blind portrait painter Julius Pass.', '2011-12-07', 'https://image.tmdb.org/t/p/w500/myzQj8Rk178DrWsiZjVKjz7Kj9P.jpg', 'https://www.youtube.com/embed/aqwMZmvwYAo', 38, 6.0, 'Sergej Moya', 0, 10749, '2025-06-06 14:29:02', '2025-06-06 14:29:02'),
(451, 'Bosomy Mom', 'Da-hee gets married to Min-soo who is older than her. Thanks to him, he also gets a son who is not too old, Jae-hyuk, who she tries to get acquainted with, albeit awkwardly. After staying with Na-yeon, she suddenly has to meet Jae-hyuk, and Na-yeon has a date with Jae-hyuk. Min-soo is surprised to find three people coming back home from a date. It made him angry to see his son with two women. Right away, Min-soo seeks Da-hee and asks about Na-yeon. Na-yeon met Min-soo secretly. However, Da-hee who is aware of Min-soo and Da-hee\'s relationship, shares this fact to Jae-hyun.', '2020-05-06', 'https://image.tmdb.org/t/p/w500/zarhMAQRWKjjsNBR1rviIXZ5xtt.jpg', NULL, 69, 5.9, 'Lee Dong-Joon', 0, 10749, '2025-06-06 14:29:03', '2025-06-06 14:29:03'),
(452, 'The Idea of You', '40-year-old single mom Solène begins an unexpected romance with 24-year-old Hayes Campbell, the lead singer of August Moon, the hottest boy band on the planet. As they begin a whirlwind romance, it isn\'t long before Hayes\' superstar status poses unavoidable challenges to their relationship, and Solène soon discovers that life in the glare of his spotlight might be more than she bargained for.', '2024-05-02', 'https://image.tmdb.org/t/p/w500/Y5P4Q3q8nrruZ9aD3wXeJS2Plg.jpg', 'https://www.youtube.com/embed/pz6qx4n2Ewc', 116, 7.4, 'Michael Showalter', 0, 10749, '2025-06-06 14:29:04', '2025-06-06 14:29:04'),
(453, 'Winter Spring Summer or Fall', 'Remi and Barnes, two very different teenagers, meet by chance in the winter of their senior year, then spend four  days together over the course of a year that will change their lives forever.', '2024-12-27', 'https://image.tmdb.org/t/p/w500/eqtMRn27ztlRbFRvfHI9SXHSOns.jpg', 'https://www.youtube.com/embed/84-KAOf4OPM', 97, 7.3, 'Tiffany Paulsen', 0, 10749, '2025-06-06 14:29:05', '2025-06-06 14:29:05'),
(454, 'Wish You Were Here', 'Charlotte finds herself in a rut, searching for a spark that seems just out of reach. After she has a whirlwind night of romance and imagining a future with a man named Adam, he ghosts her. When Charlotte finally discovers that Adam is terminally ill, she helps him spend his last days living life to the fullest.', '2025-01-17', 'https://image.tmdb.org/t/p/w500/uX40XUTBJFIskKmpThelUnRXelq.jpg', 'https://www.youtube.com/embed/pr_nVsfoUm8', 99, 6.2, 'Julia Stiles', 0, 10749, '2025-06-06 14:29:06', '2025-06-06 14:29:06'),
(455, 'Two Sisters\' Sexy Pervert', 'Min-goo is troubled seeing her two older sisters, Min-ji and Min-ah, go naked in their daily lives. After much deliberation, he devises a plan to have his friend Byeong-min come into the house. Min-goo proposes a family meeting. He lies to his sisters that he has no time to go because his father\'s business is not going well and declares that he will bring Byeong-min home. However, her older sister Min-ji is against it... Byeong-min, who entered the house, continues to be driven into a pervert...', '2021-09-11', 'https://image.tmdb.org/t/p/w500/bk02EDzNcJqi6VWFvo6RHxritvf.jpg', NULL, 72, NULL, 'Jung Seung-ho', 0, 10749, '2025-06-06 14:29:07', '2025-06-06 14:29:07'),
(456, 'Fifty Shades Freed', 'Believing they have left behind shadowy figures from their past, newlyweds Christian and Ana fully embrace an inextricable connection and shared life of luxury. But just as she steps into her role as Mrs. Grey and he relaxes into an unfamiliar stability, new threats could jeopardize their happy ending before it even begins.', '2018-01-17', 'https://image.tmdb.org/t/p/w500/jjPJ4s3DWZZvI4vw8Xfi4Vqa1Q8.jpg', 'https://www.youtube.com/embed/nJCc5HRPxYA', 105, 6.7, 'James Foley', 0, 10749, '2025-06-06 14:29:08', '2025-06-06 14:29:08'),
(457, 'Pride & Prejudice', 'A story of love and life among the landed English gentry during the Georgian era. Mr. Bennet is a gentleman living in Hertfordshire with his overbearing wife and five daughters, but if he dies their house will be inherited by a distant cousin whom they have never met, so the family\'s future happiness and security is dependent on the daughters making good marriages.', '2005-09-16', 'https://image.tmdb.org/t/p/w500/jnsoq5q98DQaE8yw6WZH0F9dW5G.jpg', 'https://www.youtube.com/embed/tbW-pmLT5UU', 127, 8.1, 'Joe Wright', 0, 10749, '2025-06-06 14:29:09', '2025-06-06 14:29:09'),
(458, 'The Mask', 'When timid bank clerk Stanley Ipkiss discovers a magical mask containing the spirit of the Norse god Loki, his entire life changes. While wearing the mask, Ipkiss becomes a supernatural playboy exuding charm and confidence which allows him to catch the eye of local nightclub singer Tina Carlyle. Unfortunately, under the mask\'s influence, Ipkiss also robs a bank, which angers junior crime lord Dorian Tyrell, whose goons get blamed for the heist.', '1994-07-29', 'https://image.tmdb.org/t/p/w500/xbbXp9px4o8Oe7IbGd0yIbla8mZ.jpg', 'https://www.youtube.com/embed/lcjN7zkgELM', 101, 7.0, 'Chuck Russell', 0, 10749, '2025-06-06 14:29:10', '2025-06-06 14:29:10'),
(459, 'Through My Window', 'Raquel\'s longtime crush on her next-door neighbor turns into something more when he starts developing feelings for her, despite his family\'s objections.', '2022-02-04', 'https://image.tmdb.org/t/p/w500/jmkpZvMVIRrMFevxzOubSBfG0s0.jpg', 'https://www.youtube.com/embed/_zxhK3Z-R0c', 112, 7.4, 'Marçal Forés', 0, 10749, '2025-06-06 14:29:11', '2025-06-06 14:29:11'),
(460, 'The Handmaiden', '1930s Korea, in the period of Japanese occupation, a new girl, Sookee, is hired as a handmaiden to a Japanese heiress, Hideko, who lives a secluded life on a large countryside estate with her domineering Uncle Kouzuki. But the maid has a secret. She is a pickpocket recruited by a swindler posing as a Japanese Count to help him seduce the Lady to elope with him, rob her of her fortune, and lock her up in a madhouse. The plan seems to proceed according to plan until Sookee and Hideko discover some unexpected emotions.', '2016-06-01', 'https://image.tmdb.org/t/p/w500/dLlH4aNHdnmf62umnInL8xPlPzw.jpg', 'https://www.youtube.com/embed/wYsdzNIcJNc', 145, 8.2, 'Park Chan-wook', 0, 10749, '2025-06-06 14:29:12', '2025-06-06 14:29:12'),
(461, 'Retro', 'Raised by a criminal father, Paarivel Kannan leaves behind his adoptive family to build a quiet life with his love, Rukmini. But his violent past won\'t let him go.', '2025-04-30', 'https://image.tmdb.org/t/p/w500/yGv62UIUfjrEUlItYPJXb1zU0lB.jpg', NULL, 162, 6.0, 'Karthik Subbaraj', 0, 10749, '2025-06-06 14:29:13', '2025-06-06 14:29:13'),
(462, 'Heart Eyes', 'When the \"Heart Eyes Killer\" strikes Seattle, a pair of co-workers pulling overtime on Valentine\'s Day are mistaken for a couple by the elusive couple-hunting killer. Now, they must spend the most romantic night of the year running for their lives.', '2025-02-06', 'https://image.tmdb.org/t/p/w500/ebqttF1Vjgde6uSFBEw9mta7Hd3.jpg', 'https://www.youtube.com/embed/1cRzZcMlJh8', 97, 6.4, 'Josh Ruben', 0, 10749, '2025-06-06 14:29:14', '2025-06-06 14:29:14'),
(463, 'The Twilight Saga: Breaking Dawn - Part 1', 'Bella Swan and Edward Cullen\'s honeymoon phase is abruptly disrupted by betrayals and unforeseen tragedies that endanger their world.', '2011-11-16', 'https://image.tmdb.org/t/p/w500/qs8LsHKYlVRmJbFUiSUhhRAygwj.jpg', 'https://www.youtube.com/embed/PQNLfo-SOR4', 117, 6.2, 'Bill Condon', 0, 10749, '2025-06-06 14:29:15', '2025-06-06 14:29:15'),
(464, 'Spider-Man: Homecoming', 'Following the events of Captain America: Civil War, Peter Parker, with the help of his mentor Tony Stark, tries to balance his life as an ordinary high school student in Queens, New York City, with fighting crime as his superhero alter ego Spider-Man as a new threat, the Vulture, emerges.', '2017-07-05', 'https://image.tmdb.org/t/p/w500/c24sv2weTHPsmDa7jEMN0m2P3RT.jpg', 'https://www.youtube.com/embed/xEvV3OsE2WM', 133, 7.3, 'Jon Watts', 0, 878, '2025-06-06 14:29:16', '2025-06-06 14:29:16'),
(465, 'Black Panther', 'King T\'Challa returns home to the reclusive, technologically advanced African nation of Wakanda to serve as his country\'s new leader. However, T\'Challa soon finds that he is challenged for the throne by factions within his own country as well as without. Using powers reserved to Wakandan kings, T\'Challa assumes the Black Panther mantle to join with ex-girlfriend Nakia, the queen-mother, his princess-kid sister, members of the Dora Milaje (the Wakandan \'special forces\') and an American secret agent, to prevent Wakanda from being dragged into a world war.', '2018-02-13', 'https://image.tmdb.org/t/p/w500/uxzzxijgPIY7slzFvMotPv8wjKA.jpg', 'https://www.youtube.com/embed/xjDjIWPwcPU', 135, 7.4, 'Ryan Coogler', 0, 878, '2025-06-06 14:29:17', '2025-06-06 14:29:17'),
(466, 'Star Wars: The Last Jedi', 'Rey develops her newly discovered abilities with the guidance of Luke Skywalker, who is unsettled by the strength of her powers. Meanwhile, the Resistance prepares to do battle with the First Order.', '2017-12-13', 'https://image.tmdb.org/t/p/w500/kOVEVeg59E0wsnXmF9nrh6OmWII.jpg', 'https://www.youtube.com/embed/Q0CbN8sfihY', 152, 6.8, 'Rian Johnson', 0, 878, '2025-06-06 14:29:18', '2025-06-06 14:29:18'),
(467, 'Captain Marvel', 'The story follows Carol Danvers as she becomes one of the universe’s most powerful heroes when Earth is caught in the middle of a galactic war between two alien races. Set in the 1990s, Captain Marvel is an all-new adventure from a previously unseen period in the history of the Marvel Cinematic Universe.', '2019-03-06', 'https://image.tmdb.org/t/p/w500/AtsgWhDnHTq68L0lLsUrCnM7TjG.jpg', 'https://www.youtube.com/embed/GX33bIOA5aA', 124, 6.8, 'Ryan Fleck', 0, 878, '2025-06-06 14:29:19', '2025-06-06 14:29:19'),
(468, 'Groot\'s First Steps', 'Following the events of “Guardians of the Galaxy Vol. 1,” Baby Groot is finally ready to try taking his first steps out of his pot—only to learn you have to walk before you can run.', '2022-08-10', 'https://image.tmdb.org/t/p/w500/1ifiV9ZJD4tC3tRYcnLIzH0meaB.jpg', NULL, 6, 7.0, 'Kirsten Lepore', 0, 878, '2025-06-06 14:29:20', '2025-06-06 14:29:20'),
(469, 'Dark Phoenix', 'The X-Men face their most formidable and powerful foe when one of their own, Jean Grey, starts to spiral out of control. During a rescue mission in outer space, Jean is nearly killed when she\'s hit by a mysterious cosmic force. Once she returns home, this force not only makes her infinitely more powerful, but far more unstable. The X-Men must now band together to save her soul and battle aliens that want to use Grey\'s new abilities to rule the galaxy.', '2019-06-05', 'https://image.tmdb.org/t/p/w500/cCTJPelKGLhALq3r51A9uMonxKj.jpg', 'https://www.youtube.com/embed/azvR__GRQic', 114, 6.0, 'Simon Kinberg', 0, 878, '2025-06-06 14:29:21', '2025-06-06 14:29:21'),
(470, 'The Fantastic Four: First Steps', 'Against the vibrant backdrop of a 1960s-inspired, retro-futuristic world, Marvel\'s First Family is forced to balance their roles as heroes with the strength of their family bond, while defending Earth from a ravenous space god called Galactus and his enigmatic Herald, Silver Surfer.', '2025-07-23', 'https://image.tmdb.org/t/p/w500/x26MtUlwtWD26d0G0FXcppxCJio.jpg', 'https://www.youtube.com/embed/YfXKYrE5yAw', 130, NULL, 'Matt Shakman', 0, 878, '2025-06-06 14:29:22', '2025-06-06 14:29:22'),
(471, 'The Matrix', 'Set in the 22nd century, The Matrix tells the story of a computer hacker who joins a group of underground insurgents fighting the vast and powerful computers who now rule the earth.', '1999-03-31', 'https://image.tmdb.org/t/p/w500/dXNAPwY7VrqMAo51EKhhCJfaGb5.jpg', 'https://www.youtube.com/embed/d0XTFAMmhrE', 136, 8.2, 'Lana Wachowski', 0, 878, '2025-06-06 14:29:24', '2025-06-06 14:29:24'),
(472, 'Avatar: The Way of Water', 'Set more than a decade after the events of the first film, learn the story of the Sully family (Jake, Neytiri, and their kids), the trouble that follows them, the lengths they go to keep each other safe, the battles they fight to stay alive, and the tragedies they endure.', '2022-12-14', 'https://image.tmdb.org/t/p/w500/t6HIqrRAclMCA60NsSmeqe9RmNV.jpg', 'https://www.youtube.com/embed/o5F8MOz_IDw', 192, 7.6, 'James Cameron', 0, 878, '2025-06-06 14:29:24', '2025-06-06 14:29:24'),
(473, 'Inception', 'Cobb, a skilled thief who commits corporate espionage by infiltrating the subconscious of his targets is offered a chance to regain his old life as payment for a task considered to be impossible: \"inception\", the implantation of another person\'s idea into a target\'s subconscious.', '2010-07-15', 'https://image.tmdb.org/t/p/w500/oYuLEt3zVCKq57qu2F8dT7NIa6f.jpg', 'https://www.youtube.com/embed/cdx31ak4KbQ', 148, 8.4, 'Christopher Nolan', 0, 878, '2025-06-06 14:29:26', '2025-06-06 14:29:26'),
(474, 'Dune: Part Two', 'Follow the mythic journey of Paul Atreides as he unites with Chani and the Fremen while on a path of revenge against the conspirators who destroyed his family. Facing a choice between the love of his life and the fate of the known universe, Paul endeavors to prevent a terrible future only he can foresee.', '2024-02-27', 'https://image.tmdb.org/t/p/w500/6izwz7rsy95ARzTR3poZ8H6c5pp.jpg', 'https://www.youtube.com/embed/U2Qp5pL3ovA', 167, 8.1, 'Denis Villeneuve', 0, 878, '2025-06-06 14:29:27', '2025-06-06 14:29:27'),
(475, 'Godzilla x Kong: The New Empire', 'Following their explosive showdown, Godzilla and Kong must reunite against a colossal undiscovered threat hidden within our world, challenging their very existence – and our own.', '2024-03-27', 'https://image.tmdb.org/t/p/w500/z1p34vh7dEOnLDmyCrlUVLuoDzd.jpg', 'https://www.youtube.com/embed/m2u6RfmTXt0', 115, 7.1, 'Adam Wingard', 0, 878, '2025-06-06 14:29:27', '2025-06-06 14:29:27'),
(476, 'Transformers: Rise of the Beasts', 'When a new threat capable of destroying the entire planet emerges, Optimus Prime and the Autobots must team up with a powerful faction known as the Maximals. With the fate of humanity hanging in the balance, humans Noah and Elena will do whatever it takes to help the Transformers as they engage in the ultimate battle to save Earth.', '2023-06-06', 'https://image.tmdb.org/t/p/w500/gPbM0MK8CP8A174rmUwGsADNYKD.jpg', 'https://www.youtube.com/embed/ZtuFgnxQMrA', 127, 7.2, 'Steven Caple Jr.', 0, 878, '2025-06-06 14:29:29', '2025-06-06 14:29:29'),
(477, 'Dune', 'Paul Atreides, a brilliant and gifted young man born into a great destiny beyond his understanding, must travel to the most dangerous planet in the universe to ensure the future of his family and his people. As malevolent forces explode into conflict over the planet\'s exclusive supply of the most precious resource in existence-a commodity capable of unlocking humanity\'s greatest potential-only those who can conquer their fear will survive.', '2021-09-15', 'https://image.tmdb.org/t/p/w500/d5NXSklXo0qyIYkgV94XAgMIckC.jpg', 'https://www.youtube.com/embed/w0HgHet0sxg', 155, 7.8, 'Denis Villeneuve', 0, 878, '2025-06-06 14:29:30', '2025-06-06 14:29:30'),
(478, 'Elevation', 'A single father and two women venture from the safety of their homes to face monstrous creatures to save the life of a young boy.', '2024-11-07', 'https://image.tmdb.org/t/p/w500/tnfc0NJ3BzhJrGJhkkEd6MHBdq5.jpg', 'https://www.youtube.com/embed/N7pZthBBLOA', 91, 6.5, 'George Nolfi', 0, 878, '2025-06-06 14:29:31', '2025-06-06 14:29:31'),
(479, 'A Quiet Place', 'A family is forced to live in silence while hiding from creatures that hunt by sound.', '2018-04-03', 'https://image.tmdb.org/t/p/w500/nAU74GmpUk7t5iklEp3bufwDq4n.jpg', 'https://www.youtube.com/embed/rqEnM25BsNQ', 91, 7.4, 'John Krasinski', 0, 878, '2025-06-06 14:29:32', '2025-06-06 14:29:32'),
(480, 'Superman', 'Superman, a journalist in Metropolis, embarks on a journey to reconcile his Kryptonian heritage with his human upbringing as Clark Kent.', '2025-07-09', 'https://image.tmdb.org/t/p/w500/ombsmhYUqR4qqOLOxAyr5V8hbyv.jpg', 'https://www.youtube.com/embed/Ox8ZLF6cGM0', 129, NULL, 'James Gunn', 0, 878, '2025-06-06 14:29:33', '2025-06-06 14:29:33'),
(481, 'Jurassic World Dominion', 'Four years after Isla Nublar was destroyed, dinosaurs now live—and hunt—alongside humans all over the world. This fragile balance will reshape the future and determine, once and for all, whether human beings are to remain the apex predators on a planet they now share with history\'s most fearsome creatures.', '2022-06-01', 'https://image.tmdb.org/t/p/w500/jbAvCACjLf1ZG0unB2tdmx5HAf1.jpg', 'https://www.youtube.com/embed/DtQycgMD4HQ', 147, 6.7, 'Colin Trevorrow', 0, 878, '2025-06-06 14:29:34', '2025-06-06 14:29:34'),
(482, 'Spider-Man', 'After being bitten by a genetically altered spider at Oscorp, nerdy but endearing high school student Peter Parker is endowed with amazing powers to become the superhero known as Spider-Man.', '2002-05-01', 'https://image.tmdb.org/t/p/w500/gh4cZbhZxyTbgxQPxD0dOudNPTn.jpg', 'https://www.youtube.com/embed/t06RUxPbp_c', 121, 7.3, 'Sam Raimi', 0, 878, '2025-06-06 14:29:35', '2025-06-06 14:29:35'),
(483, '28 Days Later', 'Twenty-eight days after a killer virus was accidentally unleashed from a British research facility, a small group of London survivors are caught in a desperate struggle to protect themselves from the infected. Carried by animals and humans, the virus turns those it infects into homicidal maniacs -- and it\'s absolutely impossible to contain.', '2002-10-31', 'https://image.tmdb.org/t/p/w500/sQckQRt17VaWbo39GIu0TMOiszq.jpg', 'https://www.youtube.com/embed/mWEhfF27O0c', 113, 7.2, 'Danny Boyle', 0, 878, '2025-06-06 14:29:35', '2025-06-06 14:29:35'),
(484, 'Star Wars', 'Princess Leia is captured and held hostage by the evil Imperial forces in their effort to take over the galactic Empire. Venturesome Luke Skywalker and dashing captain Han Solo team together with the loveable robot duo R2-D2 and C-3PO to rescue the beautiful princess and restore peace and justice in the Empire.', '1977-05-25', 'https://image.tmdb.org/t/p/w500/6FfCtAuVAW8XJjZ7eWeLibRLWTw.jpg', 'https://www.youtube.com/embed/XsS1yE2f-hE', 121, 8.2, 'George Lucas', 0, 878, '2025-06-06 14:29:36', '2025-06-06 14:29:36'),
(485, 'Ash', 'A woman wakes up on a distant planet and finds the crew of her space station viciously killed. Her investigation into what happened sets in motion a terrifying chain of events.', '2025-03-20', 'https://image.tmdb.org/t/p/w500/nRa8B3tQCUK6pVwjasIyQehbvpF.jpg', 'https://www.youtube.com/embed/uvp2EYCXYwU', 95, 5.2, 'Flying Lotus', 0, 878, '2025-06-06 14:29:37', '2025-06-06 14:29:37'),
(486, 'The Tomorrow War', 'The world is stunned when a group of time travelers arrive from the year 2051 to deliver an urgent message: Thirty years in the future, mankind is losing a global war against a deadly alien species. The only hope for survival is for soldiers and civilians from the present to be transported to the future and join the fight. Among those recruited is high school teacher and family man Dan Forester. Determined to save the world for his young daughter, Dan teams up with a brilliant scientist and his estranged father in a desperate quest to rewrite the fate of the planet.', '2021-09-03', 'https://image.tmdb.org/t/p/w500/34nDCQZwaEvsy4CFO5hkGRFDCVU.jpg', 'https://www.youtube.com/embed/RQjEbkV-9ZM', 138, 7.5, 'Chris McKay', 0, 878, '2025-06-06 14:29:38', '2025-06-06 14:29:38'),
(487, 'Jurassic World', 'Twenty-two years after the events of Jurassic Park, Isla Nublar now features a fully functioning dinosaur theme park, Jurassic World, as originally envisioned by John Hammond.', '2015-06-06', 'https://image.tmdb.org/t/p/w500/rhr4y79GpxQF9IsfJItRXVaoGs4.jpg', 'https://www.youtube.com/embed/aJJrkyHas78', 124, 6.7, 'Colin Trevorrow', 0, 878, '2025-06-06 14:29:39', '2025-06-06 14:29:39'),
(488, 'The Flash', 'When his attempt to save his family inadvertently alters the future, Barry Allen becomes trapped in a reality in which General Zod has returned and there are no Super Heroes to turn to. In order to save the world that he is in and return to the future that he knows, Barry\'s only hope is to race for his life. But will making the ultimate sacrifice be enough to reset the universe?', '2023-06-13', 'https://image.tmdb.org/t/p/w500/rktDFPbfHfUbArZ6OOOKsXcv0Bm.jpg', 'https://www.youtube.com/embed/jprhe-cWKGs', 144, 6.7, 'Andy Muschietti', 0, 878, '2025-06-06 14:29:40', '2025-06-06 14:29:40'),
(489, 'Furiosa: A Mad Max Saga', 'As the world falls, young Furiosa is snatched from the Green Place of Many Mothers into the hands of a great biker horde led by the warlord Dementus. Sweeping through the wasteland, they encounter the citadel presided over by Immortan Joe. The two tyrants wage war for dominance, and Furiosa must survive many trials as she puts together the means to find her way home.', '2024-05-22', 'https://image.tmdb.org/t/p/w500/iADOJ8Zymht2JPMoy3R7xceZprc.jpg', 'https://www.youtube.com/embed/LYV3001u574', 149, 7.5, 'George Miller', 0, 878, '2025-06-06 14:29:41', '2025-06-06 14:29:41'),
(490, 'Black Panther: Wakanda Forever', 'Queen Ramonda, Shuri, M’Baku, Okoye and the Dora Milaje fight to protect their nation from intervening world powers in the wake of King T’Challa’s death.  As the Wakandans strive to embrace their next chapter, the heroes must band together with the help of War Dog Nakia and Everett Ross and forge a new path for the kingdom of Wakanda.', '2022-11-09', 'https://image.tmdb.org/t/p/w500/sv1xJUazXeYqALzczSZ3O6nkH75.jpg', 'https://www.youtube.com/embed/_Z3QKkl1WyM', 162, 7.1, 'Ryan Coogler', 0, 878, '2025-06-06 14:29:43', '2025-06-06 14:29:43'),
(491, 'From the Shadows', 'When Dr. Joseph Cawl and members of his Hidden Wisdom cult die in a mysterious fire, survivors contact a paranormal expert to find the truth. What they discover makes them the next target of a deranged killer.', '2023-09-22', 'https://image.tmdb.org/t/p/w500/22aFuf6UnDaGP9G5CLfF92Cj1nf.jpg', 'https://www.youtube.com/embed/Hkcl5Xfg1Nc', 88, 4.5, 'Mike Sargent', 0, 878, '2025-06-06 14:29:44', '2025-06-06 14:29:44'),
(492, 'Logan', 'In the near future, a weary Logan cares for an ailing Professor X in a hideout on the Mexican border. But Logan\'s attempts to hide from the world and his legacy are upended when a young mutant arrives, pursued by dark forces.', '2017-02-28', 'https://image.tmdb.org/t/p/w500/fnbjcRDYn6YviCcePDnGdyAkYsB.jpg', 'https://www.youtube.com/embed/XaE_9pfybL4', 137, 7.8, 'James Mangold', 0, 878, '2025-06-06 14:29:45', '2025-06-06 14:29:45'),
(493, 'Guardians of the Galaxy Vol. 2', 'The Guardians must fight to keep their newfound family together as they unravel the mysteries of Peter Quill\'s true parentage.', '2017-04-19', 'https://image.tmdb.org/t/p/w500/y4MBh0EjBlMuOzv9axM4qJlmhzz.jpg', 'https://www.youtube.com/embed/wUn05hdkhjM', 137, 7.6, 'James Gunn', 0, 878, '2025-06-06 14:29:46', '2025-06-06 14:29:46'),
(494, 'Girl in the Basement', 'Sara is a teen girl who is looking forward to her 18th birthday to move away from her controlling father Don. But before she could even blow out the candles, Don imprisons her in the basement of their home.', '2021-02-27', 'https://image.tmdb.org/t/p/w500/tPP9n6r5QrIKPnshnJqE7klptj2.jpg', 'https://www.youtube.com/embed/a7VGn_0Vsx8', 88, 7.6, 'Elisabeth Röhm', 0, 10770, '2025-06-06 14:29:47', '2025-06-06 14:29:47'),
(495, 'SpongeBob Squarepants: Kreepaway Kamp', 'While at Kamp Koral for a reunion, SpongeBob and the gang are stalked by a mysterious figure lurking in the shadows as campers start disappearing one by one!', '2024-10-10', 'https://image.tmdb.org/t/p/w500/aUOCmqkbCX94znDJNtSy1402Sie.jpg', 'https://www.youtube.com/embed/KV7e1dGITg0', 45, 7.1, 'Dave Cunningham', 0, 10770, '2025-06-06 14:29:48', '2025-06-06 14:29:48'),
(496, 'Tudum: A Netflix Global Fan Event', 'Netflix Tudum 2025: The Live Event, Netflix\'s biggest celebration of fandom and culture-defining storytelling, took over the Kia Forum in Los Angeles on May 31 with an epic lineup of talent and unforgettable performances.', '2025-05-31', 'https://image.tmdb.org/t/p/w500/jTZ5yiFpJPc19lA6uoT9zafHr0f.jpg', NULL, 116, 5.7, 'Beth McCarthy-Miller', 0, 10770, '2025-06-06 14:29:49', '2025-06-06 14:29:49'),
(497, 'Death Note Relight 1: Visions of a God', 'A recap of Death Note episodes 1–26, with new footage. When rogue shinigami Ryuk leaves his Death Note in the human world, he has no idea how far the one who finds it will take his new-found power. With the Death Note in hand, brilliant high school student Light Yagami vows to rid the world of evil.', '2009-09-23', 'https://image.tmdb.org/t/p/w500/qDhbGqjZ7yFwa7FMIzuiQTQMfEQ.jpg', NULL, 131, 7.9, 'Tetsuro Araki', 0, 10770, '2025-06-06 14:29:50', '2025-06-06 14:29:50'),
(498, 'Teen Wolf: The Movie', 'The wolves are howling once again, as a terrifying ancient evil emerges in Beacon Hills. Scott McCall, no longer a teenager yet still an Alpha, must gather new allies and reunite trusted friends to fight back against this powerful and deadly enemy.', '2023-01-18', 'https://image.tmdb.org/t/p/w500/wAkpPm3wcHRqZl8XjUI3Y2chYq2.jpg', 'https://www.youtube.com/embed/3NbHKvuvI5A', 140, 7.5, 'Russell Mulcahy', 0, 10770, '2025-06-06 14:29:51', '2025-06-06 14:29:51'),
(499, 'Blue Lagoon: The Awakening', 'Two high school students become stranded on a tropical island and must rely on each other for survival. They learn more about themselves and each other while falling in love.', '2012-06-16', 'https://image.tmdb.org/t/p/w500/ptsBY9Aqo4Mn0V1krI5s8WfFxzW.jpg', 'https://www.youtube.com/embed/0pMqAbdvrfo', 85, 6.4, 'Jake Newsome', 0, 10770, '2025-06-06 14:29:52', '2025-06-06 14:29:52'),
(500, 'Death Note Relight 2: L\'s Successors', 'A recap of Death Note episodes 27–37, with new footage. L\'s successor must ponder L\'s defeat if he hopes to succeed where his famed predecessor failed. At the headquarters of the SPK, he calls upon the Japanese task force to declare war on Light.', '2009-10-07', 'https://image.tmdb.org/t/p/w500/uyez2cXhVwgEAakW5bHSscoFlF5.jpg', NULL, 100, 7.3, 'Tetsuro Araki', 0, 10770, '2025-06-06 14:29:53', '2025-06-06 14:29:53'),
(501, 'Legend of the BoneKnapper Dragon', 'Hiccup and friends accompany their mentor, Gobber, on a quest to kill the legendary Boneknapper Dragon.', '2010-10-14', 'https://image.tmdb.org/t/p/w500/qSoYxWR1EFlCiEkVDQH1lpJfP6I.jpg', 'https://www.youtube.com/embed/mNfjztfcsJA', 16, 7.0, 'John Puglisi', 0, 10770, '2025-06-06 14:29:54', '2025-06-06 14:29:54'),
(502, 'Descendants 3', 'The teenagers of Disney\'s most infamous villains return to the Isle of the Lost to recruit a new batch of villainous offspring to join them at Auradon Prep.', '2019-08-02', 'https://image.tmdb.org/t/p/w500/7IRy0iHdaS0JI3ng4ZYlk5gLSFn.jpg', 'https://www.youtube.com/embed/8jpvcD_LkK4', 106, 7.7, 'Kenny Ortega', 0, 10770, '2025-06-06 14:29:55', '2025-06-06 14:29:55'),
(503, 'Descendants 2', 'When the pressure to be royal becomes too much for Mal, she returns to the Isle of the Lost where her archenemy Uma, Ursula\'s daughter, has taken her spot as self-proclaimed queen.', '2017-07-21', 'https://image.tmdb.org/t/p/w500/qoNlGfQmFZ37Gf5fRBaCTLlOZtx.jpg', 'https://www.youtube.com/embed/Kmpm9c2hqvM', 111, 7.4, 'Kenny Ortega', 0, 10770, '2025-06-06 14:29:55', '2025-06-06 14:29:55'),
(504, 'The Girl Who Escaped: The Kara Robinson Story', 'The true story of how Kara Robinson was kidnapped, assaulted and held captive for 18 hours, 15-year-old Kara Robinson plots a daring escape from a serial killer\'s apartment.', '2023-02-11', 'https://image.tmdb.org/t/p/w500/o9hwOE1FeOelkNxfsGtTNrlWnyq.jpg', 'https://www.youtube.com/embed/dtJKPeWube4', 88, 7.2, 'Simone Stock', 0, 10770, '2025-06-06 14:29:56', '2025-06-06 14:29:56'),
(505, 'Underbelly Files: Infiltration', 'It tells the true story of Victorian detective Colin McLaren who posed as a shady art dealer and infiltrated the Australian branch of the Calabrian Mafia.', '2011-02-14', 'https://image.tmdb.org/t/p/w500/a6Ux6ZpDPRVvPAOa8LqwhQun9ID.jpg', NULL, 84, 4.0, 'Grant Brown', 0, 10770, '2025-06-06 14:29:57', '2025-06-06 14:29:57'),
(506, 'Bad Sister', 'As a top student at St. Adeline\'s Catholic Boarding School, Zoe senses that something is not quite right about the school\'s new nun-- a sense proven to be true when it is revealed the \"good\' nun is an imposter with a fatal attraction to Zoe\'s brother.', '2015-08-24', 'https://image.tmdb.org/t/p/w500/jKrIlgfJPIWNeowaOZPBZuOPmq0.jpg', 'https://www.youtube.com/embed/SU-JqbOojt4', 85, 6.6, 'Doug Campbell', 0, 10770, '2025-06-06 14:29:58', '2025-06-06 14:29:58'),
(507, 'Big City Greens the Movie: Spacecation', 'When thrill-seeker Cricket tricks his family into taking a \"road trip\" in space, chaos in the cosmos quickly ensues. Despite growing frustrations between Cricket and his dad, Bill, the two must learn to appreciate each other\'s unique perspectives in order to prevent Big City from being destroyed by an interstellar disaster.', '2024-06-06', 'https://image.tmdb.org/t/p/w500/wV0nNtlL0nxgse8llRi7SypkCQI.jpg', 'https://www.youtube.com/embed/zikAYUFJyPQ', 82, 7.6, 'Anna O\'Brian', 0, 10770, '2025-06-06 14:29:59', '2025-06-06 14:29:59'),
(508, 'Joseph', 'Joseph, favored son of Jacob and great-grandson of Abraham, is sold into slavery by his jealous brothers. Rising to become prime minister of Egypt. Joseph governed the country during a seven year famine, during which his brothers visit Egypt seeking grain, only to encounter their brother, presumed long dead.', '1995-04-10', 'https://image.tmdb.org/t/p/w500/lBscKQzEJY1XF2ReZT2vIGrMQ1k.jpg', NULL, 185, 8.2, 'Roger Young', 0, 10770, '2025-06-06 14:30:00', '2025-06-06 14:30:00'),
(509, 'Buried in Barstow', 'Follows Hazel King, a single mother determined to protect her daughter from the life she once had while defending and protecting those who can\'t protect themselves.', '2022-06-04', 'https://image.tmdb.org/t/p/w500/jROLolTGKmAAeiPndRO0DpiUWNy.jpg', 'https://www.youtube.com/embed/ab2rg2XVdMw', 85, 7.0, 'Howard Deutch', 0, 10770, '2025-06-06 14:30:01', '2025-06-06 14:30:01'),
(510, 'High School Musical', 'A popular high school athlete and an academically gifted girl get roles in the school musical and develop a friendship that threatens East High\'s social order.', '2006-01-20', 'https://image.tmdb.org/t/p/w500/bg1eLo2OjySRYKaTO89ZDsqUcJ4.jpg', NULL, 98, 6.5, 'Kenny Ortega', 0, 10770, '2025-06-06 14:30:02', '2025-06-06 14:30:02'),
(511, 'Duel', 'Traveling businessman David Mann angers the driver of a rusty tanker while crossing the California desert. A simple trip turns deadly, as Mann struggles to stay on the road while the tanker plays cat and mouse with his life.', '1971-11-13', 'https://image.tmdb.org/t/p/w500/w9Vk1Txx14vWvACELFYFlixrsfr.jpg', 'https://www.youtube.com/embed/Gdk1Igqu05Y', 89, 7.4, 'Steven Spielberg', 0, 10770, '2025-06-06 14:30:03', '2025-06-06 14:30:03'),
(512, 'A Dangerous Affair', 'Pilates instructor, Amelie Didot, begins a steamy love affair with one of her handsome clients, journalist Pierce Dalton, but the duo soon find themselves dangerously intertwined after Amelie comes face to face with a masked woman following a murder. When it’s revealed the killer has an erotic obsession with Pierce, Amelie becomes a target in the middle of a deadly love triangle.', '2022-08-06', 'https://image.tmdb.org/t/p/w500/7yaf7a815HFl8x74bt2X7svUJZ.jpg', 'https://www.youtube.com/embed/HGjCfKLNXJY', 85, 5.8, 'Christie Will Wolf', 0, 10770, '2025-06-06 14:30:04', '2025-06-06 14:30:04'),
(513, 'Miraculous World: Shanghai - The Legend of Ladydragon', 'On school break, Marinette heads to Shanghai to meet Adrien. But after arriving, Marinette loses all her stuff, including the Miraculous that allows her to turn into Ladybug!', '2021-05-15', 'https://image.tmdb.org/t/p/w500/6bsattcXstExFU0JMTy2Jjs4CYr.jpg', 'https://www.youtube.com/embed/TF63WzwuBcM', 54, 7.9, 'Thomas Astruc', 0, 10770, '2025-06-06 14:30:05', '2025-06-06 14:30:05'),
(514, 'Believe Me: The Abduction of Lisa McVey', 'On the night she plans on taking her own life, 17-year-old \'Lisa McVey\' is kidnapped and finds herself fighting to stay alive and manages to be a victim of rape. She manages to talk her attacker into releasing her, but when she returns home, no one believes her story except for one detective, who suspects she was abducted by a serial killer. Based on horrifying true events.', '2018-09-30', 'https://image.tmdb.org/t/p/w500/qbJEzCzEKDHPZDiRvSSBiYEKaAH.jpg', NULL, 98, 8.1, 'Jim Donovan', 0, 10770, '2025-06-06 14:30:06', '2025-06-06 14:30:06'),
(515, 'The Secret Path', '14-year-old Jo Ann Foley lives in squalor in a rural Southern community during World War II. Abused by her bootlegging grandfather Hank, Jo Ann has, like her mother Marie, been forced into a life of prostitution. Periodically escaping her miserable existence, Jo Ann finds comfort, security, and genuine love with a poor but proud African American couple: Honey and Too Tall.', '1999-04-02', 'https://image.tmdb.org/t/p/w500/syrovXmCyrxSgzDgAVqZa4eac4V.jpg', 'https://www.youtube.com/embed/u2FT8MnjbHE', 98, 7.3, 'Bruce Pittman', 0, 10770, '2025-06-06 14:30:07', '2025-06-06 14:30:07'),
(516, 'Steven Universe: The Movie', 'Two years after bringing peace to the galaxy, Steven Universe sees his past come back to haunt him in the form of a deranged Gem who wants to destroy the Earth.', '2019-10-07', 'https://image.tmdb.org/t/p/w500/8mRgpubxHqnqvENK4Bei30xMDvy.jpg', 'https://www.youtube.com/embed/9FGyVAIRI-4', 82, 8.2, 'Rebecca Sugar', 0, 10770, '2025-06-06 14:30:08', '2025-06-06 14:30:08'),
(517, 'Mr. Monk\'s Last Case: A Monk Movie', 'Monk steps out of retirement as his stepdaughter\'s wedding turns tragic when her fiancé dies in a bungee jumping accident.', '2023-12-08', 'https://image.tmdb.org/t/p/w500/gj74sUGsPMg5qDQooh8GTs4MvbP.jpg', 'https://www.youtube.com/embed/Krfd3OWb4hs', 97, 7.0, 'Randall Zisk', 0, 10770, '2025-06-06 14:30:09', '2025-06-06 14:30:09'),
(518, 'Detective Conan: Episode One - The Great Detective Turned Small', 'Two-hour remake of the original 1st episode, in celebration of the anime celebrating 20 years in broadcast. The special retells what happened on the day Shinichi was transformed into the body of a child. The special includes new scenes that weren\'t in the original manga or the first anime episode.', '2017-01-20', 'https://image.tmdb.org/t/p/w500/sJLA2LwMRqqiY3ateI2ERUJPrL6.jpg', NULL, 93, 7.6, 'Yasuichiro Yamamoto', 0, 10770, '2025-06-06 14:30:10', '2025-06-06 14:30:10'),
(519, 'A Dangerous Affair', 'Sharon Blake is a successful career woman who has a passionate affair with a possessive man. When she tries to break off the relationship, she uncovers the dark side of her former lover, who starts stalking and harassing her.', '1995-01-01', 'https://image.tmdb.org/t/p/w500/cT5m1AbH7Sd0oaBIlQcAyFTct95.jpg', NULL, 96, 5.0, 'Alan Metzger', 0, 10770, '2025-06-06 14:30:11', '2025-06-06 14:30:11'),
(520, 'Miraculous World: New York, United HeroeZ', 'Marinette’s class is headed to New York, the city of superheroes, for French-American Friendship Week. The whole class is there...except Adrien, whose father refuses to let him go!', '2020-09-25', 'https://image.tmdb.org/t/p/w500/9YbyvcrHmY2SVbdfXpb8mC4Fy0g.jpg', 'https://www.youtube.com/embed/952fktHweJs', 61, 8.1, 'Thomas Astruc', 0, 10770, '2025-06-06 14:30:12', '2025-06-06 14:30:12'),
(521, 'Ice Age: The Great Egg-Scapade', 'A harried prehistoric bird mother entrusts her precious, soon-to-hatch egg to Sid. When she recommends him to her neighbours, business booms at his new egg-sitting service. However, dastardly pirate bunny, Squint, who is seeking revenge on the herd, steals, camouflages and hides all the eggs. Once again, with Squint’s twin brother assisting, Manny, Diego and the rest of the gang come to the rescue and take off on a daring mission that turns into the world’s first Easter egg hunt.', '2016-03-19', 'https://image.tmdb.org/t/p/w500/ysQqYp9G37Q114Nc6uvCHbDmaj6.jpg', 'https://www.youtube.com/embed/74tcmiPJt_o', 25, 6.4, 'Ricardo Curtis', 0, 10770, '2025-06-06 14:30:13', '2025-06-06 14:30:13'),
(522, 'The Secret Sex Life of a Single Mom', 'A divorced woman finds sexual liberation through online dating.', '2014-05-31', 'https://image.tmdb.org/t/p/w500/n8F7VUB87hYqeey0ujbJB9sA2yX.jpg', NULL, 85, 5.0, 'John L\'Ecuyer', 0, 10770, '2025-06-06 14:30:14', '2025-06-06 14:30:14'),
(523, 'Tangled: Before Ever After', 'Rapunzel grapples with the responsibilities of being a princess and the overprotective ways of her father. While she wholeheartedly loves Eugene, Rapunzel does not share his immediate desire to get married and settle down within the castle walls. Determined to live life on her own terms, she and her tough-as-nails Lady-in-Waiting Cassandra embark on a secret adventure where they encounter mystical rocks that magically cause Rapunzel\'s long blonde hair to grow back. Impossible to break and difficult to hide, Rapunzel must learn to embrace her hair and all that it represents.', '2017-03-10', 'https://image.tmdb.org/t/p/w500/zj82L9maBSW6CAVZltBoFBSuTk1.jpg', 'https://www.youtube.com/embed/G44HxQpAcI4', 55, 6.8, 'Tom Caulfield', 0, 10770, '2025-06-06 14:30:15', '2025-06-06 14:30:15'),
(524, 'Ballerina', 'Taking place during the events of John Wick: Chapter 3 – Parabellum, Eve Macarro begins her training in the assassin traditions of the Ruska Roma.', '2025-06-04', 'https://image.tmdb.org/t/p/w500/mKp4euM5Cv3m2U1Vmby3OGwcD5y.jpg', 'https://www.youtube.com/embed/b9Rr9ygb-ac', 125, 7.6, 'Len Wiseman', 0, 53, '2025-06-06 14:30:16', '2025-06-06 14:30:16'),
(525, 'Rich Flu', 'A strange disease kills off some of the richest and most influential people on the planet. First it was the billionaires, then the multi-millionaires and so on progressively... Then it threatens to strike anyone with any sort of fortune. With the whole world panicking, people try to flood the market with assets the world no longer wants.', '2024-12-12', 'https://image.tmdb.org/t/p/w500/fKmn4SrS41loy8gMzyxups69Xof.jpg', 'https://www.youtube.com/embed/Do7AdCyHGzw', 116, 5.2, 'Galder Gaztelu-Urrutia', 0, 53, '2025-06-06 14:30:17', '2025-06-06 14:30:17'),
(526, '1992', 'In 1992, Mercer is desperately trying to rebuild his life and his relationship with his son amidst the turbulent Los Angeles uprising following the Rodney King verdict. Across town, another father and son put their own strained relationship to the test as they plot a dangerous heist to steal catalytic converters, which contain valuable platinum from the factory where Mercer works. As tensions rise and chaos erupts, both families reach their boiling points when their worlds collide.', '2024-08-29', 'https://image.tmdb.org/t/p/w500/tPvFmQZM5HMspryyYbrtW02NR0G.jpg', 'https://www.youtube.com/embed/CyrVTcTi7aE', 96, 7.0, 'Ariel Vromen', 0, 53, '2025-06-06 14:30:18', '2025-06-06 14:30:18'),
(527, 'Cleaner', 'When a group of radical activists take over an energy company\'s annual gala, seizing 300 hostages, an ex-soldier turned window cleaner suspended 50 storeys up on the outside of the building must save those trapped inside, including her younger brother.', '2025-02-19', 'https://image.tmdb.org/t/p/w500/mwzDApMZAGeYCEVjhegKvCzDX0W.jpg', 'https://www.youtube.com/embed/c8sf0c-cjzQ', 97, 6.5, 'Martin Campbell', 0, 53, '2025-06-06 14:30:19', '2025-06-06 14:30:19'),
(528, 'The Black Phone', 'Finney Blake, a shy but clever 13-year-old boy, is abducted by a sadistic killer and trapped in a soundproof basement where screaming is of little use. When a disconnected phone on the wall begins to ring, Finney discovers that he can hear the voices of the killer’s previous victims. And they are dead set on making sure that what happened to them doesn’t happen to Finney.', '2022-06-17', 'https://image.tmdb.org/t/p/w500/p9ZUzCyy9wRTDuuQexkQ78R2BgF.jpg', 'https://www.youtube.com/embed/nQWAVkx8O74', 103, 7.6, 'Scott Derrickson', 0, 53, '2025-06-06 14:30:20', '2025-06-06 14:30:20');
INSERT INTO `movies` (`id`, `title`, `description`, `release_date`, `poster_url`, `trailer_url`, `duration`, `imdb_rating`, `director`, `views`, `genre_id`, `created_at`, `updated_at`) VALUES
(529, 'Terrifier 3', 'Five years after surviving Art the Clown\'s Halloween massacre, Sienna and Jonathan are still struggling to rebuild their shattered lives. As the holiday season approaches, they try to embrace the Christmas spirit and leave the horrors of the past behind. But just when they think they\'re safe, Art returns, determined to turn their holiday cheer into a new nightmare. The festive season quickly unravels as Art unleashes his twisted brand of terror, proving that no holiday is safe.', '2024-10-09', 'https://image.tmdb.org/t/p/w500/ju10W5gl3PPK3b7TjEmVOZap51I.jpg', 'https://www.youtube.com/embed/0EDDtgWnSeY', 125, 6.8, 'Damien Leone', 0, 53, '2025-06-06 14:30:21', '2025-06-06 14:30:21'),
(530, 'The Amateur', 'After his life is turned upside down when his wife is killed in a London terrorist attack, a brilliant but introverted CIA decoder takes matters into his own hands when his supervisors refuse to take action.', '2025-04-09', 'https://image.tmdb.org/t/p/w500/2grhfMw97MGbat6aH4lFSUnVDFE.jpg', 'https://www.youtube.com/embed/DCWcK4c-F8Q', 123, 6.6, 'James Hawes', 0, 53, '2025-06-06 14:30:23', '2025-06-06 14:30:23'),
(531, 'Nobody', 'Hutch Mansell, a suburban dad, overlooked husband, nothing neighbor — a \"nobody.\" When two thieves break into his home one night, Hutch\'s unknown long-simmering rage is ignited and propels him on a brutal path that will uncover dark secrets he fought to leave behind.', '2021-03-18', 'https://image.tmdb.org/t/p/w500/oBgWY00bEFeZ9N25wWVyuQddbAo.jpg', 'https://www.youtube.com/embed/wZti8QKBWPo', 91, 7.9, 'Ilya Naishuller', 0, 53, '2025-06-06 14:30:24', '2025-06-06 14:30:24'),
(532, 'Mission: Impossible III', 'Retired from active duty, and training recruits for the Impossible Mission Force, agent Ethan Hunt faces the toughest foe of his career: Owen Davian, an international broker of arms and information, who\'s as cunning as he is ruthless. Davian emerges to threaten Hunt and all that he holds dear – including the woman Hunt loves.', '2006-04-25', 'https://image.tmdb.org/t/p/w500/vKGYCpmQyV9uHybWDzXuII8Los5.jpg', 'https://www.youtube.com/embed/4oVva0muTE8', 126, 6.7, 'J.J. Abrams', 0, 53, '2025-06-06 14:30:25', '2025-06-06 14:30:25'),
(533, 'Dirty Angels', 'During the United States\' 2021 withdrawal from Afghanistan, a group of female soldiers posing as medical relief are sent back in to rescue a group of kidnapped teenagers caught between ISIS and the Taliban.', '2024-12-11', 'https://image.tmdb.org/t/p/w500/1y3TG8N8zwwMxqh0qzdyDs3IyCq.jpg', 'https://www.youtube.com/embed/YBwoSa3n8Yc', 104, 6.3, 'Martin Campbell', 0, 53, '2025-06-06 14:30:26', '2025-06-06 14:30:26'),
(534, 'Mission: Impossible II', 'With computer genius Luther Stickell at his side and a beautiful thief on his mind, agent Ethan Hunt races across Australia and Spain to stop a former IMF agent from unleashing a genetically engineered biological weapon called Chimera. This mission, should Hunt choose to accept it, plunges him into the center of an international crisis of terrifying magnitude.', '2000-05-24', 'https://image.tmdb.org/t/p/w500/7us8nE3ldE0gX2cziUz4tKg0Go0.jpg', 'https://www.youtube.com/embed/hSPtsCQq52k', 123, 6.1, 'John Woo', 0, 53, '2025-06-06 14:30:26', '2025-06-06 14:30:26'),
(535, 'The Fire And The Moth', 'Violence and mayhem ensue after a smuggler escapes with a rare Ife bronze head into a gritty western Nigerian town.', '2025-05-16', 'https://image.tmdb.org/t/p/w500/hlE1jvehb0DYmLl2jxOeKuaE7lc.jpg', NULL, 100, NULL, 'Taiwo Egunjobi', 0, 53, '2025-06-06 14:30:27', '2025-06-06 14:30:27'),
(536, 'Bird Box', 'Five years after an ominous unseen presence drives most of society to suicide, a survivor and her two children make a desperate bid to reach safety.', '2018-12-13', 'https://image.tmdb.org/t/p/w500/rGfGfgL2pEPCfhIvqHXieXFn7gp.jpg', 'https://www.youtube.com/embed/INJ2bPFy108', 124, 6.8, 'Susanne Bier', 0, 53, '2025-06-06 14:30:29', '2025-06-06 14:30:29'),
(537, 'The Pursuit of Lust 3', 'This intense erotic thriller follows a disheartened woman who goes on a drinking binge after a guy she met online never showed up for their first date. Unfortunately, her drunken state would make her fall victim to a strange taxi driver’s deranged fetishes.', '2025-02-21', 'https://image.tmdb.org/t/p/w500/uvGOLs5wX6YFq2EJqTljzykO3d1.jpg', NULL, 36, 7.0, 'Batdelger Byambasvren', 0, 53, '2025-06-06 14:30:30', '2025-06-06 14:30:30'),
(538, 'Werewolves', 'A year after a supermoon’s light activated a dormant gene, transforming humans into bloodthirsty werewolves and causing nearly a billion deaths, the nightmare resurfaces as the supermoon rises again. Two scientists attempt to stop the mutation but fail and must now struggle to reach one of their family homes.', '2024-12-04', 'https://image.tmdb.org/t/p/w500/otXBlMPbFBRs6o2Xt6KX59Qw6dL.jpg', 'https://www.youtube.com/embed/HSM0IAuU7Ps', 94, 6.1, 'Steven C. Miller', 0, 53, '2025-06-06 14:30:31', '2025-06-06 14:30:31'),
(539, 'Kingdom of the Planet of the Apes', 'Several generations following Caesar\'s reign, apes – now the dominant species – live harmoniously while humans have been reduced to living in the shadows. As a new tyrannical ape leader builds his empire, one young ape undertakes a harrowing journey that will cause him to question all he\'s known about the past and to make choices that will define a future for apes and humans alike.', '2024-05-08', 'https://image.tmdb.org/t/p/w500/gKkl37BQuKTanygYQG1pyYgLVgf.jpg', 'https://www.youtube.com/embed/Tg1FesR8X90', 145, 7.1, 'Wes Ball', 0, 53, '2025-06-06 14:30:32', '2025-06-06 14:30:32'),
(540, 'Sugar Baby', 'An enterprising Sugar Baby is offered $30,000 to move in with her Sugar Daddy for the week, but soon discovers the sinister secrets trapped within his home.', '2024-10-15', 'https://image.tmdb.org/t/p/w500/z7NyxmdJ1ypn3Y6BVizjGODuBdO.jpg', 'https://www.youtube.com/embed/jsXAKSRq63s', 88, 6.0, 'Lauren Garroni', 0, 53, '2025-06-06 14:30:33', '2025-06-06 14:30:33'),
(541, 'John Wick: Chapter 2', 'John Wick is forced out of retirement by a former associate looking to seize control of a shadowy international assassins’ guild. Bound by a blood oath to aid him, Wick travels to Rome and does battle against some of the world’s most dangerous killers.', '2017-02-08', 'https://image.tmdb.org/t/p/w500/hXWBc0ioZP3cN4zCu6SN3YHXZVO.jpg', 'https://www.youtube.com/embed/LZrX9mffH8Y', 122, 7.3, 'Chad Stahelski', 0, 53, '2025-06-06 14:30:34', '2025-06-06 14:30:34'),
(542, 'Cosmic Chaos', 'Battles in virtual reality, survival in a post-apocalyptic wasteland, a Soviet spaceship giving a distress signal - Fantastic stories created with advanced special effects and passion.', '2023-08-03', 'https://image.tmdb.org/t/p/w500/mClzWv7gBqgXfjZXp49Enyoex1v.jpg', NULL, NULL, 6.0, NULL, 0, 53, '2025-06-06 14:30:35', '2025-06-06 14:30:35'),
(543, 'Train to Busan', 'When a zombie virus pushes Korea into a state of emergency, those trapped on an express train to Busan must fight for their own survival.', '2016-07-20', 'https://image.tmdb.org/t/p/w500/vNVFt6dtcqnI7hqa6LFBUibuFiw.jpg', 'https://www.youtube.com/embed/0_sV9luPnMk', 118, 7.7, 'Yeon Sang-ho', 0, 53, '2025-06-06 14:30:35', '2025-06-06 14:30:35'),
(544, 'Predator', 'A team of elite commandos on a secret mission in a Central American jungle come to find themselves hunted by an extraterrestrial warrior.', '1987-06-12', 'https://image.tmdb.org/t/p/w500/k3mW4qfJo6SKqe6laRyNGnbB9n5.jpg', 'https://www.youtube.com/embed/XY6d4LGd8YM', 107, 7.5, 'John McTiernan', 0, 53, '2025-06-06 14:30:36', '2025-06-06 14:30:36'),
(545, 'Mob Land', 'A sheriff tries to keep the peace when a desperate family man violently robs a pill mill with his brother-in-law, alerting an enforcer for the New Orleans mafia.', '2023-08-04', 'https://image.tmdb.org/t/p/w500/mcz8oi9oCgq1wkA3Wz2kluE94pE.jpg', 'https://www.youtube.com/embed/XbcFFw8YdEo', 111, 5.5, 'Nicholas Maggio', 0, 53, '2025-06-06 14:30:37', '2025-06-06 14:30:37'),
(546, 'Joker', 'During the 1980s, a failed stand-up comedian is driven insane and turns to a life of crime and chaos in Gotham City while becoming an infamous psychopathic crime figure.', '2019-10-01', 'https://image.tmdb.org/t/p/w500/udDclJoHjfjb8Ekgsd4FDteOkCU.jpg', 'https://www.youtube.com/embed/-RFFRxcoKfA', 122, 8.1, 'Todd Phillips', 0, 53, '2025-06-06 14:30:38', '2025-06-06 14:30:38'),
(547, 'Cry of Silence', 'Cry of Silence, is about a double kidnapping, and assault that is presented as an Action Packed ,Dramatic, Thriller that will keep you riveted.', '2024-05-01', 'https://image.tmdb.org/t/p/w500/dsUimI4VI1SCI1t8jS7ZwBwt1DW.jpg', NULL, NULL, 5.9, 'Allen Kool', 0, 53, '2025-06-06 14:30:39', '2025-06-06 14:30:39'),
(548, 'Soul to Squeeze', 'Jacob\'s got problems-deep, mental ones. Desperate for relief, he volunteers for a radical treatment to escape his tortured mind. But instead of peace, he finds himself trapped in a house with a tunnel to his subconscious. What begins as a path to healing becomes a harrowing descent where memory fractures, time distorts, and reality bends. A first-of-its-kind cinematic experience, Soul to Squeeze begins in a boxy 4:3 aspect ratio and ever so slowly widens to a full 2.35:1 by the final frame-mirroring Jacob\'s expanding perception as he risks everything for redemption. Visually daring and emotionally raw, Soul to Squeeze merges body with mind, taking audiences on a perilous journey through the psyche.', '2025-05-16', 'https://image.tmdb.org/t/p/w500/bBJGmU0ORhmo0liy7c3MdI8qOMU.jpg', 'https://www.youtube.com/embed/SkTSq9VFJl0', 86, 4.7, 'W.M. Weikart', 0, 53, '2025-06-06 14:30:40', '2025-06-06 14:30:40'),
(549, 'World War Z', 'Life for former United Nations investigator Gerry Lane and his family seems content. Suddenly, the world is plagued by a mysterious infection turning whole human populations into rampaging mindless zombies. After barely escaping the chaos, Lane is persuaded to go on a mission to investigate this disease. What follows is a perilous trek around the world where Lane must brave horrific dangers and long odds to find answers before human civilization falls.', '2013-06-19', 'https://image.tmdb.org/t/p/w500/aCnVdvExw6UWSeQfr0tUH3jr4qG.jpg', 'https://www.youtube.com/embed/TvRCQM2HrXs', 116, 6.8, 'Marc Forster', 0, 53, '2025-06-06 14:30:41', '2025-06-06 14:30:41'),
(550, 'Hannah', 'The dynamic PR-agent Hannah is starting up her dream-job in the Hochstedt Company producing toys and soon falls in love with her firm\'s junior executive director, Wolfgang. But while Hannah is still totally immersed in this passionate love affair, she unknowingly and progressively gets caught in a web of danger. Behind the harmless dolls and teddy-bears produced by the company a deadly secret is revealed. And for Hannah, the game of love suddenly turns bloody.', '1996-10-18', 'https://image.tmdb.org/t/p/w500/qPqDm8wVQT6LbX9Oq9lW51WwGhJ.jpg', NULL, 118, 7.0, 'Reinhard Schwabenitzky', 0, 53, '2025-06-06 14:30:42', '2025-06-06 14:30:42'),
(551, 'Azrael', 'In a world where no one speaks, a devout female hunts down a young woman who has escaped her imprisonment. Recaptured by its ruthless leaders, Azrael is due to be sacrificed to pacify an ancient evil deep within the surrounding wilderness.', '2024-09-27', 'https://image.tmdb.org/t/p/w500/qpdFKDvJS7oLKTcBLXOaMwUESbs.jpg', 'https://www.youtube.com/embed/-kKSxFDcwKw', 86, 6.0, 'E.L. Katz', 0, 53, '2025-06-06 14:30:43', '2025-06-06 14:30:43'),
(552, 'Presence', 'A couple and their children move into a seemingly normal suburban home. When strange events occur, they begin to believe there is something else in the house with them. The presence is about to disrupt their lives in unimaginable ways.', '2025-01-17', 'https://image.tmdb.org/t/p/w500/hZ8dTeBzigV5SVgwG1ikSROAFiS.jpg', 'https://www.youtube.com/embed/Ay4MJZH6_K8', 84, 6.0, 'Steven Soderbergh', 0, 53, '2025-06-06 14:30:44', '2025-06-06 14:30:44'),
(553, 'Taken', 'Bryan Mills, a former government operative, is trying to reconnect with his teenage daughter Kim. After reluctantly agreeing with his ex-wife to let Kim go to Paris on vacation with a friend, his worst nightmare comes true. While on the phone with his daughter shortly after she arrives in Paris, she and her friend are abducted by a gang of human traffickers. Working against the clock, Bryan relies on his extensive training and skills to track down the ruthless gang that abducted her and launch a one-man war to rescue his daughter.', '2008-02-18', 'https://image.tmdb.org/t/p/w500/y5Va1WXDX6nZElVirPrGxf6w99B.jpg', 'https://www.youtube.com/embed/ZxKDnpiJaVc', 94, 7.4, 'Pierre Morel', 0, 53, '2025-06-06 14:30:45', '2025-06-06 14:30:45'),
(554, 'Jojo Rabbit', 'A World War II satire that follows a lonely German boy whose world view is turned upside down when he discovers his single mother is hiding a young Jewish girl in their attic. Aided only by his idiotic imaginary friend, Adolf Hitler, Jojo must confront his blind nationalism.', '2019-10-18', 'https://image.tmdb.org/t/p/w500/1mqL7VG4Ix8wmxwypmCA1HTHBky.jpg', 'https://www.youtube.com/embed/tL4McUzXfFI', 108, 8.0, 'Taika Waititi', 0, 10752, '2025-06-06 14:30:47', '2025-06-06 14:30:47'),
(555, 'The Codes of War', 'War stories about family, ethics and honor include the true story of two U.S. Marines who in a span of six seconds, must stand their ground to stop a suicide truck bomb, a Navy Corpsman who attempts to hold on to his humanity, and a WW2 soldier who gets separated from his squad and is forced to re-evaluate his code.', '2025-03-20', 'https://image.tmdb.org/t/p/w500/oXeiQAfRK90pxxhP5iKPXQqAIN1.jpg', NULL, 92, 6.1, 'Paul Anderson', 0, 10752, '2025-06-06 14:30:47', '2025-06-06 14:30:47'),
(556, 'Platoon', 'As a young and naive recruit in Vietnam, Chris Taylor faces a moral crisis when confronted with the horrors of war and the duality of man.', '1986-12-19', 'https://image.tmdb.org/t/p/w500/m3mmFkPQKvPZq5exmh0bDuXlD9T.jpg', 'https://www.youtube.com/embed/R8weLPF4qBQ', 120, 7.7, 'Oliver Stone', 0, 10752, '2025-06-06 14:30:48', '2025-06-06 14:30:48'),
(557, 'Civil War', 'In the near future, a group of war journalists attempt to survive while reporting the truth as the United States stands on the brink of civil war.', '2024-04-10', 'https://image.tmdb.org/t/p/w500/sh7Rg8Er3tFcN9BpKIPOMvALgZd.jpg', 'https://www.youtube.com/embed/c2G18nIVpNE', 109, 6.9, 'Alex Garland', 0, 10752, '2025-06-06 14:30:49', '2025-06-06 14:30:49'),
(558, 'Fury', 'In the last months of World War II, as the Allies make their final push in the European theatre, a battle-hardened U.S. Army sergeant named \'Wardaddy\' commands a Sherman tank called \'Fury\' and its five-man crew on a deadly mission behind enemy lines. Outnumbered and outgunned, Wardaddy and his men face overwhelming odds in their heroic attempts to strike at the heart of Nazi Germany.', '2014-10-15', 'https://image.tmdb.org/t/p/w500/pfte7wdMobMF4CVHuOxyu6oqeeA.jpg', 'https://www.youtube.com/embed/09w9MTtZDEM', 135, 7.5, 'David Ayer', 0, 10752, '2025-06-06 14:30:50', '2025-06-06 14:30:50'),
(559, 'War for the Planet of the Apes', 'Caesar and his apes are forced into a deadly conflict with an army of humans led by a ruthless Colonel. After the apes suffer unimaginable losses, Caesar wrestles with his darker instincts and begins his own mythic quest to avenge his kind. As the journey finally brings them face to face, Caesar and the Colonel are pitted against each other in an epic battle that will determine the fate of both their species and the future of the planet.', '2017-07-11', 'https://image.tmdb.org/t/p/w500/mMA1qhBFgZX8O36qPPTC016kQl1.jpg', 'https://www.youtube.com/embed/1TxqmlIv1Iw', 140, 7.2, 'Matt Reeves', 0, 10752, '2025-06-06 14:30:51', '2025-06-06 14:30:51'),
(560, 'The Ministry of Ungentlemanly Warfare', 'During World War II, the British Army assigns a group of competent soldiers to carry out a mission against the Nazi forces behind enemy lines... A true story about a secret British WWII organization — the Special Operations Executive. Founded by Winston Churchill, their irregular warfare against the Germans helped to change the course of the war, and gave birth to modern black operations.', '2024-04-18', 'https://image.tmdb.org/t/p/w500/8aF0iAKH9MJMYAZdi0Slg77RYa2.jpg', 'https://www.youtube.com/embed/zvwDen1Wrx8', 120, 7.1, 'Guy Ritchie', 0, 10752, '2025-06-06 14:30:52', '2025-06-06 14:30:52'),
(561, 'Inglourious Basterds', 'In Nazi-occupied France during World War II, a group of Jewish-American soldiers known as \"The Basterds\" are chosen specifically to spread fear throughout the Third Reich by scalping and brutally killing Nazis. The Basterds, lead by Lt. Aldo Raine soon cross paths with a French-Jewish teenage girl who runs a movie theater in Paris which is targeted by the soldiers.', '2009-08-02', 'https://image.tmdb.org/t/p/w500/7sfbEnaARXDDhKm0CZ7D7uc2sbo.jpg', 'https://www.youtube.com/embed/uSEDz-my7XQ', 153, 8.2, 'Quentin Tarantino', 0, 10752, '2025-06-06 14:30:53', '2025-06-06 14:30:53'),
(562, 'Guy Ritchie\'s The Covenant', 'During the war in Afghanistan, a local interpreter risks his own life to carry an injured sergeant across miles of grueling terrain.', '2023-04-19', 'https://image.tmdb.org/t/p/w500/kVG8zFFYrpyYLoHChuEeOGAd6Ru.jpg', 'https://www.youtube.com/embed/02PPMPArNEQ', 123, 7.8, 'Guy Ritchie', 0, 10752, '2025-06-06 14:30:55', '2025-06-06 14:30:55'),
(563, 'The Pianist', 'The true story of pianist Władysław Szpilman\'s experiences in Warsaw during the Nazi occupation. When the Jews of the city find themselves forced into a ghetto, Szpilman finds work playing in a café; and when his family is deported in 1942, he stays behind, works for a while as a laborer, and eventually goes into hiding in the ruins of the war-torn city.', '2002-09-17', 'https://image.tmdb.org/t/p/w500/2hFvxCCWrTmCYwfy7yum0GKRi3Y.jpg', 'https://www.youtube.com/embed/og9hFxxdSOg', 150, 8.4, 'Roman Polanski', 0, 10752, '2025-06-06 14:30:56', '2025-06-06 14:30:56'),
(564, 'Land of Bad', 'When a Delta Force special ops mission goes terribly wrong, Air Force drone pilot Reaper has 48 hours to remedy what has devolved into a wild rescue operation. With no weapons and no communication other than the drone above, the ground mission suddenly becomes a full-scale battle when the team is discovered by the enemy.', '2024-02-09', 'https://image.tmdb.org/t/p/w500/h3jYanWMEJq6JJsCopy1h7cT2Hs.jpg', 'https://www.youtube.com/embed/hHmA-Tg4Juo', 113, 7.3, 'William Eubank', 0, 10752, '2025-06-06 14:30:57', '2025-06-06 14:30:57'),
(565, 'Full Metal Jacket', 'A pragmatic U.S. Marine observes the dehumanizing effects the U.S.-Vietnam War has on his fellow recruits from their brutal boot camp training to the bloody street fighting in Hue.', '1987-06-26', 'https://image.tmdb.org/t/p/w500/kMKyx1k8hWWscYFnPbnxxN4Eqo4.jpg', 'https://www.youtube.com/embed/n2i917l5RFc', 117, 8.1, 'Stanley Kubrick', 0, 10752, '2025-06-06 14:30:57', '2025-06-06 14:30:57'),
(566, 'Brothers', 'When his helicopter goes down during his fourth tour of duty in Afghanistan, Marine Sam Cahill is presumed dead. Back home, brother Tommy steps in to look over Sam’s wife, Grace, and two children. Sam’s surprise homecoming triggers domestic mayhem.', '2009-12-02', 'https://image.tmdb.org/t/p/w500/skHqceAFYee0JZuYd9MVk2IQggi.jpg', 'https://www.youtube.com/embed/BvIj2H1ne0k', 105, 7.3, 'Jim Sheridan', 0, 10752, '2025-06-06 14:30:58', '2025-06-06 14:30:58'),
(567, '300', 'Based on Frank Miller\'s graphic novel, \"300\" is very loosely based the 480 B.C. Battle of Thermopylae, where the King of Sparta led his army against the advancing Persians; the battle is said to have inspired all of Greece to band together against the Persians, and helped usher in the world\'s first democracy.', '2007-03-07', 'https://image.tmdb.org/t/p/w500/h7Lcio0c9ohxPhSZg42eTlKIVVY.jpg', 'https://www.youtube.com/embed/UrIbxk7idYA', 116, 7.2, 'Zack Snyder', 0, 10752, '2025-06-06 14:30:59', '2025-06-06 14:30:59'),
(568, 'Sniper: The White Raven', 'Mykola is an eccentric pacifist who wants to be useful to humanity. When the war begins at Donbass, Mykola’s naive world is collapsing as the militants kill his pregnant wife and burn his home to the ground. Recovered, he makes a cardinal decision and gets enlisted in a sniper company. Having met his wife’s killers, he emotionally breaks down and arranges “sniper terror” for the enemy. He’s saved from a senseless death by his instructor who himself gets mortally wounded. The death of a friend leaves a “scar” and Mykola is ready to sacrifice his life.', '2022-05-03', 'https://image.tmdb.org/t/p/w500/295gZzTXMvuiIG0U19h4M44PXxI.jpg', 'https://www.youtube.com/embed/cZIhRHSXtyU', 120, 7.6, 'Marian Bushan', 0, 10752, '2025-06-06 14:31:00', '2025-06-06 14:31:00'),
(569, '300: Rise of an Empire', 'Greek general Themistocles attempts to unite all of Greece by leading the charge that will change the course of the war. Themistocles faces the massive invading Persian forces led by mortal-turned-god, Xerxes and Artemesia, the vengeful commander of the Persian navy.', '2014-03-05', 'https://image.tmdb.org/t/p/w500/wYDdWN1McB1Sio4z1dPSkb40Z78.jpg', 'https://www.youtube.com/embed/bsoJaQ2gZh4', 102, 6.1, 'Noam Murro', 0, 10752, '2025-06-06 14:31:01', '2025-06-06 14:31:01'),
(570, 'Greyhound', 'A first-time captain leads a convoy of allied ships carrying thousands of soldiers across the treacherous waters of the \"Black Pit\" to the front lines of WWII. With no air cover protection for 5 days, the captain and his convoy must battle the surrounding enemy Nazi U-boats in order to give the allies a chance to win the war.', '2020-07-09', 'https://image.tmdb.org/t/p/w500/kjMbDciooTbJPofVXgAoFjfX8Of.jpg', 'https://www.youtube.com/embed/5Byeq_hyh2U', 92, 7.4, 'Aaron Schneider', 0, 10752, '2025-06-06 14:31:02', '2025-06-06 14:31:02'),
(571, 'Gone with the Wind', 'The spoiled daughter of a Georgia plantation owner conducts a tumultuous romance with a cynical profiteer during the American Civil War and Reconstruction Era.', '1939-12-15', 'https://image.tmdb.org/t/p/w500/lNz2Ow0wGCAvzckW7EOjE03KcYv.jpg', 'https://www.youtube.com/embed/fgdCVxmPMVE', 233, 7.9, 'Victor Fleming', 0, 10752, '2025-06-06 14:31:03', '2025-06-06 14:31:03'),
(572, 'The Last Samurai', 'Nathan Algren is an American hired to instruct the Japanese army in the ways of modern warfare, which finds him learning to respect the samurai and the honorable principles that rule them. Pressed to destroy the samurai\'s way of life in the name of modernization and open trade, Algren decides to become an ultimate warrior himself and to fight for their right to exist.', '2003-12-05', 'https://image.tmdb.org/t/p/w500/lsasOSgYI85EHygtT5SvcxtZVYT.jpg', 'https://www.youtube.com/embed/QZpQrc0R6J0', 154, 7.6, 'Edward Zwick', 0, 10752, '2025-06-06 14:31:04', '2025-06-06 14:31:04'),
(573, 'Rambo', 'In Thailand, ex-Green Beret John James Rambo joins a group of mercenaries to venture into war-torn neighboring Myanmar to rescue a group of Christian aid workers who have been kidnapped by a ruthless local infantry unit.', '2008-01-24', 'https://image.tmdb.org/t/p/w500/3mInub5c8o00H7EJ1TrjAqOzIuc.jpg', 'https://www.youtube.com/embed/tI-kGoxpySM', 92, 6.7, 'Sylvester Stallone', 0, 10752, '2025-06-06 14:31:05', '2025-06-06 14:31:05'),
(574, 'The Zone of Interest', 'The commandant of Auschwitz, Rudolf Höss, and his wife Hedwig, strive to build a dream life for their family in a house and garden next to the camp.', '2023-12-15', 'https://image.tmdb.org/t/p/w500/hUu9zyZmDd8VZegKi1iK1Vk0RYS.jpg', 'https://www.youtube.com/embed/GFNtVaAuVYY', 105, 7.0, 'Jonathan Glazer', 0, 10752, '2025-06-06 14:31:06', '2025-06-06 14:31:06'),
(575, 'Tropic Thunder', 'A group of self-absorbed actors set out to make the most expensive war film ever. After ballooning costs force the studio to cancel the movie, the frustrated director refuses to stop shooting, leading his cast into the jungles of Southeast Asia, where they encounter real bad guys.', '2008-08-09', 'https://image.tmdb.org/t/p/w500/zAurB9mNxfYRoVrVjAJJwGV3sPg.jpg', 'https://www.youtube.com/embed/VsEdmjAudSI', 107, 6.7, 'Ben Stiller', 0, 10752, '2025-06-06 14:31:08', '2025-06-06 14:31:08'),
(576, 'Pan\'s Labyrinth', 'Living with her tyrannical stepfather in a new home with her pregnant mother, 10-year-old Ofelia feels alone until she explores a decaying labyrinth guarded by a mysterious faun who claims to know her destiny. If she wishes to return to her real father, Ofelia must complete three terrifying tasks.', '2006-10-11', 'https://image.tmdb.org/t/p/w500/s8C4whhKtDaJvMDcyiMvx3BIF5F.jpg', 'https://www.youtube.com/embed/6tYUOAMsydg', 118, 7.8, 'Guillermo del Toro', 0, 10752, '2025-06-06 14:31:08', '2025-06-06 14:31:08'),
(577, 'Apocalypse Now', 'At the height of the Vietnam war, Captain Benjamin Willard is sent on a dangerous mission that, officially, \"does not exist, nor will it ever exist.\" His goal is to locate - and eliminate - a mysterious Green Beret Colonel named Walter Kurtz, who has been leading his personal army on illegal guerrilla missions into enemy territory.', '1979-05-19', 'https://image.tmdb.org/t/p/w500/gQB8Y5RCMkv2zwzFHbUJX3kAhvA.jpg', 'https://www.youtube.com/embed/9l-ViOOFH-s', 147, 8.3, 'Francis Ford Coppola', 0, 10752, '2025-06-06 14:31:09', '2025-06-06 14:31:09'),
(578, 'First Blood', 'When former Green Beret John Rambo is harassed by local law enforcement and arrested for vagrancy, he is forced to flee into the mountains and wage an escalating one-man war against his pursuers.', '1982-10-22', 'https://image.tmdb.org/t/p/w500/a9sa6ERZCpplbPEO7OMWE763CLD.jpg', 'https://www.youtube.com/embed/-dTDmrJXXoA', 93, 7.5, 'Ted Kotcheff', 0, 10752, '2025-06-06 14:31:10', '2025-06-06 14:31:10'),
(579, 'Sisu', 'When an ex-soldier who discovers gold in the Lapland wilderness tries to take the loot into the city, German soldiers led by a brutal SS officer battle him.', '2022-09-09', 'https://image.tmdb.org/t/p/w500/zehhtcLHnTOE0lw9rLTIRsJeeW2.jpg', 'https://www.youtube.com/embed/d2k4QAItiSA', 91, 7.4, 'Jalmari Helander', 0, 10752, '2025-06-06 14:31:11', '2025-06-06 14:31:11'),
(580, 'Creation of the Gods II: Demon Force', 'Taishi Wen Zhong led the army of Shang Dynasty including Deng Chanyu and four generals of the Mo Family to Xiqi. With the help of Kunlun immortals such as Jiang Ziya, Ji Fa led the army and civilians of Xiqi to defend their homeland.', '2025-01-29', 'https://image.tmdb.org/t/p/w500/kHII3r0PZ0nEGeSTSuhfAM2q1tI.jpg', 'https://www.youtube.com/embed/GR1LszelGoU', 145, 6.2, 'Wuershan', 0, 10752, '2025-06-06 14:31:12', '2025-06-06 14:31:12'),
(581, 'The Burning Cold', 'Winter of 1943. Andorra, a small country in the Pyrenees.  In the tense calm of a borderland, where echoes of a nearby war reach the ears of the local inhabitants, Antonio and Sara, a young, married couple, are expecting their first child. No one knows exactly what is going on, nor what is being fought over, the priority is just to survive another day.  When a family of Jews fleeing Nazi persecution arrives in the valley, the locals will find their lives disrupted and filled with a sense of fear and unease. Sara will have to face her own contradictions and decide whether to follow her head... or her conscience.  The past, along with all the secrets that have remained buried under the snow for so many years, are about to surface. The burning cold has reached the mountains.', '2023-01-20', 'https://image.tmdb.org/t/p/w500/xa8pzQOxaGeqKJj9ny1W1gyngxX.jpg', NULL, 117, 7.2, 'Santi Trullenque', 0, 10752, '2025-06-06 14:31:13', '2025-06-06 14:31:13'),
(582, 'Operation Undead', 'Inexperienced Thai soldiers battle a growing undead menace in this gruesome survival horror. A Japanese military experiment that turns men into monsters escapes containment, it’s up to these troops to save their nation from annihilation.', '2024-07-20', 'https://image.tmdb.org/t/p/w500/rs10lMBnJFnJX1Y7MYpyB8JiNAF.jpg', 'https://www.youtube.com/embed/dtCvb6r1OOc', 110, 3.7, 'Kongkiat Khomsiri', 0, 10752, '2025-06-06 14:31:14', '2025-06-06 14:31:14'),
(583, 'Pearl Harbor', 'The lifelong friendship between Rafe McCawley and Danny Walker is put to the ultimate test when the two ace fighter pilots become entangled in a love triangle with beautiful Naval nurse Evelyn Johnson. But the rivalry between the friends-turned-foes is immediately put on hold when they find themselves at the center of Japan\'s devastating attack on Pearl Harbor on Dec. 7, 1941.', '2001-05-21', 'https://image.tmdb.org/t/p/w500/xwmy4OABVCQSX1EswFHc7VrE593.jpg', 'https://www.youtube.com/embed/zf3KAiimeUg', 183, 6.9, 'Michael Bay', 0, 10752, '2025-06-06 14:31:15', '2025-06-06 14:31:15'),
(584, 'Rust', 'Infamous outlaw Harland Rust breaks his estranged grandson Lucas out of prison, after Lucas is convicted to hang for an accidental murder. The two must outrun legendary U.S Marshal Wood Helm and bounty hunter Fenton \"Preacher\" Lang who are hot on their tails. Deeply buried secrets rise from the ashes and an unexpected familial bond begins to form as the mismatched duo tries to survive the merciless American Frontier.', '2025-05-01', 'https://image.tmdb.org/t/p/w500/tbJ3RkA2s6X5qrBzrYHYTxvDBui.jpg', 'https://www.youtube.com/embed/wAsagj_L3po', 139, 6.3, 'Joel Souza', 0, 37, '2025-06-06 14:31:16', '2025-06-06 14:31:16'),
(585, 'The Good, the Bad and the Ugly', 'While the Civil War rages on between the Union and the Confederacy, three men – a quiet loner, a ruthless hitman, and a Mexican bandit – comb the American Southwest in search of a strongbox containing $200,000 in stolen gold.', '1966-12-22', 'https://image.tmdb.org/t/p/w500/bX2xnavhMYjWDoZp1VM6VnU1xwe.jpg', 'https://www.youtube.com/embed/IFNUGzCOQoI', 161, 8.5, 'Sergio Leone', 0, 37, '2025-06-06 14:31:17', '2025-06-06 14:31:17'),
(586, 'Broke', 'A bronc rider in denial about his fading rodeo career battles against brain injury and a sudden blizzard while reflecting on how it became so difficult to achieve his dreams.', '2025-06-10', 'https://image.tmdb.org/t/p/w500/AmHHUQigx9di1MATgtXQ49DKBeN.jpg', 'https://www.youtube.com/embed/kzgsb7zUEZE', 104, NULL, 'Carlyle Eubank', 0, 37, '2025-06-06 14:31:18', '2025-06-06 14:31:18'),
(587, 'Once Upon a Time in the West', 'As the railroad builders advance unstoppably through the Arizona desert on their way to the sea, Jill arrives in the small town of Flagstone with the intention of starting a new life.', '1968-12-21', 'https://image.tmdb.org/t/p/w500/qbYgqOczabWNn2XKwgMtVrntD6P.jpg', 'https://www.youtube.com/embed/Yw-Av9BpC-w', 166, 8.3, 'Sergio Leone', 0, 37, '2025-06-06 14:31:19', '2025-06-06 14:31:19'),
(588, 'Django Unchained', 'With the help of a German bounty hunter, a freed slave sets out to rescue his wife from a brutal Mississippi plantation owner.', '2012-12-25', 'https://image.tmdb.org/t/p/w500/7oWY8VDWW7thTzWh3OKYRkWUlD5.jpg', 'https://www.youtube.com/embed/_iH0UBYDI4g', 165, 8.2, 'Quentin Tarantino', 0, 37, '2025-06-06 14:31:20', '2025-06-06 14:31:20'),
(589, 'Rango', 'When Rango, a lost family pet, accidentally winds up in the gritty, gun-slinging town of Dirt, the less-than-courageous lizard suddenly finds he stands out. Welcomed as the last hope the town has been waiting for, new Sheriff Rango is forced to play his new role to the hilt.', '2011-03-02', 'https://image.tmdb.org/t/p/w500/A5MP1guV8pbruieG0tnpPIbaJtt.jpg', 'https://www.youtube.com/embed/wIKG4s_uSRg', 112, 6.9, 'Gore Verbinski', 0, 37, '2025-06-06 14:31:21', '2025-06-06 14:31:21'),
(590, 'Shane', 'A weary gunfighter attempts to settle down with a homestead family, but a smouldering settler and rancher conflict forces him to act.', '1953-04-23', 'https://image.tmdb.org/t/p/w500/svr5ADpjXTCOQv8hmuJnB7I14Qv.jpg', 'https://www.youtube.com/embed/9R16fkT71dM', 118, 7.4, 'George Stevens', 0, 37, '2025-06-06 14:31:22', '2025-06-06 14:31:22'),
(591, 'The Man Who Shot Liberty Valance', 'Questions arise when Senator Stoddard attends the funeral of a local man named Tom Doniphon in a small Western town. Flashing back, we learn Doniphon saved Stoddard, then a lawyer, when he was roughed up by a crew of outlaws terrorizing the town, led by Liberty Valance. As the territory\'s safety hung in the balance, Doniphon and Stoddard, two of the only people standing up to him, proved to be very important, but different, foes to Valance.', '1962-04-13', 'https://image.tmdb.org/t/p/w500/4C1R0LEivLjbv3swAzJfzh0tzXl.jpg', 'https://www.youtube.com/embed/GqhRXr2Mhn0', 123, 7.8, 'John Ford', 0, 37, '2025-06-06 14:31:23', '2025-06-06 14:31:23'),
(592, 'The Magnificent Seven', 'Looking to mine for gold, greedy industrialist Bartholomew Bogue seizes control of the Old West town of Rose Creek. With their lives in jeopardy, Emma Cullen and other desperate residents turn to bounty hunter Sam Chisolm for help. Chisolm recruits an eclectic group of gunslingers to take on Bogue and his ruthless henchmen. With a deadly showdown on the horizon, the seven mercenaries soon find themselves fighting for more than just money once the bullets start to fly.', '2016-09-14', 'https://image.tmdb.org/t/p/w500/ezcS78TIjgr85pVdaPDd2rSPVNs.jpg', 'https://www.youtube.com/embed/q-RBA0xoaWU', 132, 6.5, 'Antoine Fuqua', 0, 37, '2025-06-06 14:31:24', '2025-06-06 14:31:24'),
(593, 'The Revenant', 'In the 1820s, a frontiersman, Hugh Glass, sets out on a path of vengeance against those who left him for dead after a bear mauling.', '2015-12-25', 'https://image.tmdb.org/t/p/w500/ji3ecJphATlVgWNY0B0RVXZizdf.jpg', 'https://www.youtube.com/embed/LoebZZ8K5N0', 157, 7.5, 'Alejandro González Iñárritu', 0, 37, '2025-06-06 14:31:25', '2025-06-06 14:31:25'),
(594, 'Spirit: Stallion of the Cimarron', 'A captured mustang remains determined to return to his herd no matter what.', '2002-05-24', 'https://image.tmdb.org/t/p/w500/cUgYrz4twiJ3QgVGpRfey984NIB.jpg', 'https://www.youtube.com/embed/4UzmHsy4u8s', 83, 7.7, 'Kelly Asbury', 0, 37, '2025-06-06 14:31:26', '2025-06-06 14:31:26'),
(595, 'Redeeming Love', 'A retelling of the biblical book of Hosea set against the backdrop of the California Gold Rush of 1850.', '2022-01-21', 'https://image.tmdb.org/t/p/w500/mV3vomFNiCQbSowGrp2penDGRqJ.jpg', 'https://www.youtube.com/embed/NJSjS36Pgx8', 134, 7.8, 'D.J. Caruso', 0, 37, '2025-06-06 14:31:27', '2025-06-06 14:31:27'),
(596, 'A Fistful of Dollars', 'The Man With No Name enters the Mexican village of San Miguel in the midst of a power struggle among the three Rojo brothers and sheriff John Baxter. When a regiment of Mexican soldiers bearing gold intended to pay for new weapons is waylaid by the Rojo brothers, the stranger inserts himself into the middle of the long-simmering battle, selling false information to both sides for his own benefit.', '1964-09-12', 'https://image.tmdb.org/t/p/w500/lBwOEpwVeUAmrmglcstnaGcJq3Y.jpg', 'https://www.youtube.com/embed/f_oZUWAdEe8', 99, 7.8, 'Sergio Leone', 0, 37, '2025-06-06 14:31:28', '2025-06-06 14:31:28'),
(597, 'True Grit', 'Following the murder of her father by a hired hand, a 14-year-old farm girl sets out to capture the killer. To aid her, she hires the toughest U.S. Marshal she can find—a man with \'true grit\'—Reuben J. \'Rooster\' Cogburn.', '2010-12-22', 'https://image.tmdb.org/t/p/w500/tCrB8pcjadZjsDk7rleGJaIv78k.jpg', 'https://www.youtube.com/embed/Q5fEgKj9QNs', 110, 7.3, 'Joel Coen', 0, 37, '2025-06-06 14:31:29', '2025-06-06 14:31:29'),
(598, 'The Half-Breed', 'In an attempt to brand himself as a serious actor, the smiling swashbuckler Douglas Fairbanks starred in THE HALF-BREED (1916), a Western melodrama written by Anita Loos and directed with flair by Allan Dwan. Fairbanks stars as Lo Dorman, who has been ostracized from society because of this mixed ethnicity - his Native American mother was abandoned by his white father. When Lo catches the eye of the rich white debutante Nellie (Jewel Carmen), he becomes a target for the racist Sheriff Dunn (Sam De Grasse), who wants to break them up and take Nelli for his own. This love triangle becomes a quadrangle with the arrival of Teresa (Alma Rubens), who is on the run from the law. Through fire and fury Lo must decide who and what he truly loves.', '1916-07-30', 'https://image.tmdb.org/t/p/w500/d66a73MZGiEfmD1KmTf7WdYeam5.jpg', NULL, 72, 6.0, 'Allan Dwan', 0, 37, '2025-06-06 14:31:30', '2025-06-06 14:31:30'),
(599, 'Tombstone', 'Legendary marshal Wyatt Earp, now a weary gunfighter, joins his brothers Morgan and Virgil to pursue their collective fortune in the thriving mining town of Tombstone. But Earp is forced to don a badge again and get help from his notorious pal Doc Holliday when a gang of renegade brigands and rustlers begins terrorizing the town.', '1993-12-25', 'https://image.tmdb.org/t/p/w500/wGFCvylul8iEQhJOKfwZGGvXMzA.jpg', 'https://www.youtube.com/embed/XTWYKf5hXIg', 130, 7.6, 'George P. Cosmatos', 0, 37, '2025-06-06 14:31:31', '2025-06-06 14:31:31'),
(600, 'Horizon: An American Saga - Chapter 1', 'In 1859, families discover the lure of the Old West as they settle in territories from Wyoming to Kansas. Meanwhile, a gruff cowboy soon finds himself on the run with a prostitute and a young boy after killing a fellow gunman.', '2024-06-26', 'https://image.tmdb.org/t/p/w500/hqDkO0W9uk4aiwzn3pTeLO7NPZD.jpg', 'https://www.youtube.com/embed/rLaYzHhHdok', 182, 6.9, 'Kevin Costner', 0, 37, '2025-06-06 14:31:32', '2025-06-06 14:31:32'),
(601, 'For a Few Dollars More', 'Two bounty hunters both pursue the brutal and sadistic bandit, El Indio, who has a large bounty on his head.', '1965-12-18', 'https://image.tmdb.org/t/p/w500/ooqASvA7qxlTVKL3KwOzBwy57Dh.jpg', 'https://www.youtube.com/embed/xZm8i5sGlWI', 132, 8.0, 'Sergio Leone', 0, 37, '2025-06-06 14:31:33', '2025-06-06 14:31:33'),
(602, 'Dances with Wolves', 'Wounded Civil War soldier John Dunbar tries to commit suicide—and becomes a hero instead. As a reward, he\'s assigned to his dream post, a remote junction on the Western frontier, and soon makes unlikely friends with the local Sioux tribe.', '1990-03-30', 'https://image.tmdb.org/t/p/w500/hw0ZEHAaTqTxSXGVwUFX7uvanSA.jpg', 'https://www.youtube.com/embed/N4gr-uXUg1M', 181, 7.8, 'Kevin Costner', 0, 37, '2025-06-06 14:31:34', '2025-06-06 14:31:34'),
(603, 'The Magnificent Seven', 'An oppressed Mexican peasant village hires seven gunfighters to help defend their homes.', '1960-10-12', 'https://image.tmdb.org/t/p/w500/e5ToxOyJwuZD4VOfI0qEn5uIjeJ.jpg', 'https://www.youtube.com/embed/SEgfAuFwads', 127, 7.5, 'John Sturges', 0, 37, '2025-06-06 14:31:35', '2025-06-06 14:31:35'),
(604, 'Unforgiven', 'William Munny is a retired, once-ruthless killer turned gentle widower and hog farmer. To help support his two motherless children, he accepts one last bounty-hunter mission to find the men who brutalized a prostitute. Joined by his former partner and a cocky greenhorn, he takes on a corrupt sheriff.', '1992-08-07', 'https://image.tmdb.org/t/p/w500/54roTwbX9fltg85zjsmrooXAs12.jpg', 'https://www.youtube.com/embed/amE57OniG9Y', 130, 7.9, 'Clint Eastwood', 0, 37, '2025-06-06 14:31:36', '2025-06-06 14:31:36'),
(605, 'Legends of the Fall', 'In early 20th-century Montana, Col. William Ludlow lives on a ranch in the wilderness with his sons, Alfred, Tristan, and Samuel. Eventually, the unconventional but close-knit family are bound by loyalty, tested by war, and torn apart by love, as told over the course of several decades in this epic saga.', '1994-12-23', 'https://image.tmdb.org/t/p/w500/t1KPGlW0UGd0m515LPQmk2F4nu1.jpg', 'https://www.youtube.com/embed/gwixnpxsoVU', 133, 7.4, 'Edward Zwick', 0, 37, '2025-06-06 14:31:37', '2025-06-06 14:31:37'),
(606, 'The Hateful Eight', 'Bounty hunters seek shelter from a raging blizzard and get caught up in a plot of betrayal and deception.', '2015-12-25', 'https://image.tmdb.org/t/p/w500/jIywvdPjia2t3eKYbjVTcwBQlG8.jpg', 'https://www.youtube.com/embed/GRG7fAPksbg', 188, 7.8, 'Quentin Tarantino', 0, 37, '2025-06-06 14:31:38', '2025-06-06 14:31:38'),
(607, 'El Infierno', 'After being deported back to Mexico, a man has no choice but to join the vicious drug cartel that has corrupted his hometown in order to survive.', '2010-09-03', 'https://image.tmdb.org/t/p/w500/vry7NyLM6I0fL53H2KxCX4uAz5H.jpg', 'https://www.youtube.com/embed/n4jQnRkj-gU', 148, 7.9, 'Luis Estrada', 0, 37, '2025-06-06 14:31:39', '2025-06-06 14:31:39'),
(608, 'Rio Bravo', 'A small-town sheriff in the American West enlists the help of a disabled man, a drunk, and a young gunfighter in his efforts to hold in jail the brother of the local bad guy.', '1959-03-18', 'https://image.tmdb.org/t/p/w500/4gI4KKmoi0d3yfsF71YU3S0I5t8.jpg', 'https://www.youtube.com/embed/VD55fwjvJlw', 141, 7.8, 'Howard Hawks', 0, 37, '2025-06-06 14:31:40', '2025-06-06 14:31:40'),
(609, 'Cowboys & Aliens', 'A stranger stumbles into the desert town of Absolution with no memory of his past and a futuristic shackle around his wrist. With the help of mysterious beauty Ella and the iron-fisted Colonel Dolarhyde, he finds himself leading an unlikely posse of cowboys, outlaws, and Apache warriors against a common enemy from beyond this world in an epic showdown for survival.', '2011-07-29', 'https://image.tmdb.org/t/p/w500/9uZsGCP4rvOHVGCpMpYq5gNCuNI.jpg', 'https://www.youtube.com/embed/0JlTboo4cPM', 119, 5.6, 'Jon Favreau', 0, 37, '2025-06-06 14:31:40', '2025-06-06 14:31:40'),
(610, 'Hang \'em High', 'Marshall Jed Cooper survives a hanging, vowing revenge on the lynch mob that left him dangling. To carry out his oath for vengeance, he returns to his former job as a lawman. Before long, he\'s caught up with the nine men on his hit list and starts dispensing his own brand of Wild West justice.', '1968-04-12', 'https://image.tmdb.org/t/p/w500/gFvRKgCAa1MKlcAKZfoDNdR2dgy.jpg', 'https://www.youtube.com/embed/GZkVtGhQoCg', 114, 6.9, 'Ted Post', 0, 37, '2025-06-06 14:31:41', '2025-06-06 14:31:41'),
(611, 'The Dressmaker', 'In 1950s Australia, beautiful, talented dressmaker Tilly returns to her tiny hometown to right wrongs from her past. As she tries to reconcile with her mother, she starts to fall in love while transforming the fashion of the town.', '2015-10-29', 'https://image.tmdb.org/t/p/w500/5Loofmo5GTt1Qe2Dz5ERLVlN98T.jpg', 'https://www.youtube.com/embed/uPCyjqGH914', 118, 7.0, 'Jocelyn Moorhouse', 0, 37, '2025-06-06 14:31:42', '2025-06-06 14:31:42'),
(612, 'The Harder They Fall', 'Gunning for revenge, outlaw Nat Love saddles up with his gang to take down enemy Rufus Buck, a ruthless crime boss who just got sprung from prison.', '2021-10-22', 'https://image.tmdb.org/t/p/w500/su9WzL7lwUZPhjH6eZByAYFx2US.jpg', 'https://www.youtube.com/embed/Poc55U2RPMw', 139, 6.6, 'Jeymes Samuel', 0, 37, '2025-06-06 14:31:43', '2025-06-06 14:31:43'),
(613, 'The Lone Ranger', 'The Texas Rangers chase down a gang of outlaws led by Butch Cavendish, but the gang ambushes the Rangers, seemingly killing them all. One survivor is found, however, by an American Indian named Tonto, who nurses him back to health. The Ranger, donning a mask and riding a white stallion named Silver, teams up with Tonto to bring the unscrupulous gang and others of that ilk to justice.', '2013-07-03', 'https://image.tmdb.org/t/p/w500/xRmsqvHnaWmrazJl9bTBqs4LAjp.jpg', 'https://www.youtube.com/embed/LoVhgaj6PiE', 149, 6.1, 'Gore Verbinski', 0, 37, '2025-06-06 14:31:44', '2025-06-06 14:31:44');
